	 ('07113041-770d-4e61-934b-9ea16a3ea16f','2022-11-14 13:46:19.986349','2022-11-14 13:46:19.986349',NULL,'11bcc74c-8762-4d65-a4d0-bc335ef1382d','',NULL,NULL,NULL,1,false,true,false,'1.7','Portable Document Format is a platform-independent format for representing formatted documents, developed by Adobe Systems Incorporated. It is the native format of Adobes Acrobat family of software products, version 1.7 corresponding to the release of Acrobat 8.0 and 9.0.  PDF is based on, and shares the same imaging model as, the PostScript page description language.  A PDF file comprises a Header section, a Body section containing the objects which make up the document, a Cross Reference Table, and a Trailer section.  PDF files can contain a wide variety of content, including text, images, video and audio.',NULL,NULL),
	 ('43cac1f8-3f8c-4d17-a742-5f57ff817452','2022-11-14 13:46:21.42024','2022-11-14 13:46:21.42024',NULL,'9bdf16d0-5f66-4bbe-b7b8-473e5bc73c7a','',NULL,NULL,NULL,1,false,true,false,'1a','The Portable Document Format/ Archive is a format designed for long term preservation by Adobe Systems. PDF/A is a simplified version of PDF 1.4, with all of the features from PDF 1.4 that would impede long term preservation removed. Removed features include Javascript, Audio/Visual content, LZW compression and encryption. A major principle of PDF/A is that it is self contained and not reliant on externalities thus all font and colour information is encoded into the file. PDF/A files are larger than other types of PDF files due to the need for embedded information.
PDF/A supports two levels of compliance PDF/A1-a (Accessible) and PDF/A1-b (Basic). PDF/A1-a is fully ISO 19005-1:2005 (PDF/A-1) compliant whereas PDF/A1-b is less stringent and not compliant. PDF/A1-a requires tagged PDF and Unicode whereas PDF/A1-b does not.','2005-10-01 00:00:00',NULL),
	 ('a545b27e-b412-4ec8-8dd3-d3340886cf9f','2022-11-14 13:46:22.26468','2022-11-14 13:46:22.26468',NULL,'5e717601-f19c-44c9-ab42-563fd2674990','',NULL,NULL,NULL,1,false,true,false,'1b','The Portable Document Format/ Archive is a format designed for long term preservation by Adobe Systems. PDF/A is a simplified version of PDF 1.4, with all of the features from PDF 1.4 that would impede long term preservation removed. Removed features include Javascript, Audio/Visual content, LZW compression and encryption. A major principle of PDF/A is that it is self contained and not reliant on externalities thus all font and colour information is encoded into the file. PDF/A files are larger than other types of PDF files due to the need for embedded information.
PDF/A supports two levels of compliance PDF/A1-a (Accessible) and PDF/A1-b (Basic). PDF/A1-a is fully ISO 19005-1:2005 (PDF/A-1) compliant whereas PDF/A1-b is less stringent and not compliant. PDF/A1-a requires tagged PDF and Unicode whereas PDF/A1-b does not.
The signature identification proposed for PDF/A 1b has been tested against a number of PDF/A and PDF files for verification. However, PDF itself is a complex format, and while the PDF/A 1b signature contained in PRONOM will identify many PDF/A 1b files, DROID can only identify what a file asserts itself to be. As there are a number of ways in which PDF/A 1b files can violate the PDF/A 1b conformance, which can not be spotted until the file is parsed, it is recommended that PDF files are tested against validation software when attempting to confirm identification. Further information concerning PDF/A violations, and a test suite of PDF items which fail to conform to PDF/A standards, can be found at http://www.pdfa.org/2011/08/isartor-test-suite/','2005-10-01 00:00:00',NULL),
	 ('65cec8f3-2a02-420c-9172-149a9e765aaa','2022-11-14 13:46:23.016495','2022-11-14 13:46:23.016495',NULL,'23155cef-62d2-4da6-884b-400793184c98','',NULL,NULL,NULL,1,false,true,false,'2a','The Portable Document Format/Archive is a format designed for long term preservation by Adobe Systems. PDF/A is an ISO standardised version of PDF, with all of the features from PDF that would impede long term preservation removed. A major principle of PDF/A is that it is self contained and not reliant on externalities thus all font and colour information is encoded into the file. PDF/A files are larger than other types of PDF files due to the need for embedded information. PDF/A2 supports three levels of compliance: PDF/A-2a (Accessible), PDF/A-2b (Basic). and PDF/A-2u (Unicode). The PDF/A-2 standard is a constrained subset of ISO 32000-1 (PDF 1.7), which includes PDF 1.0-1.7 and is defined by ISO 19005-2:2011, which has the formal name ''Document management  Electronic document file format for long-term preservation  Part 2: Use of ISO 32000-1 (PDF/A-2)''.',NULL,NULL),
	 ('23e53d81-bf48-4338-933f-ee387399b216','2022-11-14 13:46:29.687906','2022-11-14 13:46:29.687906',NULL,'10357ff6-eb5a-4b8f-b3d2-303adfe6f11c','',NULL,NULL,NULL,1,false,true,false,'','This ''exchange standard'' format is based on Adobe''s PDF 1.4 (2003) specification and includes additional notes specifically for delivery of high quality colour advertisements. It is a subset of the PDF specification, and an application standard as well as a file format standard. It is seen as a ''more reliable'' PDF file.',NULL,NULL),
