	 ('2bead365-5665-4441-bc29-8405f9612943','2022-11-14 13:46:38.478089','2022-11-14 13:46:38.478089',NULL,'154aa358-6878-4def-8a21-239525224610','',NULL,NULL,NULL,1,false,true,false,'','The Adaptive Multi-Rate (AMR or AMR-NB or GSM-AMR) audio codec is an audio compression format optimized for speech coding. AMR speech codec consists of a multi-rate narrowband speech codec that encodes narrowband (2003400 Hz) signals at variable bit rates ranging from 4.75 to 12.2 kbit/s with toll quality speech starting at 7.4 kbit/s.',NULL,NULL),
	 ('0235a4c1-2063-4a3c-af81-f12b6f3c4f77','2022-11-14 13:46:39.45339','2022-11-14 13:46:39.45339',NULL,'3417cd2c-cb16-445a-8715-968601459a68','',NULL,NULL,NULL,1,false,true,false,'','Adaptive Multi-Rate Wideband (AMR-WB) is a wideband speech audio coding standard based on Adaptive Multi-Rate encoding. AMR-WB provides a speech bandwidth of 507000 Hz compared to narrowband speech coders which in general offer around 3003400 Hz. AMR-WB was developed by Nokia and VoiceAge.',NULL,NULL),
