	 ('40142db9-5250-490e-bb6b-a2ba409ab9a7','2022-11-14 13:48:05.215868','2022-11-14 13:48:05.215868',NULL,'707340ee-cd0d-475d-a76b-1eaf57a8a30e','',NULL,NULL,NULL,1,false,true,false,'','The Advanced Systems Format is an extensible file format developed by Microsoft for storing multimedia data streams. It comprises a Header Object, which describes the properties of the data streams, a Data Object, which contains the actual data streams stored in Data Packets and, optionally, one or more Index Objects. ASF files can contain audio, video and still image data streams, and the format supports streaming across networks. ASF supports a variety of audio, video and still image compression types, although it is most widely used for storing Windows Media Audio and Video encoded data.','2004-11-01 00:00:00',NULL),
