	 ('10b91e2e-6093-4b90-8ae2-2a42cc774401','2022-11-14 13:48:25.025941','2022-11-14 13:48:25.025941',NULL,'39cc7913-028a-4bdb-abfd-d6aabf4d3c8d','',NULL,NULL,NULL,1,false,true,false,'','APNG is an extension of the PNG format, adding support for animated images. It is intended to be a replacement for simple animated images that have traditionally used the GIF format, while adding support for 24-bit images and 8-bit transparency. APNG is intended as a simpler alternative to MNG.

APNG is backwards-compatible with PNG; any PNG decoder should be able to ignore the APNG-specific chunks and display a single image.',NULL,NULL),
