	 ('6d3ca074-6f47-454c-a299-3cea1d45191f','2022-11-14 13:48:26.279524','2022-11-14 13:48:26.279524',NULL,'a77a857b-e716-4f23-93c0-c1d778bd7895','',NULL,NULL,NULL,1,false,true,false,'1.0','Apples Core Audio Format is a file format for storing and manipulating digital audio data. It is fully supported by Core Audio APIs on Mac OS X v10.4 and later and on Mac OS X v10.3 with QuickTime 7 or later. CAF provides high performance and flexibility, and is scalable to future ultra-high resolution audio recording, editing, and playback. CAF files have several advantages over other standard audio file formats:
