https://en.wikipedia.org/wiki/ISO_9660

http://fileformats.archiveteam.org/wiki/Universal_Disk_Format',NULL,NULL,NULL,1,false,true,false,'','Apple Partition Map - ISO 9660 - UDF Hybrid Disk Image, describes the contents and structure of optical disc media of Apple Partition Map (APM) partition scheme with ISO9660 and Universal Disk Format (UDF) file systems attached. Since all three schemes reside on the same optical disc this is most likely to be on DVD media type of file. APM partition scheme can be thought of as a container format for multiple file system image files, and in this entry together UDF file system developed for optical media by the Optical Storage Technology Association (OSTA) and ISO 9660 International Organization for Standardization (ISO), the hybrid system acts as a support for all three schemes and allows for disc to be rendered on various operating systems. A disk image is a uncompressed copy of the contents of a disk or a folder, it can facilitate certain types of backup and recovery strategies. Please see ID: fdd000348 from Library of Congress and other links attached to this entry for further information.',NULL,NULL),
	 ('176eeadc-9159-40d9-ae78-861daaf1e108','2022-11-14 13:48:37.052145','2022-11-14 13:48:37.052145',NULL,'ab5d03e4-be29-4779-9917-50077b6eb3ce','http://fileformats.archiveteam.org/wiki/Apple_Partition_Map

