https://en.wikipedia.org/wiki/Apple_Disk_Image

https://docs.microsoft.com/en-us/windows/win32/imapi/disc-formats',NULL,NULL,NULL,1,false,true,false,'','Apple Partition Map Disk Image is specific to describing the contents and structure of Apple Partition Map (APM) partition scheme, it can be thought of as a container format for multiple filesystem image files. It was developed by Apple in around 1988 with the introduction of Apple Partition Map scheme on Macintosh II, a scheme that defines how the data is organized on a singular disk. A disk image is a uncompressed copy of the contents of a disk or a folder, it can facilitate certain types of backup and recovery strategies. Please see ID: fdd000348 from Library of Congress and other links attached to this entry for further information.',NULL,NULL),
	 ('53ac5462-784c-4c04-973e-5565cc7ea1a1','2022-11-14 13:48:39.004557','2022-11-14 13:48:39.004557',NULL,'1e02e5cd-38a9-4a4f-ab4a-411418a751e7','http://fileformats.archiveteam.org/wiki/Apple_Partition_Map

