https://en.wikipedia.org/wiki/Apple_Disk_Image

https://en.wikipedia.org/wiki/Optical_disc_image

https://en.wikipedia.org/wiki/ISO_9660',NULL,NULL,NULL,1,false,true,false,'','Apple Partition Map ISO 9660 Hybrid is a hybrid to describing the contents and structure of Apple Partition Map (APM) partition scheme and ISO9660 file system for optical disc media. The hybrid system allows for ISO9660 as a primary volume descriptor and an Apple Partition Map, allowing the disc to work on different types of computers. Apple Partition Map was developed by Apple in around 1988 with the introduction of Macintosh II. ISO 9660 was written by International Organization for Standardization (ISO) and considered an international technical standard available for many operating systems. A disk image is a uncompressed copy of the contents of a disk or a folder, it can facilitate certain types of backup and recovery strategies. Please see ID: fdd000348 from Library of Congress and other links attached to this entry for further information.',NULL,NULL),
