	 ('72095a47-f972-4836-849f-ef1bff78e1e4','2022-11-14 13:48:44.805867','2022-11-14 13:48:44.805867',NULL,'8a5c9c13-bade-4b51-b4c5-822fd47d69a2','',NULL,NULL,NULL,1,false,true,false,'1','Apple Computers created the AppleSingle format (as well as the AppleDouble format) to represent and preserve the attributes of files across files systems that do not support the same attributes of the files home systems. AppleSingle is primarily a storage format and contains both a files contents and attributes. It consists of a header and one or more optional data entries followed by the byte stream of the file it is storing. It maintains the original Macintosh filename and file type (e.g. Mydoc.pdf). The AppleSingle format can store a number of different kinds of formats.',NULL,NULL),
