	 ('d92641a8-3297-4cb7-9759-63465b5289c6','2022-11-14 13:49:00.725075','2022-11-14 13:49:00.725075',NULL,'43da7dba-f7ef-4f25-94b2-f9c4ef486150','https://www.aseg.org.au/sites/default/files/pdf/ASEG-GDF2-REV4.pdf',NULL,NULL,NULL,1,false,true,false,'','ASEG-GDF2 (Australian Society of Exploration Geophysicists General Data Format Revision 2) is a data standard for the exchange and archive of geophysical data. Its primary purpose is to provide a consistent and self-documenting method for exchanging and archiving geophysical data between organisations with different hardware and software systems. For data to comply with the standard, it must be stored as a set of related ASCII files, which must include the following four filetypes as a minimum: File1.DAT, survey.DES, survey.DFN and survey.MET. The .dfn files enable the writing of code to enable to recovery of the geophysical data fields and their associated formats.',NULL,NULL),
	 ('c90096e0-cc11-4a0d-9f3e-07d4e8d8d056','2022-11-14 13:49:01.468188','2022-11-14 13:49:01.468188',NULL,'7344d530-1c97-4dc7-b1c2-335340addccd','ttps://www.aseg.org.au/sites/default/files/pdf/ASEG-GDF2-REV4.pdf',NULL,NULL,NULL,1,false,true,false,'','ASEG-GDF2 (Australian Society of Exploration Geophysicists General Data Format Revision 2) is a data standard for the exchange and archive of geophysical data. Its primary purpose is to provide a consistent and self-documenting method for exchanging and archiving geophysical data between organisations with different hardware and software systems.
For data to comply with the standard, it must be stored as a set of related ASCII files, which must include the following four filetypes as a minimum: File1.DAT, survey.DES, survey.DFN and survey.MET.',NULL,NULL),
