	 ('8f71870d-92f0-4b5e-9b1b-dd620a9acdbd','2022-11-14 13:49:06.060137','2022-11-14 13:49:06.060137',NULL,'b3cba02c-7982-49cb-bab2-934d9ee3b73c','https://www.etsi.org/deliver/etsi_ts/102900_102999/102918/01.03.01_60/ts_102918v010301p.pdf',NULL,NULL,NULL,1,false,true,false,'','The ASiC-E container is a ZIP archive file containing set of data objects and associated signatures. It is designed to associate an advanced electronic signature with any type of data. It operates with signature and time-stamp token formats XAdES, CAdES, timestamp RFC 3161.

The container has an internal structure including a root folder for all the container content possibly including folders reflecting the content structure and a META-INF folder, in the root folder, for metadata about the content, including associated signatures.

The integrity of the data is guaranteed by the electronic signature when present or should be provided externally if only a time-stamp token is applied to the data. Privacy can be guaranteed through the use of ZIP encryption features or externally. External integrity and privacy protection can be obtained e.g. through the use of SSL/TLS or S/MIME.

ASiC-E container contains multiple data objects, each object may be signed by one or more signature carried in the container.',NULL,NULL),
	 ('8363b638-382b-4355-b3e0-7c3c41a1067b','2022-11-14 13:50:20.689776','2022-11-14 13:50:20.689776',NULL,'f19f304f-ed1b-4a9e-b283-b0b4e1cf9ad8','',NULL,NULL,NULL,1,false,true,false,'','Autorun Maestro Menu Files are generated by a program called Autorun Maestro which was created by now-closed software developer Pollen Software. The software enables the user to create CD-Rom Autorun/Autoplay menus.',NULL,NULL),
	 ('19158869-78fa-4654-9783-aaa4896f465c','2022-11-14 13:49:06.643971','2022-11-14 13:49:06.643971',NULL,'d641d617-2c1b-4c03-8155-b49c6ad03db1','https://www.etsi.org/deliver/etsi_en/319100_319199/31916201/01.01.01_60/en_31916201v010101p.pdf

https://www.etsi.org/deliver/etsi_ts/102900_102999/102918/01.03.01_60/ts_102918v010301p.pdf',NULL,NULL,NULL,1,false,true,false,'','The ASiC-S container is a ZIP archive file containing set of data objects and associated signatures. It is designed to associate an advanced electronic signature with any type of data. It operates with signature and time-stamp token formats XAdES, CAdES, timestamp RFC 3161.

The container has an internal structure including a root folder for all the container content possibly including folders reflecting the content structure and a META-INF folder, in the root folder, for metadata about the content, including associated signatures.

The integrity of the data is guaranteed by the electronic signature when present or should be provided externally if only a time-stamp token is applied to the data. Privacy can be guaranteed through the use of ZIP encryption features or externally. External integrity and privacy protection can be obtained e.g. through the use of SSL/TLS or S/MIME.

ASiC-S container associates one or more signatures with a single data object.',NULL,NULL),
