	 ('b9f22a79-c121-4c28-8e7a-6d22ca3926ad','2022-11-14 13:49:13.726887','2022-11-14 13:49:13.726887',NULL,'7af0cd40-2b89-4ece-a2a8-dcc672d5216c','',NULL,NULL,NULL,1,false,true,false,'','ATCO-CIF is a file format for interchange of bus timetable information, primarily between the Department for Transport and service providers.',NULL,NULL),
	 ('b19611f3-492f-49fd-a203-48ac5d494e27','2022-11-14 13:49:16.230134','2022-11-14 13:49:16.230134',NULL,'7816f682-733a-47e2-bb90-3345ff91db1b','',NULL,NULL,NULL,1,false,true,false,'1.2','The Audio Interchange File Format (Audio IFF) provides a standard for storing sampled sounds. The format allows for the storage of monaural or multichannel sampled sounds at a variety of sample rates and sample widths. Audio IFF conforms to the " EA IFF 85" Standard for Interchange Format Files developed by Electronic Arts. Audio IFF is primarily an interchange format, although application designers should find it flexible enough to use as a data storage format as well. If an application does choose to use a different storage format, it should be able to convert to and from the format defined in this document. This will facilitate the sharing of sound data between applications. Audio IFF is the result of several meetings held with music developers over a period of ten months in 1987-88.',NULL,NULL),
	 ('08e4ffdf-bd1e-4788-a05b-46ec4fe5f9da','2022-11-14 13:49:16.924948','2022-11-14 13:49:16.924948',NULL,'23f7bb7a-c910-40b1-93b4-9481e0c23d3b','',NULL,NULL,NULL,1,false,true,false,'1.3','The Audio Interchange File Format (Audio IFF) was developed by Apple Computer, Inc., and provides a standard for storing sampled sounds. The format allows for the storage of monaural or multichannel sampled sounds at a variety of sample rates and sample widths.  Audio IFF was designed to serve primarily as an interchange format. Audio IFF conforms to the "EA IFF 85" Standard for Interchange Format Files developed by Electronic Arts. The audio data in a standard AIFF file is uncompressed pulse-code modulation (PCM). There is also a compressed variant of AIFF known as AIFF-C or AIFC, with various defined compression codecs. File specifications available at http://www-mmsp.ece.mcgill.ca/documents/audioformats/aiff/Docs/AIFF-1.3.pdf

This format is currently deprecated in favour of fmt/414 in order to remove a multiple identification conflict. Differences between version 1.2 and 1.3 relate to Apple II-specific application implementation. See the full specification for details.','1989-01-04 00:00:00',NULL),
	 ('ea9ca19e-da16-4cdc-a971-a48117c3248e','2022-11-14 13:49:17.674869','2022-11-14 13:49:17.674869',NULL,'54ff0c83-42e4-4798-917b-6387ecbae9e5','',NULL,NULL,NULL,1,false,true,false,'','The Audio Interchange File Format, Compressed (AIFF-C) provides a standard for storing uncompressed or compressed sampled sounds.  The format can store monaural or multichannel sampled sounds in a range of sample rates and sample widths.  The format is extensible to handle new compression types and application-specific data.','1991-08-26 00:00:00',NULL),
	 ('2fb8b8a9-6833-4c36-abed-c4dd11b937b8','2022-11-14 13:50:21.340718','2022-11-14 13:50:21.340718',NULL,'be79cb8b-a9ee-4807-8611-af72065711a8','',NULL,NULL,NULL,1,false,true,false,'','AutoShade was an early 3D rendering package for use with AutoCAD. AutoShade wrote the rendering to an .RND file as a 2D vector image.',NULL,NULL),
	 ('7301e16e-710d-4075-ace1-30c47f16759d','2022-11-14 13:49:18.377414','2022-11-14 13:49:18.377414',NULL,'7c10c92d-27bc-4d6c-bed4-e9154fabb48b','',NULL,NULL,NULL,1,false,true,false,'','Audio/Video Interleaved Format (AVI) is a chunk-based video format developed by Microsoft, based on the generic Resource Interchange File Format (RIFF) specification developed by Microsoft and IBM. Structurally, an AVI file is composed of a number of chunks, each comprising a four character code chunk identifier, the chunk size, and the chunk data. It comprises a RIFF header with an AVI data type identifier, followed by a series of chunks. Every file must include two List chunks. The first List chunk is the main AVI header chunk, which contain one or more Stream Header chunks, one for each data stream, describing the format of the data streams. The second LIST chunk is the movi chunk, which contains the actual data for the audio and video data streams. Other optional chunks are also allowed. The format supports a wide variety of compressed and uncompressed video encodings, but all audio streams are stored in Microsofts Waveform Audio format.',NULL,NULL),
