	 ('60167bdf-a5b2-4abb-ac8c-c80a8c8adf71','2022-11-14 13:49:37.383627','2022-11-14 13:49:37.383627',NULL,'b2f7f6c9-c7c6-4abc-a61f-c220250da5a4','',NULL,NULL,NULL,1,false,true,false,'2.1','The AutoCAD Drawing format is a vector graphics format, and is the native file format of AutoDesk''s AutoCAD family of products. The format is proprietary and AutoDesk does not make details of its structure public. The information contained here is derived primarily from the OpenDWG Alliance''s reverse-engineered documentation of the format, and should not therefore be regarded as definitive. The basic structure of a DWG file comprises a header section, a drawing class definitions section, the drawing object data, a drawing object map, which contains the locations of all the objects in the drawing, and an image data section, which may contain a raster image of the drawing in either Windows Bitmap (BMP) or Windows Metafile (WMF) format. DWG version 2.1 is the version of the format associated with Version 2.1 of AutoCAD.','1985-05-01 00:00:00',NULL),
	 ('a34796e4-5e6b-4600-af36-508ca21d04a2','2022-11-14 13:50:49.305','2022-11-14 13:50:49.305',NULL,'7617a3a7-6239-4164-bdab-bed5788521a7','',NULL,NULL,NULL,1,false,true,false,'1','Bink is a proprietary video file format developed by RAD Game Tools.',NULL,NULL),
	 ('2c6d7a13-0d98-4cd7-ba0f-552485492908','2022-11-14 13:49:30.59495','2022-11-14 13:49:30.59495',NULL,'0ef0f82d-aa23-456c-a52b-903749a2252b','',NULL,NULL,NULL,1,false,true,false,'6.0','AutoCAD Design Web Format (DWF) version 6 is the publishing format of Autodesk software, especially design data, such as 2D vector data, 3D vector data, animations, and metadata.  It uses the ZIP file format as the backing store mechanism.  The content can be roughly divided into:
        DWF metadata files  XML files that contain information pertaining to metadata and structure (author, title, creation time, section dependencies, section ordering, resource file descriptions, roles, MIME types, etc.) and pertaining to the section (page information, design metadata, etc.).  The structural metadata is used to create logical objects (collections of files to represent a part or page, etc.).
        Resource files  media or other content files that are referenced from the package/section metadata and are usually presentations of design data in various formats (ZGL, W2D, JPG, PNG, AVI, XML, TXT, DOC, etc.)
A DWF package must meet the following requirements:
        The first 12 bytes of the physical package file must contain the DWF version header.
        A manifest.xml file at the root of the zip archive that complies to the manifest.xsd schema
        File contents logically organized into sections, one for each component of the composite design.
        At least one resource file.
        The manifest must contain an <Interfaces> element containing at least one <Interface> sub element that indicates a document interface supported by the DWF package.  An example would be the ePlot document interface, which implies that the DWF contains at least one valid ePlot page.',NULL,NULL),
	 ('5e41bc11-0907-4432-8956-12de3cca3480','2022-11-14 13:49:31.547897','2022-11-14 13:49:31.547897',NULL,'516d77ea-7499-4747-b82f-011b062a1c1e','',NULL,NULL,NULL,1,false,true,false,'','DWFx is the newest version of the AutoCAD Design Web Format (DWF). DWFx is based on the XML Paper Specification (XPS). DWF and DWFx are  compressed file formats which can be suitable for distributing over the Internet for review. You can export a single drawing or publish multiple drawings and sheet sets into a DWF or DWFx file.',NULL,NULL),
