https://www.harrisgeospatial.com/docs/ENVIImageFiles.html',NULL,NULL,NULL,1,false,true,false,'','Band sequential file is an ASCII description file that stores the pixel values of an image in a file. It is commonly used in geospatial software. The file stores the data for each band of an image, for example data for all the pixels for the first band is stored first, and so on. To be interpreted the file requires a header file. Other optional information files that can appear alongside these are colour and statistic files.',NULL,NULL),
