	 ('70cbd683-13aa-49d9-8c5b-b15d7c74a613','2022-11-14 13:50:36.782556','2022-11-14 13:50:36.782556',NULL,'bf066562-5488-4012-8ea4-8f8161685523','http://www.cs.washington.edu/dm/vfml/appendixes/bif.htm',NULL,NULL,NULL,1,false,true,false,'','Bayesian Interchange files store the structure and probability tables for a Bayesian network, allowing for interchange of said networks between people, and facilitating comparison and discussion of research and other results.',NULL,NULL),
