	 ('5955cb15-d7d5-46b9-a4df-96e14b71c453','2022-11-14 13:50:37.490704','2022-11-14 13:50:37.490704',NULL,'a089a64b-209a-4dbb-8ef1-7ba07a5b9676','https://www.id.ee/?lang=en&id=34336. Standard: EVS 821:2009 BDOC - Format for Digital Signatures https://www.evs.ee/products/evs-821-2009',NULL,NULL,NULL,1,false,true,false,'1','BDOC is a digital signature format developed in 2014 to replace the old DDOC (DigiDoc) digital signature format in Estonia. Compared to DDOC, an important modification is that a .bdoc file is in fact a ZIP container with the signed files, the signatures and the protocol control information and can be opened by any program that recognises the ZIP format.',NULL,NULL),
	 ('958c6578-f1d1-4827-a66a-290abbb6531c','2022-11-14 13:50:39.519637','2022-11-14 13:50:39.519637',NULL,'63d350c4-4866-4548-9866-039b0174c32b','https://www.id.ee/public/BDOC2.0.bdoc https://www.id.ee/public/BDOC2.1.bdoc https://www.id.ee/public/bdoc21-TS.asice',NULL,NULL,NULL,1,false,true,false,'2.x','BDOC is a digital signature format specific to Estonia. National BDOC 2.1 standard EVS 821:2014 http://www.evs.ee/products/evs-821-2014. The format comprises two technically different subformats. In order for end users to be able to easy differentiate between these subformats, each subformat has obtained its own file extension - .bdoc and .asice. .bdoc or BDOC-TM or ASiC-E LT-TM is the BDOC signature format with a time-mark. The RFC 2560 standard based time-marks ensure long-term proofability of the authenticity of the signature. This format has been used as a default digital signature format in Estonia since 2015. .asice or BDOC-TS or ASiC-E LT is the BDOC signature format with a time-stamp. In contrast to the LT-TM format, long-term proofability of the authenticity of the signature is ensured by the RFC 3161 standard based time-stamps. The ASiC-E LT signature is highly compliant with the international standards. One can also differentiate between the subformats by inspecting the signature0.xml file: BDOC has element "SignaturePolicyIdentifier" whereas ASICE includes element "SignatureTimeStamp".',NULL,NULL),
	 ('f365d047-cf54-4531-9242-fcb76b8aa1ae','2022-11-14 13:50:41.124906','2022-11-14 13:50:41.124906',NULL,'59732b58-c824-4733-9b7a-5d1da127cdcb','http://fileformats.archiveteam.org/wiki/SIFF

https://fileinfo.com/extension/son

https://wiki.multimedia.cx/index.php/SIFF',NULL,NULL,NULL,1,false,true,false,'','A Beam Software SIFF file is an audio file used by a Beam Software video game. Beam Software is an Australian video game developer that was founded in 1978 and acquired by Krome Studios in 2006, at which point Beam was renamed Krome Studios Melbourne. In the 1990s, Beam produced a handful of games that use their proprietary SIFF file format.  The file contains music, sound effects, or dialogue played within a game. The files cannot be played by most popular media players but can be converted to a standard audio format.

The SIFF file format can be used to create files that contain both audio and video or just audio. When a SIFF format file contains both audio and video, it is saved with the .vb extension rather then .son extension.',NULL,NULL),
	 ('e1f87d63-41ec-45d6-af6b-f055e5b3e5ab','2022-11-14 13:50:41.877285','2022-11-14 13:50:41.877285',NULL,'b01f7ea2-e679-42bd-bf77-67efb71c9885','https://communities.bentley.com/',NULL,NULL,NULL,1,false,true,false,'','These are hidden line files, one of a range of files created when using Microstation CAD software for 2D and 3D design, which is produced by Bentley Systems, Incorporated.',NULL,NULL),
	 ('360ed4fb-0f3a-43cc-a48c-28885778c14c','2022-11-14 13:50:42.499887','2022-11-14 13:50:42.499887',NULL,'cffa1587-2f41-4891-a89a-21ec3925de4b','',NULL,NULL,NULL,1,false,true,false,'','The Bentley V8 DGN format is a computer aided design format used by Microstation 8 software. This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select Add an Entry.',NULL,NULL),
	 ('b98e48fb-53cf-4ca6-91bd-4677476dcf18','2022-11-14 13:50:43.597665','2022-11-14 13:50:43.597665',NULL,'df58fb6b-c1a3-4d58-b82e-0980cb186640','',NULL,NULL,NULL,1,false,true,false,'','Better Portable Graphics (BPG) is a raster image format created by Fabrice Bellard. It is intended as a compression-efficient alternative to the JPEG image format. It is based on the intra-frame encoding of the High Efficiency Video Coding (HEVC) video compression standard, and various metadata profiles (such as EXIF, ICC profile, XMP) are supported.',NULL,NULL),
	 ('ee020958-6e11-4265-b2eb-314169f6b904','2022-11-14 13:50:45.060202','2022-11-14 13:50:45.060202',NULL,'5270a79d-c5d1-47d6-b511-6251457b2a57','https://en.wikipedia.org/wiki/BibTeX',NULL,NULL,NULL,1,false,true,false,'','BibTeX is reference management software, used for formatting lists of references, enabling the consistent citing of sources in a range of styles. It was created in 1985, and is written in WEB/ Pascal. Bib files are lists of entries, each one corresponding to a bibliographical item, for a example book or article.',NULL,NULL),
	 ('ba7124ec-6529-4cc0-b8b8-1f25eb21be0c','2022-11-14 13:50:45.817152','2022-11-14 13:50:45.817152',NULL,'148385cc-9095-4baf-b153-dbc345a7476c','https://us.community.sony.com/s/question/0D50B00004YTYxDSAX/copy-entire-card-or-just-clips?language=en_US',NULL,NULL,NULL,1,false,true,false,'','BIM is a RealTime metadata file that is stored alongside the image files on cameras such as the Sony FS7. It can contain information such as focus distance, shutter speed, aperture in relation to time.',NULL,NULL),
	 ('24a13326-4a45-4ae9-a590-acac2896e242','2022-11-14 13:50:46.749175','2022-11-14 13:50:46.749175',NULL,'bfe1fbf2-7d25-46cc-8704-f9474e8a225a','https://en.wikipedia.org/wiki/Binary_file

http://fileformats.archiveteam.org/wiki/BIN_(Binary_Text)

http://www.acid.org/images/0896/XBIN.TXT

https://fileinfo.com/extension/bin',NULL,NULL,NULL,1,false,true,false,'','This entry records generic Binary File format. A binary file is a computer file that is not a text file, the term itself is often used to describe a "non-text file". Due to multiple varieties of this format, this file format entry does not include a file format signature. Although binary file is not a text-based file format, some files stored as binary can contain parts that can be interpreted as text; for example, some computer document files containing formatted text, such as older Microsoft Word document files, contain the text of the document but also contain formatting information in binary form.

The .bin extension is also used for the ''Binary Text (BIN)'' graphics format, a method of creating images using ANSI character encoding. This format has no distinctive name, file extension, or a signature, and is different than a text-based file, which can be edited in a text editor. More information about BIN (Binary Text) format can be found using the reference links provided. The newer version to BIN format which has a clear file format signiture is XBIN [fmt/1612].',NULL,NULL),
	 ('4a925b0a-f788-4734-8b34-ab3708e7373b','2022-11-14 13:50:47.572747','2022-11-14 13:50:47.572747',NULL,'2af638bc-d268-4806-aa26-a350d9fa5942','',NULL,NULL,NULL,1,false,true,false,'','In the OS X, iOS, NeXTSTEP, and GNUstep programming frameworks, property list files store serialized objects. It is the standard way to save and load data between the internal representation within the objects defined in an Objective-C program and disk files, in order to store program settings and other data. This is the binary version but there is also an XML version of the format.',NULL,NULL),
