	 ('da7dd55d-cd51-4a7f-8cb3-61f1b1cdd152','2022-11-14 13:50:51.510236','2022-11-14 13:50:51.510236',NULL,'b1259dbb-8707-4f34-bc07-a8f69892e91c','https://en.wikipedia.org/wiki/Bitstream_Speedo_Fonts

http://fileformats.archiveteam.org/wiki/Speedo

http://www.columbia.edu/~em36/wpdos/speedo.html

http://www.netsweng.com/~anderson/talks/xclass/fonts.html

https://web.archive.org/web/20091108153822/http://www.bitstream.com/fonts/support/speedo_fonts.html',NULL,NULL,NULL,1,false,true,false,'','The Speedo fonts are a type of scalable font, created by Bitstream, Inc. The font was widely used in the disk operating system (DOS) era of computers, but has since became obsolete and is not used by any current software. Speedo was used on Atari ST, Falcon, in the XyWrite word processor, and in very early versions of WordPerfect and Microsoft Windows. It was then replaced by more popular font types like Type 1 fonts. Before Speedo was considered obsolete it was supported by the X Window System through the speedo module, and most Linux distributions had a Speedo font package, but support was removed from X in the X11R7.0 release in 2005. Speedo fonts include large international character set (over six hundred characters) and they are able to adapt their "pixels", "points", "horiz", "vert", and "avgwidth" XLFD values to match whatever value is requested by the X server.',NULL,NULL),
