	 ('6553be0c-eebd-4f1f-85a7-33e21099135f','2022-11-14 13:50:59.778702','2022-11-14 13:50:59.778702',NULL,'fbc37832-8497-4f00-9e3b-25b849f6aaac','',NULL,NULL,NULL,1,false,true,false,'LRF','Broad Band eBook (BBeB) is a proprietary e-book format created by Sony and Canon for Sony e-book readers. The LRF variant is a compiled, unencrypted version of an LRS file. Sony discontinued development of BBeB in 2010, in favour of the EPUB format.',NULL,NULL),
	 ('55625895-b665-4e1e-976c-77589c35cdbf','2022-11-14 13:51:03.836603','2022-11-14 13:51:03.836603',NULL,'8c0c3be3-74ed-4416-8fcf-5cb07a6aeebb','',NULL,NULL,NULL,1,false,true,false,'0 Generic','Broadcast WAVE is a chunk-based audio format developed by the European Broadcasting Union, and based on the Microsoft WAVE format, which is in turn based on the generic Resource Interchange File Format (RIFF) specification developed by Microsoft and IBM. Structurally, a BWAVE file is composed of a number of chunks, each comprising a four character code chunk identifier, the chunk size, and the chunk data. It comprises a RIFF header with a WAVE data type identifier, followed by a series of chunks. Every file must include a Broadcast Audio Extension chunk, containing metadata required for exchange of information between broadcasters, a Format chunk, which describes the format of the audio data, and a Data chunk, containing the audio data itself. BWAVE files which contain MPEG-encoded audio data must also include a Fact chunk, containing file-dependent information about the audio data, and an MPEG Audio Extension chunk, containing extra information required to describe the MPEG encoding.  A BWAVE identified as generic by DROID likely uses an encoding format unknown to PRONOM, or perhaps a structural difference, and users are encouraged to let the PRONOM team know should this occur.','1997-01-01 00:00:00','2001-07-01 00:00:00'),
