	 ('618d666e-1fd8-4fca-841d-ef3a1944b4fa','2022-11-14 13:51:17.497409','2022-11-14 13:51:17.497409',NULL,'0a3ccfa0-897d-49bc-9372-0ce42f623c42','',NULL,NULL,NULL,1,false,true,false,'','File written in C programming language that can be opened and viewed in any text editor. As a source code file, it can be converted into machine language by a compiler, creating an executable program. Since 1989, the language has been standardised by the International Organisation for Standardization (ISO) and ANSI. Programmes written in C can be used in a wide variety of operating systems and computer programmes, if they are standards compliant, with minimal changes to their source code.',NULL,NULL),
	 ('eb2e9583-6a61-426c-908b-5999e8da7f22','2022-11-14 13:51:18.948102','2022-11-14 13:51:18.948102',NULL,'1f35e617-12dc-4e8f-8524-b59ba874810b','https://cplusplus.com/articles/Gw6AC542/

