	 ('d2cf5d6f-0f76-41db-882d-4156a412c9e3','2022-11-14 13:51:20.968525','2022-11-14 13:51:20.968525',NULL,'739c2147-220b-4918-a1ce-25415dcc823f','',NULL,NULL,NULL,1,false,true,false,'','C3D, or Coordinate 3D, is a biomechanics data file format that is a component of the family of file formats developed for the AMASS photogrammetry software system. C3D format provides a means for storing 3D coordinate and analog data, together with all associated parameters, for a single measurement trial.',NULL,NULL),
