https://web.archive.org/web/20220116225524/https://www.digitalkameramuseum.de/en/cameras/item/casio-qv-10',NULL,NULL,NULL,1,false,true,false,'','Casio QV CAM file format is a proprietary raster image format of Casio QV digital camera series. The QV series camera were originally packaged with built in flash memory to store images with a special data cable that allowed for transfer to a personal computer whilst using the QV-Link software. Using the software, the CAM format allowed for images to be uploaded back to its camera. The format could be considered a camera data image format, as some files contain JFIF or other encoding. The QV-Link software allowed for CAM file to be saved as TIFF, JPEG, or BM format for MS-Windows; or PICT, TIFF, or JPEG for Macintosh.

The first of the series, QV-10, was announced in November 1994 and was originally developed by a team led by Hiroyuki Suetaka in 1995. It was the world''s first consumer LCD digital camera, meaning that it was the first electronic camera in history that allowed users to record and view the images right away. The relatively low cost of the camera helped it achieve wide success and was influential in the rise in popularity of digital photography. The full list of QV series can be found following the links provided in Notes section.',NULL,NULL),
