	 ('4b1a2184-7b27-4cb3-b0fb-4b3acff97d36','2022-11-14 13:52:01.244974','2022-11-14 13:52:01.244974',NULL,'e2600779-3f5e-4425-a36d-b2fe0dc5c7d4','',NULL,NULL,NULL,1,false,true,false,'','CD-ROM XA (Compact Disc - read-only-memory, extended architecture) is a modification of CD-ROM that defines sectors that enable it to read and display data, graphics, video, and audio. Photo CD, Video CD, CD-EXTRA and Super Video CD have all been based on CDXA and it may be possible to further distinguish between these different CDXA variant formats with further PRONOM research.',NULL,NULL),
