	 ('527c0271-b9c1-44b0-bc7b-0a5ffde35c2a','2022-11-14 13:52:25.787256','2022-11-14 13:52:25.787256',NULL,'21243462-bfc7-490c-aeda-153a44b78317','http://fileformats.archiveteam.org/wiki/COKE_(Atari_Falcon)

https://temlib.org/AtariForumWiki/index.php/COKE_file_format',NULL,NULL,NULL,1,false,true,false,'','COKE Format is a simple uncompressed raster image format associated with Atari Falcon computers.

The Atari Falcon030 (usually shortened to Atari Falcon), released in 1992, was the final personal computer product from Atari Corporation. A high-end model of the Atari ST line, the machine is based on a Motorola 68030 CPU and a Motorola 56000 digital signal processor, a feature which distinguishes it from most other microcomputers of the era. It included a VIDEL programmable graphics system which greatly improved graphics capabilities.',NULL,NULL),
	 ('981f4d59-79da-4743-b465-1815f45b05ef','2022-11-14 13:52:26.437236','2022-11-14 13:52:26.437236',NULL,'6dcfa1c6-e41f-4243-a2e6-d22ba1130709','Documentation (maintained by the community): https://helpx.adobe.com/coldfusion/developing-applications/the-cfml-programming-language.html',NULL,NULL,NULL,1,false,true,false,'','ColdFusion Markup Language (CFML) is a scripting language used for writing web pages and dynamic PC applications. It was created in 1995 by corporation Allaire, but was acquired by Adobe in 2005. ColdFusion Markup Language tags have a similar format to html tags, (for example, they are enclosed in angle brackets.) These are text based files, which can be opened by any text editor, such as Notepad.',NULL,NULL),
	 ('b3aa5a1f-7af1-48a1-8cdd-e9f9bebedece','2022-11-14 13:52:27.967487','2022-11-14 13:52:27.967487',NULL,'e8c27b9d-5c17-4019-b7ab-62353e847388','',NULL,NULL,NULL,1,false,true,false,'','The COLLADA (COLLAborative Design Activity) Digital Asset Exchange format is an open standard XML specification for 3D images and animations.',NULL,NULL),
	 ('630c5689-671b-4437-a325-ab51eff27105','2022-11-14 13:52:28.677127','2022-11-14 13:52:28.677127',NULL,'d9c808d2-db71-4c13-b8ec-618a7c29c84d','',NULL,NULL,NULL,1,false,true,false,'','Comic Book Archive (or comic book reader) files are zipped/compressed folders containing a number image files (although folders may be used to group images), for the purpose of the sequential viewing of these images, usually for comic books. They use a naming system which allows them to be displayed in order when used with a comic book reader, such as CD display. Comic book archive files are not a distinct file format; only the file extension differentiates them from the compressed file type they use. Comic book archive files use the following compression: .cb7 (7z), .cba (ACE), .cbr (RAR), .cbt (TAR), .cbz ( ZIP).',NULL,NULL),
	 ('8765530c-010a-4fbb-a398-16e8437e9811','2022-11-14 13:52:29.690903','2022-11-14 13:52:29.690903',NULL,'eac988a4-47d3-44d9-8ab7-52a938bbd9db','',NULL,NULL,NULL,1,false,true,false,'','A comma-separated values (CSV) file file stores tabular data (numbers and text) in plain text. Plain text means that the file is interpreted a sequence of characters, so that it is human-readable with a standard text editor. Each line of the file is a data record.',NULL,NULL),
	 ('9801a724-c3d2-481d-a6c3-976eebb0f8a5','2022-11-14 13:52:30.540049','2022-11-14 13:52:30.540049',NULL,'f45d00e5-abe1-4403-97b8-4596c29536ad','',NULL,NULL,NULL,1,false,true,false,'6 onwards','This is a compound version of Wordperfect for Windows. Also known as Corel WordPerfect. Major and minor version fields are the main variants between 6.x and 12 formats (The last two bytes in this signature). The major version is the same for 6.x through to 12 documents - 2. The minor version byte for a non-compound file created in WPWin 8.0 is 1. The minor version for a compound file created in WPWin 8.0. Is 2.',NULL,NULL),
	 ('2b99dbee-d0f0-472a-8fb1-a275c48e4fa8','2022-11-14 13:52:31.477924','2022-11-14 13:52:31.477924',NULL,'5d088f73-979d-4d29-99c4-b7350b02bc48','',NULL,NULL,NULL,1,false,true,false,'','This is a ZIP container version of the MusicXML format, an XML based format. It was designed for sharing sheet music files between applications, and for archiving sheet music files for use in the future.',NULL,NULL),
