	 ('ed8f504a-6c89-49f7-bd44-3fbcb6f7be59','2022-11-14 13:52:36.987933','2022-11-14 13:52:36.987933',NULL,'8801f2cc-ef83-4c13-a7c6-512c13d29de2','',NULL,NULL,NULL,1,false,true,false,'1','Computer Graphics Metafile (CGM) is a standardized platform-independent format used for the interchange of raster and vector data. CGM was developed under the auspices of the International Standards Organization (ISO) and the American Standards National Institute (ANSI). It is also used in conjunction with a variety of input and output devices. Although CGM incorporates extensions designed to support raster data storage, files in CGM format are used primarily to store vector information. CGM files typically contain either bitmap or vector data, but rarely both. It uses Clear Text Encoding.
