	 ('a9c676c1-baf0-49d3-b6b4-648bd9e8c4bd','2022-11-14 13:53:20.66868','2022-11-14 13:53:20.66868',NULL,'3534d7c3-7152-420a-b38d-c9da06eee743','http://fileformats.archiveteam.org/wiki/Cyber_Paint_Sequence

https://doudoroff.com/atari/cyberpaint.html',NULL,NULL,NULL,1,false,true,false,'','Cyber Paint Sequence is an animated raster graphics format associated with the Cyber Paint application created by Jim Kent for Atari ST computers. The aplication Cyber Paint was used with 2D animation program that brought together a wide variety of animation and paint functionality and the delta-compressed animation format developed for CAD-3D. Cyber Paint was one of the first consumer program that enabled the user to paint across time in a compressed digital video format. The programme was based on its predecessor Flicker, with Cyber Paint Sequence format being able to handle hundreds of frames rather than ten or twelve only.',NULL,NULL),
	 ('a7b1e486-9cb0-4927-801e-e52f1d8c4480','2022-11-14 13:53:21.397681','2022-11-14 13:53:21.397681',NULL,'768aa58b-ec5b-4e25-b930-79b1c2cfe0d5','',NULL,NULL,NULL,1,false,true,false,'','Cypher is a declarative graph query language for the open source graph database, Neo4j. Although it has regular and well defined syntax, there are no magic numbers or header sequences. As such, there is no current means to identify a file as CQL by binary sequence alone, so identification of this format is by extension only.',NULL,NULL),
