http://docplayer.net/210522943-Daisy-dot-iii-copyright-1990-by-roy-goldman.html',NULL,NULL,NULL,1,false,true,false,'III','Daisy-Dot is a text processing program written by Roy Goldman for the Atari line of computers enabling dot-matrix printers to utilise near letter quality (NLQ) printing technology. Three versions of Daisy-Dot were released between 1987 and 1990. A number of Daisy-Dot font files are pre-packaged with the text processor while others can be user-generated using the Daisy-Dot font editor. Daisy-Dot I and II fonts can be identified by the ASCII signature ''3'' followed by 0x9B.',NULL,NULL),
	 ('fd53abd1-9747-4adf-9f51-5560f3bd7e41','2022-11-14 13:53:23.300253','2022-11-14 13:53:23.300253',NULL,'d1b542eb-91fb-4734-9c1e-91f92eedb879','',NULL,NULL,NULL,1,false,true,false,'','Dalvik is the process virtual machine in Google''s Android operating system, which executes applications written for Android. Programs are commonly written in Java and compiled to bytecode for the Java virtual machine, which is then translated to Dalvik bytecode and stored in .dex (Dalvik EXecutable) and .odex (Optimized Dalvik EXecutable) files.',NULL,NULL),
	 ('113b0149-7d11-41b9-a2a6-3cb1ebe446ce','2022-11-14 13:53:23.872348','2022-11-14 13:53:23.872348',NULL,'47160321-00ab-4c80-a078-0471171cd46a','',NULL,NULL,NULL,1,false,true,false,'Generic','.dat files are used by many different applications as a general data store. Some may have a precise structure, but this entry is intended as a catch-all for extension-only identification for those .dat formats that do not yet have a PRONOM identification signature. For ESRI ArcInfo DAT File (Internal), see fmt/1600.',NULL,NULL),
	 ('422c0665-6234-4910-b710-07b1b1817e9a','2022-11-14 13:53:24.486411','2022-11-14 13:53:24.486411',NULL,'28f2fb49-50ec-47c9-8080-3ba0273b1b1a','',NULL,NULL,NULL,1,false,true,false,'','Data Interchange Format (.dif) is a text file format used to import/export single spreadsheets between spreadsheet programs (OpenOffice.org Calc, Excel, Gnumeric, StarCalc, Lotus 1-2-3, FileMaker, dBase, Framework, Multiplan, etc.). It is also known as Navy DIF. One limitation is that DIF format cannot handle multiple spreadsheets in a single workbook.',NULL,NULL),
