http://www.textfiles.com/programming/FORMATS/animfile.txt',NULL,NULL,NULL,1,false,true,false,'','DeluxePaint Animation software was a 1990s graphics editor for MS-DOS and released by Electronic Arts. Uses for the pixel graphic animations created included video games. The ANM file format defines key frame based animations of a vector 3D model (with model data in a separate file).  The file consists of ASCII text defining locations of bones in the model at key frames.  Complex hierarchies of 3D structures can be formed to  decrease file complexity for common animations.  Events can be used to chain shorter animations into longer animations.',NULL,NULL),
