	 ('70bbd547-1f73-4b38-ad01-c2739536ab22','2022-11-14 13:53:42.380673','2022-11-14 13:53:42.380673',NULL,'7f95ad32-e019-4d1d-8b2f-df78c851b5e6','https://dicom.nema.org/medical/dicom/current/output/pdf/part10.pdf

https://dicom.nema.org/medical/dicom/current/output/pdf/part12.pdf

https://www.dicomstandard.org/',NULL,NULL,NULL,1,false,true,false,'','Digital Imaging and Communications in Medicine (DICOM) is a standard for handling, storing, printing, and transmitting information in medical imaging. It includes a file format definition and a network communications protocol. The communication protocol is an application protocol that uses TCP/IP to communicate between systems. DICOM files can be exchanged between two entities that are capable of receiving image and patient data in DICOM format. The National Electrical Manufacturers Association (NEMA) holds the copyright to this standard. It was developed by the DICOM Standards Committee, whose members are also partly members of NEMA.',NULL,NULL),
