	 ('2f88e0cd-d609-4f1a-80c1-a3187fb29745','2022-11-14 13:53:44.383979','2022-11-14 13:53:44.383979',NULL,'0b501151-6778-4733-bd6a-c55f5dbf163e','',NULL,NULL,NULL,1,false,true,false,'1.0','The Digital Negative (DNG) Specification describes a non-proprietary file format for storing camera raw files that can be used by a wide range of hardware and software vendors.  DNG is an extension of the TIFF 6.0 format, and is compatible with the TIFF-EP standard.
This initial version accompanied the launch of DNG and related products. It was a rare, possibly unique, example of a raw image format specification published by its owner. It was adequate for representing typical images, but it had a few errors and deficiencies (specifically the lack of support for "masked pixels" and an inadvertent deviation from the JPEG specification) that required it soon to be replaced by the next version.','2004-09-27 00:00:00',NULL),
	 ('5a628bef-ad50-4b9c-abd4-fcdd10bc5768','2022-11-14 13:53:45.123229','2022-11-14 13:53:45.123229',NULL,'f5050971-e4e7-4919-ab21-163c4be1d965','',NULL,NULL,NULL,1,false,true,false,'1.1','The Digital Negative (DNG) Specification describes a non-proprietary file format for storing camera raw files that can be used by a wide range of hardware and software vendors.  DNG is an extension of the TIFF format, and is compatible with the TIFF-EP standard.
This version was published in February 2005 and corrected the flaws in the first version. It has proved capable of representing raw images for a large variety of cameras (both when written in-camera or via conversion from other raw image formats) for a few years, and it is the version still typically written in-camera.',NULL,NULL),
	 ('2220e0f1-9030-40f6-aa31-dd9e4827e013','2022-11-14 13:53:45.880468','2022-11-14 13:53:45.880468',NULL,'5402c577-e767-49c7-be6d-9922222fb4c6','',NULL,NULL,NULL,1,false,true,false,'1.2','The Digital Negative (DNG) Specification describes a non-proprietary file format for storing camera raw files that can be used by a wide range of hardware and software vendors.  DNG is an extension of the TIFF 6.0 format, and is compatible with the TIFF-EP standard.
This version, published May 2008, was based on experience and feedback from other companies about DNG since its launch. It introduced many new features, especially several new options for colour specification under the general heading of "Camera Profiles". These are mainly of value to software products wanting their own flavour of colour handling. This version permits administrative control of Camera Profiles, including calibration signatures and copyright information.',NULL,NULL),
	 ('14b42194-c4c1-41f0-8246-f0d9ccda57ee','2022-11-14 13:53:46.643553','2022-11-14 13:53:46.643553',NULL,'3aee1617-48d3-496c-9b44-c7649f82e2ad','',NULL,NULL,NULL,1,false,true,false,'1.3','The Digital Negative (DNG) Specification describes a non-proprietary file format for storing camera raw files that can be used by a wide range of hardware and software vendors.  DNG is an extension of the TIFF 6.0 format, and is compatible with the TIFF-EP standard.
This version, published June 2009, added various improvements, but the major change was to introduce "Opcodes". An Opcode and any associated parameters identifies a specific process to be applied to some or all of the raw image data during the conversion process.',NULL,NULL),
