	 ('07deffe0-b985-4fa3-b5c3-cae042cb9645','2022-11-14 13:53:50.666253','2022-11-14 13:53:50.666253',NULL,'25c096ae-1768-440d-93d5-f565968d320f','',NULL,NULL,NULL,1,false,true,false,'','The DirectMusic Segment is a file format created by Microsoft. The files can be played with DirectMusic API using a Microsoft Software Synthesizer or any installed MIDI output device. DirectMusic provides DLS support, and SGT files often accompany sound banks. SGT files contain playing order and track information. Segment files always come with DirectMusic Style files, which contain all required melody pattern information.',NULL,NULL),
