	 ('16d56e6a-ac7e-4128-81e7-5fffb9adfb84','2022-11-14 13:53:52.00338','2022-11-14 13:53:52.00338',NULL,'3b68c117-12a6-4b68-a041-681ea03f29bd','',NULL,NULL,NULL,1,false,true,false,'','DiskDoubler is a data compression utility for the Apple Macintosh. Individual files are compressed by the software, but their file system details do not change, meaning files subject to DiskDoubler compression retain their original names, including file extensions. As such DROID and other PRONOM-based file format identification tools may report file format mismatch for DiskDoubler-compressed files.',NULL,NULL),
