http://www.dnabaser.com/help/samples/what%20is%20a%20chromatogram.html

http://fileformats.archiveteam.org/wiki/SCF',NULL,NULL,NULL,1,false,true,false,'3.00','DNA Sequence Chromatogram File format refers to Chromatogram files, which have .scf as their file extension. They are associated with the DNA Baser Sequence Aligner software and are used to store data from DNA sequencing instruments.

The files contain the data for a single reading and includes: its trace sample points, its called sequence, the positions of the bases relative to the trace sample points, and numerical estimates of the accuracy of each base.
