	 ('b0d45cad-1923-4011-a5ee-ee5ec20ca5a1','2022-11-14 13:54:01.64989','2022-11-14 13:54:01.64989',NULL,'e5eb632d-a2b7-474f-af6e-a912c50eff70','',NULL,NULL,NULL,1,false,true,false,'1.0','The Drawing Interchange Binary Format (DXB) is a vector graphics format developed by AutoDesk for its AutoCAD family of products. A DXB file comprises a file header followed by zero or more data records. Each data record begins with a single byte identifying the record type, followed by one or more data items. The DXB format should not be confused with the binary encoded version of the Drawing Interchange File Format (DXF) - DXB is an entirely separate format, being much simpler and more compact.','1990-10-01 00:00:00',NULL),
	 ('a892aae6-87b6-4cea-86fa-0d7901611292','2022-11-14 13:54:02.240681','2022-11-14 13:54:02.240681',NULL,'31aec1b8-584e-4586-9c58-a0120ae377ae','',NULL,NULL,NULL,1,false,true,false,'1.0','ASCII DXF format is the ASCII encoded variant of the Drawing Interchange File Format, an exchange format for vector graphics developed by AutoDesk. They are probably the widely-used formats for exchanging vector data, and have become a de-facto industry standard. The format is owned by AutoDesk and typically changes with each release of their AutoCAD family of products. DXF files contain a tagged representation of the vector data. The structure comprises a Header section, followed by sections containing data on Classes, Tables, Blocks, Entities and, optionally, thumbnail images. Each section contains a series of data elements. each preceded by a group code tag, which indicates the type of data element. ASCII DXF version 1.0 is the version of the format associated with Version 1.0 of the AutoCAD family of software products.','1982-12-01 00:00:00',NULL),
