	 ('b34a61fb-c4e9-4bb4-ab15-9d81f30e7aab','2022-11-14 13:54:25.35457','2022-11-14 13:54:25.35457',NULL,'a6fcd88e-e842-4fcb-877b-651396f0f935','',NULL,NULL,NULL,1,false,true,false,'1.0','The DROID File Collection File format is a format for storing the results of file format identifications generated by the DROID software tool. It was developed by The National Archives of the UK. A DROID File Collection File is an XML document, comprising a ''FileCollection'' element, which describes the version of DROID and Signature File version number used to perform the identifications number, and date on which the identifications were generated. This element contains a ''File'' element for each file being identified. A File Collection File may either be generated prior to identification, in which case each ''File'' element simply contains the fully-qualified pathname of the file, or it can be generated after identification, in which case each ''File'' element additionally contains the identification result.','2005-09-17 00:00:00',NULL),
	 ('f2eb9be5-a2bf-44ed-9120-60a3107fbfaf','2022-11-14 13:54:26.05996','2022-11-14 13:54:26.05996',NULL,'2565d249-82e7-4edb-ad3e-67b2338da952','',NULL,NULL,NULL,1,false,true,false,'1.0','The DROID Signature File format is a format for storing internal and external signatures used by the DROID software tool to perform automatic file format identification. It was developed by The National Archives of the UK. DROID Signature Files are generated by TNA from the PRONOM technical registry, and are issued periodically as new formats are added to the registry. A DROID Signature File is an XML document, comprising an ''FFSignatureFile'' element, which describes the version number and date of the signature file, an ''InternalSignatureCollection'' element, which contains the set of internal signature values, and a ''FileFormatCollection'' element, which contains information on the set of formats described, together with their associated external signatures. The version number of a Signature File is incremented each time a new signature file is issued from the PRONOM registry, and does not indicate a different version of the format itself.','2005-09-17 00:00:00',NULL),
	 ('31ff43d2-a9e6-4b80-aea6-97520c3848ae','2022-11-14 13:54:28.416127','2022-11-14 13:54:28.416127',NULL,'2f2a5161-129c-4b18-9757-b9f1eb4d0e19','',NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select Add an Entry.',NULL,NULL),
	 ('6cb52063-9ffc-489c-8292-0bb7c537ba2c','2022-11-14 13:54:30.675205','2022-11-14 13:54:30.675205',NULL,'2d39f701-6e5d-413c-9bc6-9b99f24d6531','',NULL,NULL,NULL,1,false,true,false,'','IFO files contain DVD-Video Disc Information including headers that tell the DVD player what screen to show at startup, where each chapter starts, where audio tracks are located on the disc, etc. IFO files are accompanied by BUP files which are backups of the IFO files and therefore completely identical.',NULL,NULL),
