http://fileformats.archiveteam.org/wiki/RCL',NULL,NULL,NULL,1,false,true,false,'5-6','This entry combines Easy CD Creator Layout version 5 with extension CL5 and Roxio Easy CD Creator Layout version 6 with extension RCL, which are both part of Roxio disc project formats. CL5 and RCL files are formed using Easy CD Creator, a software originally published by Adaptec in 1996 after Adaptec merged its Easy-CD Pro with Corel CD Creator, RCL files were part of Adaptec''s re-brading to Roxio. CL5 version of Easy CD Creator Layout formats was published in 2001 after Adaptec spun-off their digital media division as Roxio, but prior to rebranding Easy CD Creator as Roxio Easy CD Creator - creating RCL files. Easy CD Creator software allowed the user to create data or audio CD layout by adding files or music in order to burn a disc. The layout only referenced the file location and not the files themselves. It allowed for files to be saved for later use with references to files that will be included on the disc as well as other settings.
This format is a proprietary binary file, altered from earlier version CL2, CL3 and CL4 which are all Microsoft Compound File format, OLE2 container. The previous versions of this type of format have extensions CL2, CL3 and CL4. These earlier versions are seem to have very similar structure and cannot yet be distinguished in PRONOM. Please contact the PRONOM team in case you hold any more information regarding the earlier versions of this format.',NULL,NULL),
	 ('10d6db5a-148b-4042-87a5-466352ad0b50','2022-11-14 13:54:35.922517','2022-11-14 13:54:35.922517',NULL,'c63256aa-e55f-4e1c-81eb-c5142d486ca1','',NULL,NULL,NULL,1,false,true,false,'','The ezdraw file format is mainly associated with ''EazyDraw'' by Dekorra Optics LLC enterprise. EazyDraw is a vector based drawing application. It is used for desk top publishing (DTP) with Apple''s Macintosh OS X (Mac OS-X) operating system. The format is an XML Property List dictionary based format. There is also a binary version of this format.',NULL,NULL),
