	 ('2ed838b1-3598-4e14-b9ed-11ea1a16a34b','2022-11-14 13:54:49.114734','2022-11-14 13:54:49.114734',NULL,'44a8edf3-01d5-4823-8aca-dcb91616ae0a','',NULL,NULL,NULL,1,false,true,false,'0x00010000','The Embedded OpenType File Format (EOT) was developed by Microsoft to enable TrueType and OpenType fonts to be linked to web pages for download to render the web page with the font the author desired - https://www.w3.org/Submission/2008/SUBM-EOT-20080305/',NULL,NULL),
