	 ('dfd3c8d8-54ba-4545-af41-b259c37462c5','2022-11-14 13:54:52.879413','2022-11-14 13:54:52.879413',NULL,'4324abb5-d5e9-4f20-9a5f-304580c10795','',NULL,NULL,NULL,1,false,true,false,'1.2','Encapsulated Postscript (EPS) is a page description format, developed by Adobe Systems Incorporated. Version 1.2, the first version of the format, was developed in 1987. An EPS file comprises a header section followed by a PostScript document. An EPS can optionally include a preview raster image, in which case a binary header is prepended to the header.','1987-03-12 00:00:00',NULL),
	 ('10859bf5-049e-468f-8a18-14065f2e713d','2022-11-14 13:54:54.244745','2022-11-14 13:54:54.244745',NULL,'362c4431-fa65-4395-a2ba-9826ca83eabe','',NULL,NULL,NULL,1,false,true,false,'2.0','Encapsulated Postscript (EPS) is a page description format, developed by Adobe Systems Incorporated. Version 2.0, the second version of the format, was developed in 1989. An EPS file comprises a header section followed by a PostScript document. An EPS can optionally include a preview raster image, in which case a binary header is prepended to the header.','1989-01-16 00:00:00',NULL),
	 ('0057e5ab-357c-46e2-b931-050f50641f55','2022-11-14 13:54:55.389427','2022-11-14 13:54:55.389427',NULL,'f56b82fe-a787-4c17-8dc2-2c6c1fa0492a','',NULL,NULL,NULL,1,false,true,false,'3','Encapsulated Postscript (EPS) is a page description format, developed by Adobe Systems Incorporated. Version 3, the third version of the format, was developed in 1992, and subsequently revised in 1999 to include a number of extensions and features of the PostScript language not previously documented. An EPS file comprises a header section followed by a PostScript document. The header can refer to version 3.0 or version 3.1. An EPS can optionally include a preview raster image, in which case a binary header is prepended to the header.','1992-05-01 00:00:00',NULL),
	 ('9005c33a-8d1d-4f2a-9fa9-f7bdc2b5eb5d','2022-11-14 13:54:57.249199','2022-11-14 13:54:57.249199',NULL,'b193b420-6b24-4bb8-91dc-ce038d782ec9','',NULL,NULL,NULL,1,false,true,false,'','Expert Witness was the original name for EnCase, as such this format can be referred to as either Expert Witness Compression Format or Encase Image File Format.
The format is used to store media images for forensic purposes. They are a type of disk image containing the contents and structure of an entire data storage device, disk volume or even a computer''s physical memory. This format creates segments which have different file extensions, the first will have the extension ''.e01''. this increases first numerically upto ''.e99'' the next extension will be ''.eaa'' increasing to an estimated limit of ''.zzz''.',NULL,NULL),
	 ('70bdacab-dc6f-4652-8276-7f40d90974c5','2022-11-14 13:54:58.311627','2022-11-14 13:54:58.311627',NULL,'6ef2768a-dffb-49d7-8eb9-17c794cf685c','https://web.archive.org/web/20220501102310/https://en.wikipedia.org/wiki/EndNote

