http://fileformats.archiveteam.org/wiki/EndNote_Library',NULL,NULL,NULL,1,false,true,false,'20','EndNote Library file format is generated and used via EndNote reference management software application. A software intended for the management of bibliographies and references when producing academic text or reports. Endnote software was first launched in 1989 by Niles & Associates, then in 2000 was acquired by Institute for Scientific Informations Research Soft Division, and since 2016 owned by Clarivate. The EndNote Library file format stores the references and citations in so called ''libraries'' used with the software. Users of EndNote application can create their own EndNote Library files, as well as upload EndNote Library files onto their software. The latter versions of this format, starting from version 8, include .data folder to accompany the EndNote Library format. The .data folder is automatically created by EndNote, intended to store attachments. Following this update, the .data folder is recommended to be present in the EndNote Library file structure in order to use the EndNote Library format with the EndNote software. This entry describes compressed version 20 of the application, which is a ZIP compressed SQL Lite database type of format. In this later versions starting from version X, an ability to compress EndNote Library files using the EndNote application was added, in purpose to easily share EndNote library files with other EndNote users. Please see the full version history using the Web Archive Wikipedia entry link included in the Notes section.',NULL,NULL),
	 ('31f1e267-1e9a-4609-baad-5b47afa4f6c7','2022-11-14 13:55:18.337666','2022-11-14 13:55:18.337666',NULL,'a58dec17-710e-4b55-88ad-f72eaea4c146','',NULL,NULL,NULL,1,false,true,false,'','The ERDAS HFA format defines a heirachichal data structure used by many formats primarily associated with with the ERDAS Imagine software package for processing geospatial imagery. Other formats use this structure also, notably ArcGIS ''Reduced resolution datasets'' and their auxilliary files. It may be possible to distinguish between distinct subsets of HFA with further research. Please contact the PRONOM team if you can assist with this.',NULL,NULL),
