http://fileformats.archiveteam.org/wiki/EndNote_Library',NULL,NULL,NULL,1,false,true,false,'20','EndNote Library file format is generated and used via EndNote reference management software application. A software intended for the management of bibliographies and references when producing academic text or reports. Endnote software was first launched in 1989 by Niles & Associates, then in 2000 was acquired by Institute for Scientific Informations Research Soft Division, and since 2016 owned by Clarivate. The EndNote Library file format stores the references and citations in so called ''libraries'' used with the software. Users of EndNote application can create their own EndNote Library files, as well as upload EndNote Library files onto their software. The latter versions of this format, starting from version 8, include .data folder to accompany the EndNote Library format. The .data folder is automatically created by EndNote, intended to store attachments. Following this update, the .data folder is recommended to be present in the EndNote Library file structure in order to use the EndNote Library format with the EndNote software. This entry describes version 20 of the application, which was altered from previous ZIP container format to SQL Lite database type of format. In later versions starting from version X, an ability to compress EndNote Library files using the EndNote application was added, in purpose to easily share EndNote library files with other EndNote users. This types of formats are included in separate PRONOM entry. Please see the full version history using the Web Archive Wikipedia entry link included in the Notes section.',NULL,NULL),
	 ('730381a6-98fa-4c9a-a62c-1d947eaeedf6','2022-11-14 13:55:20.098424','2022-11-14 13:55:20.098424',NULL,'ece9de7e-80ed-4926-9fba-afdcfa6dd6a5','Specification:  https://web.archive.org/web/20110205035551/http://home.gdal.org/projects/imagine/ige_format.html',NULL,NULL,NULL,1,false,true,false,'','.ige files are generated by ERDAS Imagine software, when the RRD file exceeds 2GB (or now 4GB, as suggested by some sources) in size. For these larger projects, two extra files are generated: .img files, and these ige files, which stores the actual image data.',NULL,NULL),
