https://web.archive.org/web/19990125085618/http://www.envisionpublisher.com/',NULL,NULL,NULL,1,false,true,false,'','EVP files are document files created by using EnVision Publisher and start with the ASCII characters EnVision Publisher DTP document file.

EnVision Publisher was published by Software Vision in 1993, as a MS-DOS based (and later Windows 3.1) word processing program. At the time, it was an advanced desktop publishing program for Windows, with the ability to create publishing projects such as newsletters, flyers, brochures, business cards, and other printed material. The software''s selling point was its low cost and ease of use of some advanced featured compared to its competitiors at the time. This desktop publishing program features a graphical WYSIWYG (What You See Is What You Get) interface, horizontal and vertical toolbars and rulers, templates for fliers and newsletters, 4 fonts, spell checker, style sheets, line, graphic, fill options, kerning, line justification, text rotation and color, cut, copy, paste, PCX and text import, zoom, page insert, clear, and delete, on-line help, and more.',NULL,NULL),
