	 ('dfd84420-34e8-4e74-8092-45ff5ceea5e1','2022-11-14 13:55:16.556657','2022-11-14 13:55:16.556657',NULL,'90a7329f-357e-4567-8b2c-b7a71870207d','',NULL,NULL,NULL,1,false,true,false,'','This format is the RAW image format used in Epsom cameras. RAW format images contain all the data that is taken directly from the camera''s image sensor before the software in the camera applies things like white balance, sharpening etc. Storing photographs in a camera''s RAW format allows you to alter those settings after the photograph has been taken.',NULL,NULL),
