	 ('a934081c-5a8e-4f45-9ea5-dca80c99b1e5','2022-11-14 13:55:21.125904','2022-11-14 13:55:21.125904',NULL,'629e6a4c-6ed2-49c1-8c35-f0d647223377','',NULL,NULL,NULL,1,false,true,false,'','Files with the extension .err are often Error files used to assist with troubleshooting. They can be generated by a range of software and may not have a clear and consistent structure between different software applications. Please contact the PRONOM team if you have a specific type of .err file that can be identified accurately by signature.',NULL,NULL),
	 ('b6901d84-d774-4490-82e3-38f306a0706b','2022-11-14 13:55:21.90595','2022-11-14 13:55:21.90595',NULL,'9f551ca6-f2d4-4a94-b7f9-e0cb9373359e','',NULL,NULL,NULL,1,false,true,false,'','eRuby (Embedded Ruby) is a templating system that embeds Ruby into a text document. It is often used to embed Ruby code in an HTML document, similar to ASP, JSP and PHP.',NULL,NULL),
	 ('1043a659-07cf-488a-afec-55d2e89eb21a','2022-11-14 13:55:22.817605','2022-11-14 13:55:22.817605',NULL,'1237b5a3-8e7e-4406-98ec-6786b97047b1','',NULL,NULL,NULL,1,false,true,false,'','An Arc/Info binary grid is a proprietary raster GIS file format developed by ESRI. The grid defines geographic space as an array of equally sized square grid points arranged in rows and columns. Each grid point stores a numeric value that represents a geographic attribute such as elevation or surface slope. Each grid cell is referenced by its x,y coordinate.',NULL,NULL),
	 ('6875188f-7c47-4461-810b-03900cf1595e','2022-11-14 13:55:23.758544','2022-11-14 13:55:23.758544',NULL,'32397465-b72f-4327-8181-84416e5f18c3','',NULL,NULL,NULL,1,false,true,false,'','ESRI ArcInfo Export File Format (also known as ArcInfo Interchange File Format) is a vector file format which is produced by ESRI and pre-dates the shapefile. It is as an export file used to enable coverage, grid or TIN and an associated INFO table to be transferred between different machines, which are not connected by any type of file sharing network. A volume has the extension .E00 through .E99.
A non-authoritative version of the specification can be found at: http://avce00.maptools.org/docs/v7_e00_cover.html',NULL,NULL),
	 ('ac6e1c78-188f-49e7-a9c0-844cb48d7d14','2022-11-14 13:55:24.459578','2022-11-14 13:55:24.459578',NULL,'ccf09887-aad2-4d3c-ab47-e2be06e6a218','',NULL,NULL,NULL,1,false,true,false,'2.x','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select Add an Entry.',NULL,NULL),
	 ('03e23c8d-c15b-4f37-a56f-a0cc49ae934a','2022-11-14 13:55:25.093779','2022-11-14 13:55:25.093779',NULL,'2bae3c0f-bec5-43d2-85c7-bdd1266012e3','',NULL,NULL,NULL,1,false,true,false,'3.x','ArcView is Geographic Information System software produced by ESRI. There may be distinct formats produced by ArcView that share this format structure. Please contact the PRONOM team if you are able to assist with distinguishing between them.',NULL,NULL),
	 ('363ee68f-39cc-4820-9dbf-244e31bef5e5','2022-11-14 13:55:25.988832','2022-11-14 13:55:25.988832',NULL,'24bfc91c-4b2a-44ca-8f44-265274cb930f','',NULL,NULL,NULL,1,false,true,false,'','A shapefile stores none topological geometry and attribute information for the spatial features in a data set. The geometry for a feature is stored as a shape comprising a set of vector coordinates. Shapefiles can support point, line, and area features. Area features are represented as closed loop, double-digitized polygons. Attributes are held in a dBASE format file. An ESRI shapefile consists of a main file, an index file, and a dBASE table. The main file is a direct access, variable-record-length file in which each record describes a shape with a list of its vertices. In the index file, each record contains the offset of the corresponding main file record from the beginning of the main file. The dBASE table contains feature attributes with one record per feature. The one-to-one relationship between geometry and attributes is based on record number. Attribute records in the dBASE file must be in the same order as records in the main file.',NULL,NULL),
	 ('cf47d8a3-ff49-48b2-ac06-ce1c14dc04db','2022-11-14 13:55:26.976074','2022-11-14 13:55:26.976074',NULL,'6e40536c-7e71-4d36-a0ce-07db564d3614','',NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select Add an Entry.',NULL,NULL),
	 ('130ac726-68ae-4cbc-a7c8-5c865f2164a0','2022-11-14 13:55:27.726069','2022-11-14 13:55:27.726069',NULL,'2f8eb711-906d-41a1-bc88-96625fe1030d','https://www.esri.com/en-us/arcgis/products/arcgis-field-maps/overview',NULL,NULL,NULL,1,false,true,false,'','ArcExplorer is a viewer and organiser for maps, which enables the user to access information about an area including GIS (Geographic Information System) data. The .aep project file is used to save user projects, including custom maps, comments, sketches and other GIS data. ArcExplorer has been superseded by ArcGIS Explorer.',NULL,NULL),
	 ('caf2b276-075c-4e9d-a924-82780b03c2e9','2022-11-14 13:55:28.739025','2022-11-14 13:55:28.739025',NULL,'67edd9cf-49cd-42c5-ba20-41b2b1c513b9','https://docs.safe.com/fme/html/FME_Desktop_Documentation/FME_ReadersWriters/esrihdr/esrihdr.htm
https://webhelp.esri.com/arcgisdesktop/9.2/index.cfm?TopicName=BIL,_BIP,_and_BSQ_raster_files
https://resources.arcgis.com/en/help/',NULL,NULL,NULL,1,false,true,false,'','These are hdr files generated by ESRI ArcGIS software. They are associated with other ArcGIS formats, .BIL, .BIP and .BSQ. All of these formats are methods of organising mapping raster image data, and the .HDR file stores the attributes of the image, eg. column and line numbers, and byte order. Esri have produced several types of GIS software (for example ArcGIS Pro, ArcPad, ArcMap), and it is not clear which software or version these signatures apply to. If you have any information on ESRI hdr files, please get in touch.',NULL,NULL),
	 ('28116296-ab34-4f49-a738-44e6974ba6cc','2022-11-14 13:55:29.35341','2022-11-14 13:55:29.35341',NULL,'89c592c4-0b10-415e-ac94-2cf652e45cf1','',NULL,NULL,NULL,1,false,true,false,'','In the ArcGIS platform by ESRI ArcGlobe formats allow 3D visualization of GIS data based on a global view.',NULL,NULL),
	 ('6c3ae0fe-65c8-46a2-afed-512bb3bb25a6','2022-11-14 13:55:30.218926','2022-11-14 13:55:30.218926',NULL,'937c71c9-a9d3-4d61-9bec-927bf83de038','https://www.loc.gov/preservation/digital/formats/fdd/fdd000284.shtml',NULL,NULL,NULL,1,false,true,false,'','Files which form part of an ArcInfo Coverage, which is a data model whose purpose is to store georelational data such as spatial location and descriptive data. Each ArcInfo Coverage resides in an ArcInfo workspace, a directory which contains two or more folders. These packages are generated using ArcGIS software, produced by Esri (https://www.esri.com/en-us/arcgis/about-arcgis/overview.) Files with the .txt extension contain text strings describing a geographic feature, formatted in user defined tables.',NULL,NULL),
	 ('f4bf410a-6632-491d-9441-353000ff11f9','2022-11-14 13:55:31.5407','2022-11-14 13:55:31.5407',NULL,'f7d8d1db-9e4e-4072-891a-e4de20eaff57','https://www.loc.gov/preservation/digital/formats/fdd/fdd000284.shtml',NULL,NULL,NULL,1,false,true,false,'','Files which comprise part of an ArcInfo Coverage, which is a data model whose purpose is to store georelational data such as spatial location and descriptive data. Each ArcInfo Coverage resides in an ArcInfo workspace, a directory which contains two or more folders. These packages are generated using ArcGIS software, produced by Esri (https://www.esri.com/en-us/arcgis/about-arcgis/overview.) An ArcInfo coverage dataset typically has two types of .dat file: internal, which store the actual data table, and external, which contains a relative path to the data table. External .dat files follow a unique naming pattern: arcXXXX.dat, where XXXX is incrementally increasing number starting from 0000, e.g. arc0000.dat, arc0001.dat. The .dat files always come in pair with a NIT file and are both stored in an INFO directory at the root.',NULL,NULL),
	 ('e9bc9fd7-69b8-400c-9b6a-22b8320699ea','2022-11-14 13:55:32.148521','2022-11-14 13:55:32.148521',NULL,'5444a814-2f8b-4963-9de5-6edec2fd3e71','',NULL,NULL,NULL,1,false,true,false,'','Files which comprise part of an ArcInfo Coverage, which is a data model whose purpose is to store georelational data such as spatial location and descriptive data. Each ArcInfo Coverage resides in an ArcInfo workspace, a directory which contains two or more folders. These packages are generated using ArcGIS software, produced by Esri (https://www.esri.com/en-us/arcgis/about-arcgis/overview.) An ArcInfo coverage dataset typically has two types of .dat file: internal, which store the actual data table, and external, which contains a relative path to the data table. These external files, which have extension .dat, follow a unique naming pattern: arcXXXX.dat, where XXXX is incrementally increasing number starting from 0000, e.g. arc0000.dat, arc0001.dat. The .dat files always come in pair with a NIT file and are both stored in an INFO directory at the root. Internal .dat files usually contain the byte sequence BOF, 000000.',NULL,NULL),
	 ('bd9f16ff-3388-499d-aea8-8cb961bb1553','2022-11-14 13:55:33.6905','2022-11-14 13:55:33.6905',NULL,'b0fffe19-4259-4ed3-8129-5140fc97b020','http://avce00.maptools.org/docs/v7_bin_cover.html#ARC.DAT

http://webhelp.esri.com/arcgisdesktop/9.2/index.cfm?TopicName=How_coverages_are_stored

https://support.esri.com/en/technical-article/000008526

https://www.loc.gov/preservation/digital/formats/fdd/fdd000281.shtml',NULL,NULL,NULL,1,false,true,false,'','Files which comprise part of an ArcInfo Grid, a raster data model storing information in a matrix of cells, with values representing a coordinate, and sometimes linked to an attribute table. ArcInfo Grid models are generated using ArcGIS software, produced by Esri (https://www.esri.com/en-us/arcgis/about-arcgis/overview.) Nit files follow a consistent naming pattern: arcXXXX.nit, where XXXX is an incrementally increasing number starting from 0000, e.g, arc000.nit, arc0001.nit, arc0002.nit. Nit files are always stored in an /info/ directory at the root. They are associated with .dat and .adf files, and their function is to store file structure and field definition information of the grid.',NULL,NULL),
	 ('6472199a-e0e6-4266-9dab-19ee336b34b7','2022-11-14 13:55:34.256518','2022-11-14 13:55:34.256518',NULL,'c0203168-708b-4382-ad05-5e9c927a418c','',NULL,NULL,NULL,1,false,true,false,'','In the ArcGIS platform by ESRI, a map document is a file that contains one or more maps, the page layout, and the associated layers, tables, charts, and reports. Map document files have an .mxd extension. Template files have an .mxt extension and do not appear to be materially different from .mxd files. Please contact the PRONOM team if you are able to differentiate between docments and templates.',NULL,NULL),
	 ('bc55aedc-6a95-45c4-adc6-00c9ed179375','2022-11-14 13:55:35.016832','2022-11-14 13:55:35.016832',NULL,'6193b101-5168-49a6-a424-9f9847c46a63','',NULL,NULL,NULL,1,false,true,false,'','In the ArcGIS platform by ESRI ArcScene formats allow 3D visualization of GIS data. ArcScenedocuments can overlay multiple layers of data in a 3D environment.',NULL,NULL),
	 ('81bf65fc-5612-47cb-937d-1582c1667a09','2022-11-14 13:55:35.579881','2022-11-14 13:55:35.579881',NULL,'9fab8119-7af3-4b08-b7fa-69e424408a77','https://www.loc.gov/preservation/digital/formats/fdd/fdd000280.shtml
