http://desktop.arcgis.com/en/arcmap/10.3/tools/data-management-toolbox/add-attribute-index.htm',NULL,NULL,NULL,1,false,true,false,'','File generated by ESRI ArcGIS software. Found with ESRI Shapefile Header Index files, which have extension ain. Together they store the attribute index of the active fields in a table, or a themes attribute table.',NULL,NULL),
	 ('d4ac13ec-01b7-46f4-b8ac-3002512aa49e','2022-11-14 13:55:36.077256','2022-11-14 13:55:36.077256',NULL,'4e3c36ea-dee9-4d6a-a82c-d700bce4c60f','http://webhelp.esri.com/arcgisdesktop/9.3/index.cfm?TopicName=Shapefile_file_extensions
https://gisgeography.com/arcgis-shapefile-files-types-extensions/
https://www.esri.com/library/whitepapers/pdfs/shapefile.pdf',NULL,NULL,NULL,1,false,true,false,'','An ESRI Code Page file is an optional file that can be used to specify the code page for identifying the character set to be used, for example UTF-8. It is part of the ESRI shapefiles used in the ArcGIS software, which stores the geometric location and attribute information of geographic features. Shapefiles are a spatial data format that can work with and be edited in ArcGIS.',NULL,NULL),
	 ('ee884d31-8f48-432b-b43a-35b4458e2456','2022-11-14 13:55:36.560821','2022-11-14 13:55:36.560821',NULL,'ccd7d2ad-e10e-4387-ae93-f0d8d6665539','Note: http://desktop.arcgis.com/en/arcmap/10.3/manage-data/raster-and-images/bil-bip-and-bsq-raster-files.htm',NULL,NULL,NULL,1,false,true,false,'','Files generated by ESRI ArcGIS mapping software (https://www.esri.com/en-us/arcgis/about-arcgis/overview). The .clr colour file is an optional file, which sits alongside .bil, .bip and .bsq files, and describes the image colour map for colour images: if there is no clr file, the image displays are grayscale. The clr file records colours for pixel values in the image using the RGB colour model (i.e. it lists the amount of red, green and blue contained in that pixel.',NULL,NULL),
	 ('99b3ba87-59d4-481a-a0c0-a86548860d8a','2022-11-14 13:55:37.202394','2022-11-14 13:55:37.202394',NULL,'fd4fa9f9-b0e1-495c-8657-7c81f3dc1f82','',NULL,NULL,NULL,1,false,true,false,'','An ESRI file geodatabase is a collection of files in a folder on disk that can store, query, and manage both spatial and nonspatial data.The GeoDB is the primary data storage model for ArcGIS.',NULL,NULL),
