	 ('2b138200-35c9-4fa0-a21f-f770cef06132','2022-11-14 13:55:39.626408','2022-11-14 13:55:39.626408',NULL,'31e2ff8b-0df6-4ddb-a693-1576dcbf81e8','',NULL,NULL,NULL,1,false,true,false,'','The PMF file is a read-only map file created with ArcMap, an application included with ESRI Desktop GIS. It can be viewed with the ArcReader application. PMF files allow the protecting of data and confidentiality by enabling the creator to limit the data views, printing, zooming and other features of a map.',NULL,NULL),
