	 ('5b36d8ca-31a7-4cc8-a1b3-58544a888b50','2022-11-14 13:55:57.014622','2022-11-14 13:55:57.014622',NULL,'5a884a19-41c8-4123-a694-e2070b867466','https://docs.microsoft.com/en-us/windows/win32/fileio/exfat-specification',NULL,NULL,NULL,1,false,true,false,'','The Extensible File Allocation Table is a file system introduced by Microsoft in 2006, mainly for use in flash memory, such as USB flash drive and SD memory cards. It was a proprietary format until 2019, when Microsoft published its specification (https://docs.microsoft.com/en-us/windows/win32/fileio/exfat-specification). It may be possible and desirable to distinguish between different types of exFAT image. Please contact the PRONOM team if you can assist with this.',NULL,NULL),
