	 ('a458d892-c564-4a93-ac3c-1b5f2f72e114','2022-11-14 13:55:59.036543','2022-11-14 13:55:59.036543',NULL,'11cdaa9c-7730-4c95-8c8b-ecc61f73883f','',NULL,NULL,NULL,1,false,true,false,'1.0','The Extensible Hypertext Markup Language (XHTML) is a reformulation of the Hypertext Markup Language (HTML) as an application of the Extensible Markup Language (XML). This allows for the automated processing of XHTML documents using a standard XML parser. XHTML 1.0 represents the reformulation of HTML 4.01 in XML. The structure and grammar of an XHTML document is defined using a Document Type Definition (DTD). An XHTML document consists of nested elements, each of which may have attributes and content. It begins with an XHTML Document Type declaration, defining the XHTML version and Document Type Definition (DTD) to which it conforms. XHTML documents are typically encoded in UTF-8 or UTF-16.','2000-01-26 00:00:00',NULL),
	 ('42a205e9-5546-4bde-a713-0a2e83462f48','2022-11-14 13:55:59.675674','2022-11-14 13:55:59.675674',NULL,'c3c382a0-dbe1-435d-9cb3-cc3593890b1c','',NULL,NULL,NULL,1,false,true,false,'1.1','The Extensible Hypertext Markup Language (XHTML) is a reformulation of the Hypertext Markup Language (HTML) as an application of the Extensible Markup Language (XML). This allows for the automated processing of XHTML documents using a standard XML parser. XHTML 1.1 is now recommended by the W3C over HTML for the creation of web pages. The structure and grammar of an XHTML document is defined using a Document Type Definition (DTD). An XHTML document consists of nested elements, each of which may have attributes and content. It begins with an XHTML Document Type declaration, defining the XHTML version and Document Type Definition (DTD) to which it conforms. XHTML documents are typically encoded in UTF-8 or UTF-16.','2001-05-31 00:00:00',NULL),
	 ('97952bf6-459d-4ccf-ae05-a1dbd729f616','2022-11-14 13:56:00.540371','2022-11-14 13:56:00.540371',NULL,'5acedbca-94e1-4354-a1c8-ccd08775330e','',NULL,NULL,NULL,1,false,true,false,'1.0','The Extensible Markup Language (XML) is a general purpose markup language for creating other, special purpose, markup languages, and is a simplified subset of SGML. The structure and grammar of an XML document can be defined using a markup declaration, such as a Document Type Definition (DTD) or XML schema. A XML document consists of nested elements, each of which may have attributes and content. It typically begins with an XML declaration, defining the XML version and character set used. This may be followed by a Document Type declaration, containing or pointing to a markup declaration for the class of document. An XML document is said to be well-formed if it conforms to the XML specification; it is said to be valid if it additionally complies with a defined markup declaration. The formatting and transformation of XML documents can be controlled using the Extensible Stylesheet Language (XSL).','1998-01-01 00:00:00',NULL),
	 ('ee6e1bda-3307-4fdf-8582-89a9955a0ac6','2022-11-14 13:56:18.124689','2022-11-14 13:56:18.124689',NULL,'81b83c48-ab59-4d8e-8ee0-27ba479572d9','',NULL,NULL,NULL,1,false,true,false,'5-7','Final Draft is screenwriting software for writing and formatting screenplays. This entry concerns the native file format of versions 5 through 7.',NULL,NULL),
