	 ('cab42226-6b0c-4bba-9b3f-755a1cb4c041','2022-11-14 13:56:01.218688','2022-11-14 13:56:01.218688',NULL,'3fb59952-f8b1-4f01-b0a5-ad79879d4e77','https://web.archive.org/web/20220918202300/https://www.w3.org/TR/2006/REC-xml11-20060816/

https://www.loc.gov/preservation/digital/formats/fdd/fdd000264.shtml

https://web.archive.org/web/20210517154945/https://developer.apple.com/documentation/uniformtypeidentifiers/uttype/3551601-xml',NULL,NULL,NULL,1,false,true,false,'1.1','Extensible Markup Language (XML) version 1.1 was developed by World Wide Web Consortium (W3C) in 2004. It is a general purpose markup language for creating other special purpose markup languages, it derived from SGML (ISO 8879). XML 1.1 was designed to be used when features of XML 1.0 [fmt/101] do not permit certain functionalities. It is structured to use any version of Unicode, in basic terms, whereas XML 1.0 provided a rigid definition of names, wherein everything that was not permitted was forbidden, XML 1.1 names are designed so that everything that is not forbidden (for a specific reason) is permitted. It also adds checking of normalization, and follows the Unicode line ending rules more closely. Authors are encouraged to generate XML 1.0 documents if the added flexibility is not required. XML Parsers are expected to understand both XML 1.0 and XML 1.1. It typically begins with an XML declaration, defining the XML version and character set used. This may be followed by a Document Type declaration, containing or pointing to a markup declaration for the class of document. An XML document is said to be well-formed if it conforms to the XML specification; it is said to be valid if it additionally complies with a defined markup declaration. The formatting and transformation of XML documents can be controlled using the Extensible Stylesheet Language (XSL).','2004-02-04 00:00:00',NULL),
