	 ('0914b691-5816-4923-bf6c-1ccc35c7fe4a','2022-11-14 13:56:21.38184','2022-11-14 13:56:21.38184',NULL,'4c4dd603-ea36-471f-a9e0-44dd5ffa95b2','',NULL,NULL,NULL,1,false,true,false,'1.2.1','FLAC stands for Free Lossless Audio Codec, an audio format similar to MP3, but lossless, meaning that audio is compressed in FLAC without any loss in quality.
The basic structure of a FLAC stream is: The four byte string "fLaC"
The STREAMINFO metadata block
Zero or more other metadata blocks
One or more audio frames
 The first four bytes are to identify the FLAC stream. The metadata that follows contains all the information about the stream except for the audio data itself. After the metadata comes the encoded audio data.','2007-09-17 00:00:00',NULL),
