https://isac-net.org/page/Data-Standards

https://web.archive.org/web/20220128002659/https://en.wikipedia.org/wiki/Flow_Cytometry_Standard',NULL,NULL,NULL,1,false,true,false,'1.0-3.1','Flow Cytometry Standard (FCS) is a format originating from data file standard for reading and writing of data from flow cytometry experiments written by International Society for Advancement of Cytometry (ISAC). FCS format describes a file that is a combination of textual data followed by binary data. The first version of the format was adopted as FCS 1.0 in 1984, and then was modified in 1990 as FCS 2.0 and again in 1997 as FCS 3.0, with the latest version of the standard introduced in 2010 as version 3.1. Please see the links attached with this entry to find file specification.',NULL,NULL),
	 ('f121d0c1-5b9b-4005-9aed-c622d8d5a7b5','2022-11-14 13:56:28.741466','2022-11-14 13:56:28.741466',NULL,'12e3a5e3-60a3-400c-a9cb-7a5f59e54904','http://fileformats.archiveteam.org/wiki/FLR',NULL,NULL,NULL,1,false,true,false,'','FLR is a database file format produced by the Info File program by Softwood on the Amiga.',NULL,NULL),
	 ('487ab362-43fb-45f8-9c23-5464ea6d836c','2022-11-14 13:56:29.3295','2022-11-14 13:56:29.3295',NULL,'620300e4-f0af-4abd-942b-346c944e063f','',NULL,NULL,NULL,1,false,true,false,'','FO file is a XML data file containing an electronic form intended for usage in the 602XML applications. The form is a composure of the layout structure using XSL-FO, data instance and data model using generic XML elements defined in the 602XML framework. The whole electronic form structure is always embedded into a digital signature represented by XML elements of the XML Signature standard.',NULL,NULL),
