	 ('2022d5b4-961e-4bf6-adb8-8fdd6b2a401e','2022-11-14 13:56:32.674219','2022-11-14 13:56:32.674219',NULL,'e5368774-ef41-4b9f-85e7-e4e294e0f8b1','',NULL,NULL,NULL,1,false,true,false,'3','The Folio Shadow file is a feature of the Folio Views software application, allowing multiple uses to work on ''shadow'' copies of a master Folio Infobase. Users will see the content of the master Infobase, and their peronal annotated shadow content. Updates to the master content would be reflected in the shadow copy, but changes to the shadow file will not alter the master Infobase in any way.',NULL,NULL),
	 ('c738dd5b-fb41-440d-bfc8-053dc8c0a585','2022-11-14 13:56:42.914772','2022-11-14 13:56:42.914772',NULL,'6aab487e-4568-4ba2-98fc-fefe6b5718b0','',NULL,NULL,NULL,1,false,true,false,'','FLIF is a lossless image format, developed by Jon Sneyers. FLIF is based on MANIAC compression. MANIAC (Meta-Adaptive Near-zero Integer Arithmetic Coding) is a variant of CABAC (context-adaptive binary arithmetic coding), where the contexts are nodes of decision trees which are dynamically learned at encode time.',NULL,NULL),
