	 ('ac2d20d8-830a-4847-9120-32927331d140','2022-11-14 13:56:45.610158','2022-11-14 13:56:45.610158',NULL,'ce4d253e-14da-4e5b-ba45-333718cdcc14','',NULL,NULL,NULL,1,false,true,false,'','This format is the RAW image format used in FujiFilm cameras. RAW format images contain all the data that is taken directly from the camera''s image sensor before the software in the camera applies things like white balance, sharpening etc. Storing photographs in a camera''s RAW format allows you to alter those settings after the photograph has been taken.',NULL,NULL),
	 ('a42e8c85-2e28-4c3a-bba1-5af0f8ef8b74','2022-11-14 13:56:46.90352','2022-11-14 13:56:46.90352',NULL,'be6c353f-8aec-44b5-94f9-1fd4fbeb0d78','http://fileformats.archiveteam.org/wiki/Funpaint',NULL,NULL,NULL,1,false,true,false,'','Funpaint image file is a raster image format associated with the Funpaint / Funpaint II, an interlaced FLI graphics editor for the Commodore 64. The resolution of the images is 296x200 pixels.',NULL,NULL),
	 ('73b82ecf-9c51-42f2-8192-e1cfec7948a5','2022-11-14 13:56:48.301918','2022-11-14 13:56:48.301918',NULL,'f703f5f0-f6ba-4795-b002-167845900493','',NULL,NULL,NULL,1,false,true,false,'','G64 is a Commodore 64 emulation format. It is a raw group code recording (GCR) binary representation of a Commodore 1541 diskette.',NULL,NULL),
