https://www.teambomba.net/gfx9klib.html',NULL,NULL,NULL,1,false,true,false,'','G9B is a raster image graphics format associated with the GFX9000, a GFX9k library for MSX computers.',NULL,NULL),
	 ('88249e21-9c34-4e9b-b58b-6a9b612988ad','2022-11-14 13:56:50.083275','2022-11-14 13:56:50.083275',NULL,'a175e90b-dea0-4f2f-80f1-7cfde8710290','Specification: https://developer.garmin.com/fit/protocol/',NULL,NULL,NULL,1,false,true,false,'','A file format developed by Garmin, for the storing and sharing of data from sports and health devices. Data is collected during a sporting activity, stored on the Garmin device, and can then be uploaded to the Garmin Connect web service, and other web applications. The format ensures that any .fit compliant device can interpret data from another .fit compliant device.  The format allows users to track and compare data about their physical activities over time.',NULL,NULL),
	 ('d80e2dca-aff9-49e1-9f2b-c80c71894d88','2022-11-14 13:56:50.744336','2022-11-14 13:56:50.744336',NULL,'005d5eb1-cf3b-4cd1-91c8-5f90ca828ac2','',NULL,NULL,NULL,1,false,true,false,'','Gmn files are used within Garmin Forerunner watches, which track GPS and heart rate data when work by the user during exercise. Gmn files store data relating to the exercise session, which can include heart rate, altitude, timestamp and position (latitude and longitude).',NULL,NULL),
	 ('c449097d-b2cc-4148-a1cd-3581ca0f267b','2022-11-14 13:56:51.415605','2022-11-14 13:56:51.415605',NULL,'b3c05545-5279-4075-a12f-bfb56a71b6cd','',NULL,NULL,NULL,1,false,true,false,'3','DM3 is a file format produced by some Digital Micrography instruments created by Gatan. Please contact the PRONOM team if you are able to provide a more detailed description.',NULL,NULL),
