	 ('db2c15a2-b90a-4e54-981f-54e86c328dd9','2022-11-14 13:56:52.657203','2022-11-14 13:56:52.657203',NULL,'39f4abdb-f007-49aa-aaae-684905f9dc4c','http://fileformats.archiveteam.org/wiki/GEM_Raster

https://www.wikidata.org/wiki/Q28206162

https://www.seasip.info/Gem/ff_img.html

