	 ('b429ea19-109f-4b42-b1ce-4db581b9de85','2022-11-14 13:56:54.811584','2022-11-14 13:56:54.811584',NULL,'dc0e634f-8517-4c79-8505-137bdf23f0c0','Specification: https://www.ncbi.nlm.nih.gov/genbank/samplerecord/',NULL,NULL,NULL,1,false,true,false,'','The GenBank format was developed by the U.S. National Center for Biotechnology Information (NCBI). The format is a standardised way of recording DNA and protein sequencing information accompanied with other data, such as Journal references, keywords, definitions and other information, so that it can be easily read by humans and machines. The NCBI Genbank database https://www.ncbi.nlm.nih.gov/genbank/ is a repository of publicly available DNA sequences in the Genbank format, and takes in submissions of Genbank files from all over the world.',NULL,NULL),
