	 ('7beb8f15-5b7c-4b32-b9c3-b9232cc8b4d6','2022-11-14 13:57:02.1101','2022-11-14 13:57:02.1101',NULL,'5a57eed7-4999-4875-98a4-854901c8846b','',NULL,NULL,NULL,1,false,true,false,'','GeoJSON is an open standard format designed for representing geographical features, and is based on the JSON format. It is described within IETF RFC7946: https://tools.ietf.org/html/rfc7946. The format cannot currently be identified by a PRONOM signature.',NULL,NULL),
