	 ('8935aca7-db67-49ff-8295-2441b904740a','2022-11-14 13:57:03.881843','2022-11-14 13:57:03.881843',NULL,'1a4d9364-b674-4acd-8c93-52aa1d59fa47','',NULL,NULL,NULL,1,false,true,false,'','XCF is the native image format of the GNU Image Manipulation Program. XCF stands for eXperimental Computing Facility which is the undergraduate computing-interest organization at University of California, Berkeley, whom originally developed the format.',NULL,NULL),
	 ('38c1a43c-b45f-4f85-b50e-38f522b68924','2022-11-14 13:57:04.393478','2022-11-14 13:57:04.393478',NULL,'5143c650-0064-41cc-a08f-0a5c638d4d6c','Full specification of the format can be found at https://github.com/KhronosGroup/glTF/blob/master/specification/2.0/README.md#glb-file-format-specification',NULL,NULL,NULL,1,false,true,false,'','glTF (GL Transmission Format) is a royalty-free specification for the efficient transmission and loading of 3D scenes and models by applications. It is an API-neutral runtime asset delivery format. glTF bridges the gap between 3D content creation tools and modern 3D applications by providing an extensible, interoperable format for the transmission and loading of 3D content. Binary glTF is a container format in which an entire glTF asset (JSON asset description, binary geometry, key frames, skins and images) can be stored in a single binary blob.
A glTF Overview can be found at https://www.khronos.org/gltf .',NULL,NULL),
	 ('29860e07-fbcd-42a8-ba42-ac31d7e4cc8e','2022-11-14 13:57:05.422621','2022-11-14 13:57:05.422621',NULL,'ce7ffe40-41ac-4f8d-a8d1-e586c97ec8b7','',NULL,NULL,NULL,1,false,true,false,'1.0','glTF (GL Transmission Format) is a royalty-free specification for the transmission and loading of 3D scenes and models by applications. It is an API-neutral runtime asset delivery format. glTF bridges the gap between 3D content creation tools and modern 3D applications by providing an extensible, interoperable format for the transmission and loading of 3D content.
The gltf contains a JSON format that must contain a top-level "asset" property. The "asset" property must contain a "version" property with a value equal to "1.0".
Full specification of the format can be found at https://github.com/KhronosGroup/glTF/blob/master/specification/1.0/README.md
A glTF Overview can be found at https://www.khronos.org/gltf',NULL,NULL),
