	 ('95c25a37-7fbe-40e3-a89d-a8e4efb663d9','2022-11-14 13:57:11.927137','2022-11-14 13:57:11.927137',NULL,'678c7a72-bd58-44a8-9fb2-33c14f288406','',NULL,NULL,NULL,1,false,true,false,'','Image thumbnail files created by default within Graphic Workshop whenever a graphic file is written or updated. Can contain image, keywords and/or comment information. THN files are read by Graphic Workshop when it wants to display thumbnail images. The files themselves do not store graphics in any conventional sense.',NULL,NULL),
	 ('e9232f07-d931-4a18-a732-0889d09d74c0','2022-11-14 13:57:12.531972','2022-11-14 13:57:12.531972',NULL,'1d9cac83-20a3-4feb-8003-3ee69fe2d853','',NULL,NULL,NULL,1,false,true,false,'87a','The Graphics Interchange Format (GIF) is a raster image format developed by Compuserve, primarily for use on the internet. A GIF file begins with a Header section and a Logical Screen Descriptor section. This is followed by one or more Image sections, and the file is terminated by a Trailer. GIF supports bit depths between 1 and 8 bits (i.e. up to 256 colours) and supports features such as interlacing and transparency. Images are always stored using lossless LZW compression.','1987-06-15 00:00:00',NULL),
	 ('62b158a4-de17-41a7-bc0a-346a4a9fb1b9','2022-11-14 13:57:13.163237','2022-11-14 13:57:13.163237',NULL,'62fed243-a200-49a6-ad8b-069d36adbfad','',NULL,NULL,NULL,1,false,true,false,'89a','The Graphics Interchange Format (GIF) is a raster image format developed by Compuserve, primarily for use on the internet. A GIF file begins with a Header section and a Logical Screen Descriptor section. This is followed by one or more Image sections, and the file is terminated by a Trailer. GIF supports bit depths between 1 and 8 bits (i.e. up to 256 colours) and supports features such as interlacing and transparency. Images are always stored using lossless LZW compression. GIF 89a introduced a number of new features, including a series of optional Control Extensions, which can be used to control the rendering of images within a file.','1990-07-31 00:00:00',NULL),
