	 ('39850119-e4f2-4ce6-a273-11f59c7cbbf6','2022-11-14 13:57:41.705519','2022-11-14 13:57:41.705519',NULL,'c2c69e18-397a-4472-8dcd-3cc005f81543','',NULL,NULL,NULL,1,false,true,false,'','Hierarchical File System (HFS) is a file system developed by Apple primarily for Mac OS. Within HFS a storage volume is divided into logical blocks of 512 bytes. The Hierarchical File System groups these logical blocks into allocation blocks, which can contain one or more logical blocks, depending on the total size of the volume.',NULL,NULL),
	 ('e62b3699-97b3-407c-a0ee-d301a35f8864','2022-11-14 13:57:42.370083','2022-11-14 13:57:42.370083',NULL,'495357c7-3eb2-4ff5-8959-368070024a8c','http://fileformats.archiveteam.org/wiki/HFS%2B

https://www.ntfs.com/hfs.htm

https://syntheway.com/Apple_HFS_Hierarchical_File_System_HFS_Plus_Mac_OS_X.htm',NULL,NULL,NULL,1,false,true,false,'','Hierarchical File System Plus (also known as HFS+, Mac OS Extended or HFS Extended) is a file system developed by Apple Inc. as a successor to the Hierarchical File System (HFS) [fmt/1105]. The system was introduced in January 1998 with the release of Mac OS 8.1 and continued to be the primary file system on Apple operating systems starting with Mac OS X, as well as one of the primary file systems used by the iPod portable media player. It features improvements to HFS, such as a 32-bit file length field rather than 16-bit to allow for much longer files names and adds support for Unicode characters in file names up to 255 characters long, containing any characters in the Unicode repertoire (though there may be OS or API-specific restrictions on permittable characters). Journaling was added in 2003 and case-sensitive file names were introduced under the HFSX option. It was replaced with the Apple File System (APFS) released with macOS High Sierra in 2017.',NULL,NULL),
	 ('a4fb7bb4-7842-4faf-b7f3-52b443861175','2022-11-14 13:57:43.054053','2022-11-14 13:57:43.054053',NULL,'ba8fb2b4-63f1-4aca-9a0a-80d2a4f38846','',NULL,NULL,NULL,1,false,true,false,'','The High Efficiency Image File Format (HEIF) is an image format standard defined in ISO/IEC 23008-12 - MPEG-H Part 12. HEIF can store images, image properties, thumbnails and other derivatives, plus image metadata. It can support individual images and image sequences At this time the PRONOM identification signature does not distinguish between individual images and image sequences although this may be desirable.',NULL,NULL),
