	 ('6d3501fe-5e84-4995-9e1e-64d0282c1b0e','2022-11-14 13:57:46.772666','2022-11-14 13:57:46.772666',NULL,'1afd6672-d0ca-40c6-9687-908f317df31c','',NULL,NULL,NULL,1,false,true,false,'','HyperCard Stack is a legacy file format used with the HyperCard application software. HyperCard was developed by Bill Atkinson for use on Apple Macintosh and Apple IIGS computers and was first released by Apple in 1987. Atkinson created HyperCard as a tool that non-programmers could use to write their own computer applications. The HyperCard program stored information in documents referred to as stacks. Each HyperCard stack consisted of related cards, which could contain text, images, interactive elements, and sound. individual cards within the stack to each other and that played various sounds as the user clicked them. The structure of HyperCard was based conceptually on physical card-filing systems, like Rolodex, or a flat-file database that used hyperlinks as navigation. HyperCard Stacks typically lack a format extension.',NULL,NULL),
	 ('e4f944e9-0200-4837-b06f-656018cffe83','2022-11-14 13:57:47.469462','2022-11-14 13:57:47.469462',NULL,'33129527-aba8-44c6-b025-f2d2d92e15a8','',NULL,NULL,NULL,1,false,true,false,'','The HyperText Markup Language (HTML) is a markup language designed for the rendering of information via a web browser. It was originally defined as a highly simplified subset of SGML, but is now an international standard, and is maintained by the World Wide Web Consortium (W3C). A HTML document consists of nested elements, each of which may have attributes and content. The notion of a generic HTML format is used here to define HTML documents which pre-date the first formal specification (HTML 2.0), or which otherwise to do not fully conform to any formal specifications.',NULL,NULL),
	 ('dc28e5a2-bc91-478e-9c4b-78fff8fd71aa','2022-11-14 13:57:48.117294','2022-11-14 13:57:48.117294',NULL,'9ec28620-5cb6-4a6b-a16d-b04e7951ec34','',NULL,NULL,NULL,1,false,true,false,'2.0','The HyperText Markup Language (HTML) is a markup language designed for the rendering of information via a web browser. It was originally defined as a highly simplified subset of SGML, but is now an international standard, and is maintained by the World Wide Web Consortium (W3C). A HTML document consists of nested elements, each of which may have attributes and content. It begins with an HTML Document Type declaration, defining the HTML version and Document Type Definition (DTD) to which it conforms. HTML 2.0 represents the first formal specification of the language.','1995-11-01 00:00:00',NULL),
