	 ('2e2e7c58-8ae2-4d67-ae10-c07f23cf7d67','2022-11-14 13:58:08.832091','2022-11-14 13:58:08.832091',NULL,'c2525496-f276-4e81-add0-f1106a4dbe1e','http://fileformats.archiveteam.org/wiki/IDML',NULL,NULL,NULL,1,false,true,false,'','IDML is an XML representation of an Adobe InDesign Document. The package format is conformant with the Universal Container Format and identification is based on the contents of the mimetype file with the zip container.',NULL,NULL),
	 ('3db02f92-b96f-484c-a629-aa70949f7830','2022-11-14 13:58:09.518457','2022-11-14 13:58:09.518457',NULL,'9c025ca2-f6ce-4c5f-bb9d-d8537679c169','',NULL,NULL,NULL,1,false,true,false,'2x2','The Industry Foundation Classes (IFC) data model is intended to describe building and construction industry data.
 It is a platform neutral, open file format specification that is not controlled by a single vendor or group of vendors. It is an object-based file format with a data model developed by buildingSMART (formerly the International Alliance for Interoperability, IAI) to facilitate interoperability in the architecture, engineering and construction (AEC) industry, and is a commonly used collaboration format in Building information modeling (BIM) based projects.',NULL,NULL),
