	 ('68ae9954-b6e6-4c99-a2b4-da71aaff137a','2022-11-14 13:58:13.113598','2022-11-14 13:58:13.113598',NULL,'78975e09-0c56-42e4-a75f-5fa9cf696540','',NULL,NULL,NULL,1,false,true,false,'5.x','Initial Graphics Exchange Specification, or IGES, establishes information structures for the digital representation and exchange of product definition data. It supports exchanging this data among Computer-Aided Design and Computer-Aided Manufacturing (CAD and CAM, respectively) systems.  IGES defines file structure and language formats to represent geometric, topographical, and non-geometric product definition data.  These formats are independent of the modeling method used, and they support data exchange using physical media or electronic communication protocols.','1999-12-01 00:00:00',NULL),
