	 ('83011ce4-6a17-428b-9247-148511d48f1d','2022-11-14 13:58:38.351068','2022-11-14 13:58:38.351068',NULL,'ebdc1df1-cd58-4761-972a-248ae372e81a','',NULL,NULL,NULL,1,false,true,false,'','Defined in RFC5322 the Internet Message Format provides a syntax for text messages that  are sent  among computer  users, within the framework of "electronic mail". Consisting of header fields and an optional body, encoded using ASCII characters. The Internet Message Format (*.eml) is a format used by numerous email systems. The format does not prevent the use of alternative formats for storage of electronic mail on those systems.',NULL,NULL),
	 ('79ac2354-b16e-4aee-a43d-a8bcf709770d','2022-11-14 13:58:39.006835','2022-11-14 13:58:39.006835',NULL,'a719030a-879c-4735-90ff-c5b42bbfc09e','Specification: https://docs.intrepid-geophysics.com/intrepid/topics/databases-files-and-data-structures.html#5_5_INTREPID',NULL,NULL,NULL,1,false,true,false,'3.7 onwards','INTREPID Standard Information Files are a format developed by Australian company Intrepid Geophysics, used by their INTREPID software for processing and visualising geophysical data. isi files are vector files which can capture a variety of data. Every INTREPID dataset has an isi file which contains, amongst other information, the parameter values for the dataset.',NULL,NULL),
