http://www.isdoc.cz/fileadmin/isdoc/6.0/readme-en.html',NULL,NULL,NULL,1,false,true,false,'5.x','ISDOC is a type of Extensible Markup Language (XML) file format specific for transfer of financial documents. It allows paperless exchanging of invoices and other documents, processing and portability among companies, public administration authorities and individuals. It was defined by A Working group for Electronic Standards of data exchanging in ICT Union (formerly SPIS). The Declaration on common approach in the area of electronic invoicing in the Czech Republic was signed on 16th October 2008. It represents a Czech customization of UBL standard https://www.iso.org/standard/66370.html. ISDOC file enables enveloped signatures including advanced IETF/W3C XML digital signatures conforming to the ETSI XAdES specification. This signiture records a general ISDOC file format, however there are several versions of this format which can be found here: http://www.isdoc.cz/index.php?id=1316.',NULL,NULL),
	 ('645e12a9-c541-4cfd-a89f-47896c027809','2022-11-14 13:58:44.9277','2022-11-14 13:58:44.9277',NULL,'b675def6-c0a3-4970-b84b-9247f7c89030','',NULL,NULL,NULL,1,false,true,false,'6.0.1','ISDOCX is a type of ZIP container file for transferring ISDOC documents and other material. Then content of this file format varies, but it should always contain ISDOC file format, and usually does contain a Portable Document Format (PDF). This signiture records a general ISDOCX file format as an extension only, however there are several versions of this format which can be found here: http://www.isdoc.cz/index.php?id=1316. Versions 6.0.1 must also contain ''manifest.xml'' namespace file, this signiture records  6.0.1 with a ''manifest.xml'' namespace file.


