	 ('979bccea-36a5-404a-b332-0cb4264fb756','2022-11-14 13:58:54.047689','2022-11-14 13:58:54.047689',NULL,'3c1447c1-f7f5-401e-bfbc-a45306a5fcc9','Description provided by Stadtarchiv Hof (Municipal Archives of Hof, Free State of Bavaria, Germany)',NULL,NULL,NULL,1,false,true,false,'','A source code file written in Java from which a Java class file can be generated by a compiler. Java is a high-level, class-based, object-oriented general-purpose programming language designed to have as few implementation dependencies as possible. As a human-readable plain text file, it can be opened and viewed in any text editor.',NULL,NULL),
	 ('c4bfeeaf-6d5a-4abd-9116-71871a622792','2022-11-14 13:58:54.694172','2022-11-14 13:58:54.694172',NULL,'03bf36ec-b5d7-4d8d-b42c-904ccc92fd95','',NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select Add an Entry.',NULL,NULL),
	 ('ab76c186-d51d-4460-9326-e87cb90e907b','2022-11-14 13:58:56.725','2022-11-14 13:58:56.725',NULL,'3c7dfe2e-b913-42aa-82e0-c0ae24b33ed4','',NULL,NULL,NULL,1,false,true,false,'','Nuclear magnetic resonance spectroscopy (NMR spectroscopy) data files produced by with JEOL''s NMR Spectrometers.',NULL,NULL),
	 ('762ab8b4-78c5-4130-ab78-25c2745003e0','2022-11-14 13:58:57.40152','2022-11-14 13:58:57.40152',NULL,'340a6fb3-6af0-470e-8d7f-b7658ce142c5','',NULL,NULL,NULL,1,false,true,false,'','The JPEG 2000 file format (JP2 file format) provides a foundation for storing application specific data (metadata) in association with a JPEG 2000 codestream, such as information which is required to display the image.  The JP2 file format encapsulates the JPEG 2000 codestream along with other core pieces of information about that codestream.  The building-block of the JP2 file format is called a box; all information contained within the format is contained in boxes.  There are several different box types; some boxes contain other boxes.  The binary structure of a file is a contiguous sequence of boxes.  The start of the first box is the first byte of the file, and the last byte of the last box is the last byte of the file.','2004-09-15 00:00:00',NULL),
	 ('e1e3c2f8-d079-45da-8513-53a664955154','2022-11-14 13:58:58.087534','2022-11-14 13:58:58.087534',NULL,'55b6a8ef-1a3f-4c3d-8bd4-0fef3b314312','',NULL,NULL,NULL,1,false,true,false,'','JPEG XR (abbr. For JPEG extended range) is a still-image compression standard and file format for continuous tone photographic images, based on technology originally developed and patented by Microsoft under the name HD Photo (formerly Windows Media Photo). It supports both lossy and lossless compression.',NULL,NULL),
	 ('d77e01b4-fbfd-44ac-a56a-4c99086796c6','2022-11-14 13:58:58.788109','2022-11-14 13:58:58.788109',NULL,'f5c48a10-ba50-43fd-9f1c-f0b6472145f0','https://en.wikipedia.org/wiki/JPEG_File_Interchange_Format

https://web.archive.org/web/20220624201809/https://www.adobe.com/creativecloud/file-types/image/raster/jpeg-file.html

https://web.archive.org/web/20221015163305/https://en.wikipedia.org/wiki/JPEG',NULL,NULL,NULL,1,false,true,false,'1.00','The JPEG File Interchange Format (JFIF) is a file format for storing JPEG-compressed raster images. It was developed by the Independent JPEG Group and C-Cube Microsystems, in the absence of any such format being defined in the JPEG standard, and rapidly became a de facto standard; this is what is commonly referred to as the JPEG file format. A JFIF file comprises a JPEG data stream together with a JFIF marker. It begins with a Stofof Image (SOI) marker, immediately followed by a JFIF Application (APP0). This is followed by the JPEG image data, which is terminated by an End of Image (EOI) marker. JFIF supports up to 24-bit colour and uses lossy compression (based on the Discrete Cosine Transform algorithm). Other types of compression are available through JPEG extensions, including progressive image buildup, arithmetic encoding, variable quantization, selective refinement, image tiling, and lossless compression, but these may not be supported by all JFIF readers and writers.',NULL,NULL),
