https://web.archive.org/web/20221015163305/https://en.wikipedia.org/wiki/JPEG',NULL,NULL,NULL,1,false,true,false,'1.02','The JPEG File Interchange Format (JFIF) is a file format for storing JPEG-compressed raster images. It was developed by the Independent JPEG Group and C-Cube Microsystems, in the absence of any such format being defined in the JPEG standard, and rapidly became a de facto standard. A JFIF file comprises a JPEG data stream together with a JFIF marker. It begins with a Start of Image (SOI) marker, immediately followed by a JFIF Application (APP0) marker and one or more optional application extension markers. This is followed by the JPEG image data, which is terminated by an End of Image (EOI) marker. JFIF supports up to 24-bit colour and uses lossy compression (based on the Discrete Cosine Transform algorithm). Other types of compression are available through JPEG extensions, including progressive image buildup, arithmetic encoding, variable quantization, selective refinement, image tiling, and lossless compression, but these may not be supported by all JFIF readers and writers.','1992-09-01 00:00:00',NULL),
	 ('f5e89179-0e7f-4905-a9dd-cf2af346abaa','2022-11-14 13:59:00.844856','2022-11-14 13:59:00.844856',NULL,'ac124c3c-a61c-41e0-b736-2f1f6a03311d','',NULL,NULL,NULL,1,false,true,false,'','JPEG Network Graphics (JNG) is a JPEG-based graphics file format which is closely related to PNG: it uses the PNG file structure (with a different signature) as a container format to wrap JPEG encoded image data. JNG was created as an adjunct to the MNG animation format, but may be used as a stand-alone format. JNG files embed an 8-bit or 12-bit JPEG datastream in order to store color data, and may embed another datastream (1, 2, 4, 8, 16 bit PNG, or 8 bit JPEG grayscale image) for transparency information. However, a JNG may contain two separate JPEG datastreams for color information (one eight-bit and one twelve-bit) to permit decoders that are unable to (or do not wish to) handle twelve-bit datastreams to display the eight-bit datastream instead, if one is present.',NULL,NULL),
	 ('c694d01a-80b7-431c-ad19-f49e3b166604','2022-11-14 13:59:01.412035','2022-11-14 13:59:01.412035',NULL,'d9a575c3-9445-4808-b941-82ce5e0b12f1','',NULL,NULL,NULL,1,false,true,false,'','JPEG XL is a raster image format standardised by ISO/IEC FDIS 18181-1, that supports lossy and lossless compression. This PUID is for the JPEG XL file format.',NULL,NULL),
	 ('0d7a3281-dfaf-44bb-a565-123d0d7e6f4c','2022-11-14 13:59:02.042282','2022-11-14 13:59:02.042282',NULL,'cc40d939-fa12-4b60-a36a-47662acd5103','',NULL,NULL,NULL,1,false,true,false,'','JPEG XL is a raster image format standardised by ISO/IEC FDIS 18181-1, that supports lossy and lossless compression. This PUID is for a raw JPEG XL codestream',NULL,NULL),
	 ('a96e0018-0483-494c-83fd-fa6407d5e40f','2022-11-14 13:59:02.695221','2022-11-14 13:59:02.695221',NULL,'e3e0c29b-c305-4d11-a556-67e8cc6e6c02','',NULL,NULL,NULL,1,false,true,false,'','A standard for lossless or near-lossless compression of images, also known as ISO/IEC 14495-1 and ITU Recommendation T.87, created by the Joint Photographics Experts Group (JPEG). It was developed as a low complexity lossless image compression standard in 1999, and was based on LOCO-I algorithm. JPEG-LS also provides a lossy mode. It has faster compression than JPEG 2000 and is considered better than the original lossless JPEG standard.',NULL,NULL),
	 ('1642ca05-fd75-4e64-9410-57b29d5922dd','2022-11-14 14:04:56.325932','2022-11-14 14:04:56.325932',NULL,'eeb69cd8-f110-49ac-8f77-354c8a8f68e9','',NULL,NULL,NULL,1,false,true,false,'2.0','PUID deprecated. Please see fmt/166: Microsoft Works Spreadsheet 1-5',NULL,NULL),
	 ('058130fc-e156-429b-a67f-27b3aa9fd089','2022-11-14 13:59:03.29849','2022-11-14 13:59:03.29849',NULL,'f1857afa-b068-4865-8b71-ac7b9279207b','',NULL,NULL,NULL,1,false,true,false,'','The JPEG 2000 Compound Image File Format is an optional file format for storing compound images using the JPEG 2000 file format family architecture. A compound image is an image that may contain scanned images, synthetic images or both, and that preferably requires a mix of continuous tone and bi-level compression methods.',NULL,NULL),
	 ('d7a52237-013b-4175-9fe6-b020c93808e0','2022-11-14 13:59:03.9286','2022-11-14 13:59:03.9286',NULL,'9f94c71e-afe7-4488-870a-9b0ce1dca982','',NULL,NULL,NULL,1,false,true,false,'','JPX is an image file format extended from JP2, providing the potential for extended colour space support, alternative compression methods, and other features. JPX may be used in applications that require additional functionality or data structures beyond those defined in the JP2 file format.',NULL,NULL),
	 ('f151598d-6814-4b8b-8d9c-08f0b0f4c3d2','2022-11-14 13:59:04.59454','2022-11-14 13:59:04.59454',NULL,'5a8a76e9-cc99-4c63-b27f-de820cc10c8d','',NULL,NULL,NULL,1,false,true,false,'','JavaScript Object Notation (JSON) is an open standard format that uses human-readable text to transmit data objects consisting of attributevalue pairs. It is used for asynchronous browser/server communication (AJAJ). While it is originally derived from JavaScript scripting language, JSON is language independent while using conventions that match with the C-family of languages, including C, C++, C#, Java, JavaScript, Perl, Python, and others.',NULL,NULL),
	 ('d383dd07-80eb-4d24-9a3c-7f8f769cb003','2022-11-14 13:59:05.303166','2022-11-14 13:59:05.303166',NULL,'c4250f1e-4384-4652-b811-8ce8ba62f20a','',NULL,NULL,NULL,1,false,true,false,'','JSON-LD is a JSON-based format to serialize Linked Data. It is designed to be easy to convert an existing JSON file to JSON-LD. It''s main objective is to be a way to use Linked Data in Web-based programming environments, to build interoperable Web services, and to store Linked Data in JSON-based storage engines.',NULL,NULL),
	 ('fe3194d7-1d99-4241-9cc6-c34ad43127ed','2022-11-14 13:59:07.363824','2022-11-14 13:59:07.363824',NULL,'9c5acd51-47ce-4ce8-942f-121dd02924f8','',NULL,NULL,NULL,1,false,true,false,'','JTIP is a multi-resolution format, created for image presentation with easy transfer and handling, based on SPIFF. It allows presentation of images in various sizes and resolutions from vignette (1/16 screen size, used for browsing) through imagette (1/4 screen, for image comparison), to full screen and higher resolution images. Each layer is divided into tiles so the user can zoom or pan easily. A file contains an internal ID for tiles, with each tile associated with a single file header and separated by markers. Under header there can be and optional table noting the tile offsets, or an external ID for separate files. JTIP is not widely used and is no longer supported.',NULL,NULL),
	 ('a4855a5f-8ed3-4557-b327-4c0b249d1f47','2022-11-14 13:59:08.977039','2022-11-14 13:59:08.977039',NULL,'aed966f3-ae90-4bff-8701-612f9d85a4fc','',NULL,NULL,NULL,1,false,true,false,'','Notebook documents are files which are produced by the Jupyter Notebook application, they consist of Python computer code as well as rich text elements. They are both human readable documents as well as executable.',NULL,NULL),
	 ('17d25e87-f9b8-44d2-aac4-35b85cde68cf','2022-11-14 13:59:09.829742','2022-11-14 13:59:09.829742',NULL,'5d5c3445-0347-4a7b-a90f-cc993445f7c0','',NULL,NULL,NULL,1,false,true,false,'','JustWrite is a word processer which was developed by the Symantec Corporation in the 1990''s.',NULL,NULL),
	 ('3866dd41-d138-4494-bb3b-a13346160c19','2022-11-14 13:59:10.432555','2022-11-14 13:59:10.432555',NULL,'a5db9d54-ce47-40a8-9f3d-b1abe2c25580','',NULL,NULL,NULL,1,false,true,false,'','KML is an Open Geospatial Consortium (OGC) sponsored xml schema file format used to display geographic data in an earth browser, such as Google Earth, Google Maps, and Google Maps for mobile. A KML file is processed in much the same way that HTML (and XML) files are processed by web browsers. Like HTML, KML has a tag-based structure with names and attributes used for specific display purposes. Thus, Google Earth and Maps act as browsers for KML files.
Full specifications available at: http://www.opengeospatial.org/standards/kml',NULL,NULL),
