	 ('71710433-41f0-4627-914b-73e1c68e75f4','2022-11-14 13:59:15.568146','2022-11-14 13:59:15.568146',NULL,'8aa62dab-1560-4521-9a0d-c95d3b47e42d','http://fileformats.archiveteam.org/wiki/Koala_MicroIllustrator',NULL,NULL,NULL,1,false,true,false,'','Koala MicroIllustrator is a graphics program for the Atari line of computers. Koala MicroIllustrator Graphics files are raster image files associated with this software.',NULL,NULL),
