	 ('ac779de8-3b6b-412a-9724-e6e1c831d740','2022-11-14 13:59:18.422192','2022-11-14 13:59:18.422192',NULL,'0651891e-caac-4069-92ae-0a3c03764822','',NULL,NULL,NULL,1,false,true,false,'','The FlashPix format is a raster based image format that builds on features of previous formats, including Kodak Image Pac, Live Picture IVUE, Hewlett-Packard JPEG, TIFF, and TIFF/EP. The FlashPix format is a cooperative endeavor that includes the Eastman Kodak Company, Microsoft Corporation, the Hewlett-Packard Company, and Live Picture, Inc.',NULL,NULL),
