https://wiki.osdev.org/A.out',NULL,NULL,NULL,1,false,true,false,'','ZMAGIC file format is a type of a.out (an abbreviated form of "assembler output") executible binary format used with Unix-like operating systems. The format was superseeded by ELF file format with System V Release 4 around 1898, due to some limitations of the format. The ZMAGIC was the default a.out file format before they switched to QMAGIC files. Both formats of executable have a 32 byte header at the start of the file, but with ZMAGIC the .text section starts at byte offset 1024, while with QMAGIC the .text section starts at the beginning of the file and includes the header.',NULL,NULL),
