	 ('b7d66f80-faa8-4d2c-923f-1e48f00811dd','2022-11-14 14:01:02.051989','2022-11-14 14:01:02.051989',NULL,'11c6dd51-fbb1-47f3-be66-64780c64f2eb','',NULL,NULL,NULL,1,false,true,false,'','The mapsforge project aims to provide free and open software for the rendering of maps based on OpenStreetMap data. The Binary Map File Format is designed for map rendering on devices with limited resources, such as mobile phones.',NULL,NULL),
	 ('13eea0ff-7df8-4f8b-9e2e-4a5de83b3291','2022-11-14 14:01:02.631517','2022-11-14 14:01:02.631517',NULL,'2593d895-16d7-4f4f-99e6-86091e7b65fc','',NULL,NULL,NULL,1,false,true,false,'','A Mar archive is an archival container file created by the Mar utility on the Apple Macintosh. It is similar to TAR and encapsulates the Resource Fork, Data Fork, and Finder data of a classic Macintosh file.',NULL,NULL),
	 ('8e3f031c-83aa-4298-8c7e-cd8056eecd21','2022-11-14 14:01:03.203213','2022-11-14 14:01:03.203213',NULL,'6d637d4b-c112-4bcc-85ca-83afbae28277','',NULL,NULL,NULL,1,false,true,false,'','Markdown was created by John Gruber and Aaron Swartz circa 2004. The purpose of Markdown is to let users write clean text-based documents that do not suffer from the legibility issues of other ''markup'' formats.

Markdown uses combinations of characters, for example, hashes (pound-sign), asterisks, and combination of square- and rounded- brackets to prefix or suffix parts of text. The symbols provide instructions to an interpreter. A single hash ''#'' for example, that prefixes a line of text is an instruction to make that line a top-level header in a formatted document. Two hashes ''##'' is an instruction to render, or output, a secondary header. And so on.

Ultimately the result of writing markdown is a document that can be parsed into a well-formed version of other presentation languages such as HTML or XHTML.

There is no single specification for Markdown, nor is there a single canonical output. That is, Markdown syntax could be converted into many other file types.

Further descriptions of the background of Markdown and a list of Markdown ''flavors'' can be found on the Archiveteam Just Solve It File Formats Wiki: http://fileformats.archiveteam.org/wiki/Markdown

Wikipedia also provides a thorough description of Markdown and its syntax: https://en.wikipedia.org/wiki/Markdown#Standardization',NULL,NULL),
	 ('aeafea31-df64-4c41-aa79-01a14279b8a3','2022-11-14 14:01:03.761568','2022-11-14 14:01:03.761568',NULL,'d6937fc3-e42c-472e-bd5d-596251ca7ca4','',NULL,NULL,NULL,1,false,true,false,'Operational Pattern 1a','MXF is a media container format which supports a number of different streams of coded "essence", encoded with any of a variety of codecs, together with a metadata wrapper which describes the material contained within the MXF file.

MXF allows for different degrees of complexity within the wrapper, which are standardised and defined as Operational Patterns, and this may be a consideration for an institution considering preserving the format, hence the separation of these Operational Patterns into separate PUIDs.

OP1a is intended to meet the requirements of acquisition, storage and interchange applications that are satisfied by a single item of content packaged in a single essence container.',NULL,NULL),
