	 ('4d6000fe-cb2d-4055-9faa-68fb9df07587','2022-11-14 14:01:08.273225','2022-11-14 14:01:08.273225',NULL,'98c2613e-9faf-480a-b82f-198c12a61dc4','',NULL,NULL,NULL,1,false,true,false,'Operational Pattern 3c','MXF is a media container format which supports a number of different streams of coded "essence", encoded with any of a variety of codecs, together with a metadata wrapper which describes the material contained within the MXF file.

