	 ('468aba47-d4f7-4d50-b1d4-a09106f03281','2022-11-14 14:01:08.90003','2022-11-14 14:01:08.90003',NULL,'016b7a8e-deb1-4a9c-8c82-1faaacd68bf5','',NULL,NULL,NULL,1,false,true,false,'Operational Pattern OP-ATOM','MXF is a media container format which supports a number of different streams of coded "essence", encoded with any of a variety of codecs, together with a metadata wrapper which describes the material contained within the MXF file.

MXF allows for different degrees of complexity within the wrapper, which are standardised and defined as Operational Patterns, and this may be a consideration for an institution considering preserving the format, hence the separation of these Operational Patterns into separate PUIDs.

Operational Pattern OP-Atom is intended to satisfy the demands of applications where there is a requirement for exchange of material and associated metadata together in a single file with an open and standardized format, yet also a demand for a simple, predictable, layout with minimum scope for variation. OP-Atom is specifically intended for applications where each Essence Track is held separately.',NULL,NULL),
