	 ('7a5acf3f-53cb-422c-a681-34d53aa2ba90','2022-11-14 14:01:18.567756','2022-11-14 14:01:18.567756',NULL,'5e5e9626-7dfb-46e5-a2c1-da8f55f78bd4','',NULL,NULL,NULL,1,false,true,false,'','MATLAB (an abbreviation of MATrix LABoratory) software and language enables the user to undertake numerical computation and visualization, programme and analyze data, develop algorithms, and create models. Files with extension m are the source code that executes MATLAB commands. A single MATLAB simulation can contain multiple .m files, each one performing a different function.',NULL,NULL),
	 ('7c953fb6-296c-4156-bad4-826f10b3f675','2022-11-14 14:01:19.290628','2022-11-14 14:01:19.290628',NULL,'cd6f0279-56f9-4b7c-b424-9655fc329cd5','Format specification: https://matroska.org/technical/specs/index.html',NULL,NULL,NULL,1,false,true,false,'1-4','The Matroska Multimedia Container is an open standard free container format, based on the Extensible Binary Meta Language (EBML). Matroska file extensions are .MKV for video (with subtitles and audio), .MK3D for stereoscopic video, .MKA for audio-only files, and .MKS for subtitles only. The Internet Engineering Task Force (IETF) Working Group: Codec Encoding for LossLess Archiving and Realtime transmission (cellar) is tasked with the standardisation of Matroska.

The EBML specifications are work-in-progress, and can be found here: https://github.com/Matroska-Org/ebml-specification/blob/master/specification.markdown','2002-12-06 00:00:00',NULL),
	 ('f97661f8-3600-4217-87cb-7912bf77d529','2022-11-14 14:01:19.973962','2022-11-14 14:01:19.973962',NULL,'cd1e87e4-e5d8-441e-a10a-9b3b607d7f3f','',NULL,NULL,NULL,1,false,true,false,'','Maxwell Render is a 3D render engine developed by Next Limit Technologies. The Maxwell Image Format is a high dynamic range format containing both image data and rendering calculations.',NULL,NULL),
