	 ('ae42a016-53c0-4c4d-a1fc-34956fedb5d1','2022-11-14 14:01:22.8913','2022-11-14 14:01:22.8913',NULL,'e2bf7f54-f963-44eb-8945-aa9d8051c9d4','',NULL,NULL,NULL,1,false,true,false,'','Maxwell Render is a 3D render engine developed by Next Limit Technologies. The Maxwell Scene contains all the geometry in a Maxwell Render scene, as well as cameras and their settings, materials and material assignments.',NULL,NULL),
