	 ('85b384e1-6385-479f-a668-83f5732778c3','2022-11-14 14:01:25.50621','2022-11-14 14:01:25.50621',NULL,'8dd98290-e202-4270-9fc2-4fdc9dfdf657','',NULL,NULL,NULL,1,false,true,false,'','Maya is a 3D graphics application published by Autodesk. Swatch files are created by Maya to provide preview thumbnail images of textures. Maya Icon files appear to use the same format mechanism. An unofficial description of the format layout can be found here: https://www.highend3d.com/t/renderwindoweditor-snm/3411',NULL,NULL),
	 ('9bb89ff5-6d9e-4cfa-a28a-a79835b14ab9','2022-11-14 14:01:26.146314','2022-11-14 14:01:26.146314',NULL,'790e39ac-b245-42bc-b2ea-e670434952b1','',NULL,NULL,NULL,1,false,true,false,'','Maya is a 3D graphics application published by Autodesk. Maya IFF files are raster images used for images and textures within Maya.',NULL,NULL),
	 ('20387511-18a6-49d8-aec3-be3c125ae726','2022-11-14 14:01:26.795017','2022-11-14 14:01:26.795017',NULL,'02432fc4-a739-41c6-96f2-ad8bb309641c','',NULL,NULL,NULL,1,false,true,false,'','MBOX is a commonly used format for storing email messages. MBOX files may be produced by a variety of email clients, however these are often not mutually compatible.

MBOX databases typically contain a linear sequence of electronic mail messages. Each message begins with a separator line that identifies the message sender, and also identifies the date and time at which the message was received by the final recipient (either the last-hop system in the transfer path, or the system which serves as the recipient''s mailstore).  Each message is typically terminated by an empty line.  The end of the database is usually recognized by either the absence of any additional data, or by the presence of an explicit end-of-file marker.

Attachments within MBOX files are typically base 64 encoded, allowing binary data to be transferred over media designed to deal with textual data.

Due to the variety of MBOX structures, it is not currently possible to produce an authoritative signature for the format.',NULL,NULL),
	 ('cb3e23ac-fde6-447b-81bc-11d43ccc257b','2022-11-14 14:01:27.410012','2022-11-14 14:01:27.410012',NULL,'c6f426ef-ac57-44cf-bff7-b2d32b2f6911','',NULL,NULL,NULL,1,false,true,false,'','The MD5 algorithm is a hash function producing a 128-bit hash value, it is described in RFC 1321. Although MD5 was initially designed to be used as a cryptographic hash function, it has been found to suffer from extensive vulnerabilities. It can still be used as a checksum to verify data integrity against unintentional corruption. The MD5 file is a text document which contains single or multiple MD5 values.',NULL,NULL),
	 ('c1eb8f1a-3bf7-407d-ab6b-5e2a601513f5','2022-11-14 14:01:28.08106','2022-11-14 14:01:28.08106',NULL,'54eaae58-e459-42d4-b5c0-ba50b66dafc6','',NULL,NULL,NULL,1,false,true,false,'','Media Descriptor File is created by the software Alcohol %120, developed by Alcohol Soft. It is a CD/DVD image format. The Media Descriptor File is often accompanied by a sidecar file with the extension .mds. This file contains metadata and structural information about the disc image. This format supports mixed mode CDs and can contain both audio and data tracks.',NULL,NULL),
	 ('c6d99fb0-51d0-408d-89bf-b44fb77b48af','2022-11-14 14:06:29.784056','2022-11-14 14:06:29.784056',NULL,'adcad5d4-5075-43e6-9dcd-95b70819411e','',NULL,NULL,NULL,1,false,true,false,'','DCT is a proprietary audio file format developed by NCH Software for their dictation software. As well as audio data, .dct files also contain dictation header information and can be encrypted.',NULL,NULL),
