	 ('1fb099b0-b0da-4de8-a1ba-ebb9bacfb9e8','2022-11-14 14:01:29.34273','2022-11-14 14:01:29.34273',NULL,'5a984216-95b2-4035-9287-f126b6d839cc','https://mediahashlist.org/mhl-specification/

https://cms-assets.theasc.com/ASCMHL_Specification_v1.0.pdf',NULL,NULL,NULL,1,false,true,false,'','The Media Hash List (MHL) standard specifies how a common inventory list of a folders content looks like. The Media Hash List specification ensures that the complete source media is transferred without any alterations. MHL is an XML format, that lists all the files in a folder and all of its subfolders as well as the corresponding checksums. This list is accompanied by additional information about the creation of the MHL file. The MHL file comprehends all the information necessary to tell if the folder structure or any of the contained files was modified since the MHL file was created.',NULL,NULL),
