	 ('d805637c-3d89-4e49-b35e-1a2152c78134','2022-11-14 14:01:42.951105','2022-11-14 14:01:42.951105',NULL,'3dd6329c-297d-472f-8bc8-73bf7ec55f60','',NULL,NULL,NULL,1,false,true,false,'','This is a proprietary file format created by Microsoft Document Imaging, a program which enables the editing and annotation of documents scanned by Microsoft Office Document Scanning. It was introduced in Office XP and was included in Office 2003 and 2007. This format is a variant of TIFF.',NULL,NULL),
	 ('70f7ebdb-33d2-481d-ae9b-2122f7b7f4cc','2022-11-14 14:01:43.629592','2022-11-14 14:01:43.629592',NULL,'83e1b951-53ac-45c4-bc32-f025c54af767','',NULL,NULL,NULL,1,false,true,false,'2','The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 2 is the native file format of Microsoft Excel 2.1 for Windows. The format is proprietary and Microsoft does not make details of its structure public. The information contained here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format, and should not therefore be regarded as definitive. BIFF is a stream based format, and a BIFF 2 file comprises a single worksheet stream, containing a Beginning of File (BOF) record, followed by a series of Worksheet records, and terminated by an End of File (EOF) record.',NULL,NULL),
	 ('a9b282d5-771a-4463-92fe-d4340ea74fda','2022-11-14 14:01:44.377091','2022-11-14 14:01:44.377091',NULL,'84733c4d-9434-4b7b-b1bd-95d7bceedd89','',NULL,NULL,NULL,1,false,true,false,'8X','The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 8X is a native file format of Microsoft Excel XP. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. BIFF 8X is based on Microsofts generic OLE2 Compound Document Format. An Excel workbook is stored as a Book stream within a Compound Document Format file. The Book stream comprises a Workbook Globals Substream, containing a Beginning of File (BOF) record, the Workbook global records, and terminated by an End of File (EOF) record. This is followed by one or more Worksheet substreams, containing a Beginning of File (BOF) record, the worksheet records, and terminated by an End of File (EOF) record. The format remained unchanged with the release of Excel 2003.',NULL,NULL),
	 ('a8fecfc7-af35-41dc-b4e3-01e58cc29297','2022-11-14 14:01:45.14145','2022-11-14 14:01:45.14145',NULL,'5874868d-efb8-4014-aef5-2198f8ea40b7','',NULL,NULL,NULL,1,false,true,false,'3','The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 3 is the native file format of Microsoft Excel 3.0 for Windows. The format is proprietary and Microsoft does not make details of its structure public. The information contained here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format, and should not therefore be regarded as definitive. BIFF is a stream based format, and a BIFF 3 file comprises a single worksheet stream, containing a Beginning of File (BOF) record, followed by a series of Worksheet records, and terminated by an End of File (EOF) record.',NULL,NULL),
	 ('afa6b00b-8c32-47c6-b7a8-debebea3249d','2022-11-14 14:01:45.967042','2022-11-14 14:01:45.967042',NULL,'ef074803-9628-463d-b3a5-1ccb7245973b','',NULL,NULL,NULL,1,false,true,false,'4W','The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 4W is a native file format of Microsoft Excel 4.0 for Windows. Excel 4.0 allowed either a single worksheet to be stored as a worksheet file (BIFF 4S), or for multiple worksheets to be combined in a single workbook file (BIFF 4W). The format is proprietary and Microsoft does not make details of its structure public. The information contained here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format, and should not therefore be regarded as definitive. BIFF is a stream based format, and a BIFF 4W file comprises a Workbook Globals Substream, containing a Beginning of File (BOF) record, one or more embedded Worksheet streams (in BIFF 4S format), and terminated by an End of File (EOF) record.',NULL,NULL),
	 ('29203b9a-aec5-40db-b753-0c056267ce48','2022-11-14 14:01:46.722429','2022-11-14 14:01:46.722429',NULL,'902edf13-38aa-4b61-9270-32759fd2713b','',NULL,NULL,NULL,1,false,true,false,'4S','The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 4S is a native file format of Microsoft Excel 4.0 for Windows. Excel 4.0 allowed either a single worksheet to be stored as a worksheet file (BIFF 4S), or for multiple worksheets to be combined in a single workbook file (BIFF 4W). The format is proprietary and Microsoft does not make details of its structure public. The information contained here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format, and should not therefore be regarded as definitive. BIFF is a stream based format, and a BIFF 4S file comprises a single Worksheet stream, containing a Beginning of File (BOF) record, followed by a series of Worksheet records, and terminated by an End of File (EOF) record.',NULL,NULL),
	 ('fb9f8c20-6f67-4511-8e52-35df3d0d5021','2022-11-14 14:01:47.504427','2022-11-14 14:01:47.504427',NULL,'65d766da-c93e-4d2c-adca-84d97c7dd931','',NULL,NULL,NULL,1,false,true,false,'5/95','The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 5 is a native file format of Microsoft Excel 5.0 for Windows. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. From Excel 5.0 onwards, BIFF is based on Microsofts generic OLE2 Compound Document Format. An Excel workbook is stored as a Book stream within a Compound Document Format file. The Book stream comprises a Workbook Globals Substream, containing a Beginning of File (BOF) record, the Workbook global records, and terminated by an End of File (EOF) record. This is followed by one or more Worksheet substreams, containing a Beginning of File (BOF) record, the worksheet records, and terminated by an End of File (EOF) record.',NULL,NULL),
	 ('cf8b50d6-b7d5-4d82-84ce-b6a1d3fb7df5','2022-11-14 14:06:31.873511','2022-11-14 14:06:31.873511',NULL,'83028b1d-ffd9-42ca-b812-b0e89fc0ad3a','',NULL,NULL,NULL,1,false,true,false,'1','Nrrd is a library and file format designed to support scientific visualization and image processing involving N-dimensional raster data.',NULL,NULL),
	 ('f234dfc5-9f18-48c1-b2dd-edd537c3fe6e','2022-11-14 14:01:48.314672','2022-11-14 14:01:48.314672',NULL,'0f364244-ced5-457f-a2bb-8e354d9313b1','',NULL,NULL,NULL,1,false,true,false,'8','The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 8 is a native file format of Microsoft Excel 97. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. BIFF 8 is based on Microsofts generic OLE2 Compound Document Format. An Excel workbook is stored as a Book stream within a Compound Document Format file. The Book stream comprises a Workbook Globals Substream, containing a Beginning of File (BOF) record, the Workbook global records, and terminated by an End of File (EOF) record. This is followed by one or more Worksheet substreams, containing a Beginning of File (BOF) record, the worksheet records, and terminated by an End of File (EOF) record. The format remained unchanged with the release of Excel 2000.',NULL,NULL),
