	 ('9ef03f81-4dce-4a7d-bc69-6283dc0c6bdb','2022-11-14 14:02:46.996601','2022-11-14 14:02:46.996601',NULL,'c80f44e9-be45-4d9b-a819-510f444134d4','',NULL,NULL,NULL,1,false,true,false,'2003-2007','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select Add an Entry.',NULL,NULL),
	 ('be8b6050-8855-42ed-aba4-b50241b9a152','2022-11-14 14:02:32.791514','2022-11-14 14:02:32.791514',NULL,'943b612a-c9fa-41ca-b2c0-2adf8f19b28f','',NULL,NULL,NULL,1,false,true,false,'2007 Onwards','A Microsoft Office - Word, Excel, or PowerPoint document, that has been encrypted.

The encrypted document conforms to the MS-OFFCRYPTO specification, as found here:
http://msdn.microsoft.com/en-us/library/cc313071(v=office.12).aspx

The document is an OLE2 compound that contains a number of files:

EncryptionInfo - This file contains information used by the Office-compatible application to decrypt the encrypted package. There are multiple variants of this file, as described in 2.3.4.5, and 2.3.4.6 of the format specification.

EncryptedPackage - This file contains the whole of the encrypted document.

DataSpaces folder (and sub-files) - This structure associates protected content with data space definitions. The data space definition, in turn, describes the series of transforms that must be applied to that protected content to restore it to its original form.

Since the method of identifying and distinguishing specific types of OOXML documents relies on seeking and analysing specific elements within the document, and in the case of encryption this information is obfuscated, it does not currently seem possible to determine with any specificity whether an encrypted file is either an Excel, Word, or PowerPoint document, apart from the file extension.',NULL,NULL),
	 ('02206475-0424-47f9-8537-9f8562cea625','2022-11-14 14:02:33.964704','2022-11-14 14:02:33.964704',NULL,'5879f831-624a-4ff4-9478-138a007ff8bb','',NULL,NULL,NULL,1,false,true,false,'','These are xml files generated when a format requiring multiple files is saved by Microsoft Office Programmes (for example, an html page with images). The files are saved alongside the document in a folder called filename_files , and are named filelist.xml. The purpose of the files is to provide a list of all the files which were saved as part of the document, for example the html pages, and the images.',NULL,NULL),
	 ('55334905-6a83-4706-bc42-22a12626db9f','2022-11-14 14:02:35.375774','2022-11-14 14:02:35.375774',NULL,'f83aacbe-04dc-4e11-8fbb-d7dbc8f6803f','',NULL,NULL,NULL,1,false,true,false,'2007 onwards','Microsoft developed office Open XML (OOXML) in 2007. It is an XML based format representing a departure from previous Microsoft Office suites, which were binary file based. Starting with Microsoft Office 2007, the Office Open XML file formats have become the default file format of Microsoft Office. The ISO standard for OOXML is ISO/IEC DIS 29500. An OOXML file format consists of a compressed zip archive that is designated according to which file type it is. OOXML uses three custom XML based languages to describe its three document types. WordProcessingML, SpreadsheetML and PresentationML are each used to describe Word, Excel and PowerPoint Presentation files respectively. OOXML is not an open format but the specification and development rights have been released under Microsofts Covenant not to Sue. OOXML is platform independent.',NULL,NULL),
	 ('22fd6b98-c809-4489-ac6d-6297ac5d2389','2022-11-14 14:02:38.702239','2022-11-14 14:02:38.702239',NULL,'ca21c75e-d8a1-443e-a779-51ae6f02dff6','',NULL,NULL,NULL,1,false,true,false,'','When a previously saved Word document is opened for editing, for printing, or for review, Word creates a temporary file that has a .doc file name extension. This file name extension begins with a tilde (~) that is followed by a dollar sign ($) that is followed by the remainder of the original file name. This temporary file holds the logon name of person who opens the file. This temporary file is called the "owner file."',NULL,NULL),
	 ('b2a2f8b1-d808-46fd-9da8-77a6e5f97ef4','2022-11-14 14:02:39.56923','2022-11-14 14:02:39.56923',NULL,'95f7cfe1-cc12-43a2-a7f2-beeb9af46575','',NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select Add an Entry.',NULL,NULL),
