	 ('7268e933-4991-4b2b-b62f-692af3823e02','2022-11-14 14:02:41.167136','2022-11-14 14:02:41.167136',NULL,'e00d7adf-3e05-41d8-b362-ae1c0397f945','',NULL,NULL,NULL,1,false,true,false,'','Microsoft OneNote is a computer program for information gathering and multi-user collaboration. OneNote package files are compressed container formats which allow users to share OneNote files across computers. The OneNote File Format is a persistence format for storing digital notes as hierarchical sets of sections and pages. Pages can contain text, images, tables, note tags and other types of user-defined content.',NULL,NULL),
