	 ('26bf253c-e064-4974-bcb5-8dcf1ae36b80','2022-11-14 14:02:47.647456','2022-11-14 14:02:47.647456',NULL,'1ded5d08-174e-4202-b768-ba517d9c1fc5','',NULL,NULL,NULL,1,false,true,false,'1','Prior to Windows 3.0, the bundled version of Microsoft Paint used a proprietary format with the extension MSP. The format supported only 1 bit monochrome graphics. Windows 3.0 replaced Microsoft Paint with an application called Paintbrush, that could open MSP files, but would save only as PCX or BMP.',NULL,NULL),
