https://web.archive.org/web/20220329174106/https://en.wikipedia.org/wiki/Microsoft_PowerPoint',NULL,NULL,NULL,1,false,true,false,'3.x','Microsoft PowerPoint Presentation is a proprietary binary file format developed by Microsoft Corporation used to store presentation files created in the Microsoft PowerPoint presentation system. This record describes version 3 of .ppt file format released in May 1992 for Windows, and included in the 3.0 version of Microsoft Office for Windows released in August 1992. Versions up to version 4 [x-fmt/88] of Microsoft PowerPoint use .ppt as extension however, they are not compatible with each other. Microsoft made backwards compatibility an optional add-on after Office 2003 and appears to have removed it altogether in Office 2010. Please follow the links attached to this entry for more information.',NULL,NULL),
