https://web.archive.org/web/20220329174106/https://en.wikipedia.org/wiki/Microsoft_PowerPoint',NULL,NULL,NULL,1,false,true,false,'4.x','Microsoft PowerPoint Presentation is a proprietary binary file format developed by Microsoft Corporation used to store presentation files created in the Microsoft PowerPoint presentation software. This record describes version 4 of .ppt file format released in February 1994 for Windows, and included in the 4.2 version of Microsoft Office for Windows released in the same year. Versions up to version 4 of Microsoft PowerPoint use .ppt as extension however, they are not compatible with each other. Microsoft made backwards compatibility an optional add-on after Office 2003 and appears to have removed it altogether in Office 2010. Please follow the links attached to this entry for more information.',NULL,NULL),
	 ('121e9f86-97d6-4ef9-b061-ca83ca7a8934','2022-11-14 14:03:06.219932','2022-11-14 14:03:06.219932',NULL,'e154ae52-d933-4f66-a840-1dfd6b81caee','',NULL,NULL,NULL,1,false,true,false,'95','Powerpoint format is a presentation format developed by Microsoft. Powerpoint 95 format is the native format of Powerpoint 95. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. Powerpoint 95 is based on Microsofts generic OLE2 Compound Document Format. A Powerpoint presentation is stored as a PowerPoint Document stream within a Compound Document Format file.',NULL,NULL),
	 ('66ac617f-64ac-4af4-982e-579e33f68828','2022-11-14 14:03:06.886672','2022-11-14 14:03:06.886672',NULL,'86eb3388-7045-4cbf-bbda-6790142b1081','',NULL,NULL,NULL,1,false,true,false,'97-2003','Powerpoint format is a presentation format developed by Microsoft. Powerpoint 97-2002 format is the native format of Powerpoint 97 onwards. The format is proprietary and Microsoft does not make details of its structure public. Currently PRONOM cannot differentiate Microsoft Powerpoint Presentation 97-2003 and Microsoft Powerpoint Show by signatures. This means Microsoft Powerpoint Show files with extensions of pps will likely identify as the Microsoft Powerpoint Presentation 97-2003 PUID. Further research may be able to address this.',NULL,NULL),
