	 ('344647a8-e110-4d3e-a024-588ad3ef95ed','2022-11-14 14:04:02.752675','2022-11-14 14:04:02.752675',NULL,'ba2623fb-7895-4236-acdc-18cf431f2cd3','',NULL,NULL,NULL,1,false,true,false,'1.0','The Enhanced Metafile format is a 32-bit format that can contain both vector information and bitmap information. This format contains extended features over the Windows Metafile Format, including built-in scaling information, and improvements in color palettes and device independence.',NULL,NULL),
