	 ('1cf3cc80-e438-468e-8759-db69ab7311c7','2022-11-14 14:04:05.162142','2022-11-14 14:04:05.162142',NULL,'d8171a24-d521-4562-92cd-6d0e32c8535c','',NULL,NULL,NULL,1,false,true,false,'','Windows Movie Maker is video editing software by Microsoft. A .mswmm file won''t typically contain any source audio or video data, rather it will contain references or pointers to the source data. For this reason extracting a .mswmm file from its context may result in the movie being unable to play. A movie exported to a video format from within the application will contain the appropriate data for portable playback.',NULL,NULL),
