	 ('f5976c6d-5890-49ac-a8b7-60d68b86caa8','2022-11-14 14:04:07.021549','2022-11-14 14:04:07.021549',NULL,'9c48c6c8-35a4-4c74-a1b2-cfd999dd9745','',NULL,NULL,NULL,1,false,true,false,'6.0-2003','This format is identifiable via a container signature in DROID 6 and later. Some Word documents from this era lack an internal [CompObj] stream, which is used by fmt/39 and fmt/40 to distinguish between Word files generated in Microsoft Office 6.0/95, and 97-2003. Since compatible files created by certain software lack this stream (potentially including, but not necessarily limited to Apple Pages), this additional identifying record is required to avoid the limiting identification of OLE2.',NULL,NULL),
	 ('cf5d027b-5a1b-4b32-b8e0-802d63b56cc9','2022-11-14 14:04:08.069497','2022-11-14 14:04:08.069497',NULL,'7f3b8a09-6fc9-4d15-9113-63bd2281aa65','',NULL,NULL,NULL,1,false,true,false,'6.0/95','With the release of Word 6.0, Microsoft introduced a new native binary word processing format, based on its generic OLE2 Compound Document Format. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. A Word document is stored as a WordDocument stream within a Compound Document Format file. The format remained unchanged with the release of Word 95.',NULL,NULL),
	 ('67048baf-6956-4386-acb0-73e42b2b7fab','2022-11-14 14:04:09.19713','2022-11-14 14:04:09.19713',NULL,'54874d7e-e09c-44db-b2e6-38cbc50cec9c','',NULL,NULL,NULL,1,false,true,false,'97-2003','With the release of Word 97, Microsoft revised the native binary word processing format, which is based on its generic OLE2 Compound Document Format. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. A Word document is stored as a WordDocument stream within a Compound Document Format file. The format remained unchanged with the releases of Word 2000, 2002 and 2003. An alternative extension of .wbk refers to a backup file of a Word document, however there is no material or structural difference between a .wbk file and the .doc file it is a backup of.',NULL,NULL),
	 ('3c20d535-d18d-46c2-9654-1f24125e32fd','2022-11-14 14:04:35.333769','2022-11-14 14:04:35.333769',NULL,'27622135-8215-4c77-baec-ea95798d1ad1','',NULL,NULL,NULL,1,false,true,false,'3a','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select Add an Entry.',NULL,NULL),
	 ('65c358e0-fd32-4833-b946-971faedb44d6','2022-11-14 14:04:10.16886','2022-11-14 14:04:10.16886',NULL,'d59c7fe6-bdbb-46fa-a9e8-bbcb4d522fdf','',NULL,NULL,NULL,1,false,true,false,'97-2003','With the release of Word 97, Microsoft revised the native binary word processing format, which is based on its generic OLE2 Compound Document Format. A Word document is stored as a WordDocument stream within a Compound Document Format file. The format remained unchanged with the releases of Word 2000, 2002 and 2003. An alternative extension of .wbk refers to a backup file of a Word document, however there is no material or structural difference between a .wbk file and the .doc file it is a backup of.

Within the ''WordDocument'' stream, the byte at position 0x0B deals with encryption/obfuscation, as per the MS FibBase description page - https://msdn.microsoft.com/en-us/library/dd944620(v=office.12).aspx. The first bit (Least Significant Bit (LSB) ordering) specifies whether the file is encrypted, meaning that if the byte at 0x0B is an ''odd'' byte (e.g. 01, 03, 05, 07, 09, 0B, 0D, 0F, 11, 13 etc.) then this indicates obfuscation/encryption is present.',NULL,NULL),
	 ('3ba669d5-8175-47ee-9153-ba375f9f34cd','2022-11-14 14:04:11.49834','2022-11-14 14:04:11.49834',NULL,'d0c912f2-fa72-4b80-b67a-a8a6c02610bc','',NULL,NULL,NULL,1,false,true,false,'97-2003','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select Add an Entry.',NULL,NULL),
	 ('baa72f9e-3a9a-45d1-9853-5f138dae1c94','2022-11-14 14:04:12.420059','2022-11-14 14:04:12.420059',NULL,'053889f9-04fb-41fa-9134-6318a81789ce','',NULL,NULL,NULL,1,false,true,false,'97-2003','With the release of Word 97, Microsoft revised the native binary word processing format, which is based on its generic OLE2 Compound Document Format. A Word document is stored as a WordDocument stream within a Compound Document Format file. The format remained unchanged with the releases of Word 2000, 2002 and 2003.

Within the ''WordDocument'' stream, the byte at position 0x0B deals with encryption/obfuscation, as per the MS FibBase description page - https://msdn.microsoft.com/en-us/library/dd944620(v=office.12).aspx. The first bit (Least Significant Bit (LSB) ordering) specifies whether the file is encrypted, meaning that if the byte at 0x0B is an ''odd'' byte (e.g. 01, 03, 05, 07, 09, 0B, 0D, 0F, 11, 13 etc.) then this indicates obfuscation/encryption is present.',NULL,NULL),
