https://www.docfly.com/blog/2020/a-brief-history-of-microsoft-word',NULL,NULL,NULL,1,false,true,false,'1.x - 4.0','Microsoft Word for MS-DOS Document is a proprietary binary format of Microsoft Word, word processing application, for MS-DOS first released in 1983. The first version was released on IBM PC DOS, developed by Microsoft, which Microsoft then re-branded as MS-DOS. The version was developed by Charles Simonyi and Richard Brodie firstly for Xenix in February 1983 (titled as "Multi-Tool Word") and in October 1983 for MS-DOS operating systems. The application featured graphics video mode, mouse and printer support (printer support was added in version 2) in WYSIWYG (What You See Is What You Get) interface and could run in text mode or graphics mode, with bold, italics, and underline features only available in the text mode. The following four versions were not much dissimilar, including only minor improvements, with the .doc format remained with the same therefore, they are all part of this entry. Please see the full list of versions using the links provided in the Notes section as well as, the manual for MS-DOS versions 1x which can be downloaded from WinWorld.',NULL,NULL),
