https://www.docfly.com/blog/2020/a-brief-history-of-microsoft-word',NULL,NULL,NULL,1,false,true,false,'5.0 - 5.4','Microsoft Word for MS-DOS Document is a proprietary binary format of Microsoft Word, word processing application, for MS-DOS first released in 1983. The first version was released on IBM PC DOS, developed by Microsoft, which Microsoft then re-branded as MS-DOS. The version was developed by Charles Simonyi and Richard Brodie firstly for Xenix in February 1983 (titled as "Multi-Tool Word") and in October 1983 for MS-DOS operating systems. The application featured graphics video mode, mouse and printer support (printer support was added in version 2) in WYSIWYG (What You See Is What You Get) interface and could run in text mode or graphics mode, with bold, italics, and underline features only available in the text mode. The version 5 of the format was released in 1989, with the release of Word for MS-MOS, which included added support for bookmarks, cross-references and conditions and loops in macros, remaining backwards compatible with Word 3.0 macros. Please see the full list of versions using the links provided in the Notes section.',NULL,NULL),
	 ('56181bf3-ea33-4ac7-88f2-66dab3722ef5','2022-11-14 14:05:38.12751','2022-11-14 14:05:38.12751',NULL,'e8b2fb86-4d51-4995-93ea-76e9bda08712','',NULL,NULL,NULL,1,false,true,false,'12','Minitab is a statistical analysis package originally developed at the Pennsylvania State University. A worksheet file contains an exported worksheet, while a project file contains all project-related data including all worksheets, settings, graphs and history.',NULL,NULL),
