https://www.docfly.com/blog/2020/a-brief-history-of-microsoft-word',NULL,NULL,NULL,1,false,true,false,'5.5','Microsoft Word for MS-DOS Document is a proprietary binary format of Microsoft Word, word processing application, for MS-DOS first released in 1983. The first version was released on IBM PC DOS, developed by Microsoft, which Microsoft then re-branded as MS-DOS. The version was developed by Charles Simonyi and Richard Brodie firstly for Xenix in February 1983 (titled as "Multi-Tool Word") and in October 1983 for MS-DOS operating systems. The application featured graphics video mode, mouse and printer support (printer support was added in version 2) in WYSIWYG (What You See Is What You Get) interface and could run in text mode or graphics mode, with bold, italics, and underline features only available in the text mode. The version 5.5 of the format was released in 1990, with the release of Word for MS-MOS, which significantly changed the user interface from previous versions, with popup menus and dialog boxes, adding Mac/Windows-like pulldown menus and overlapping windows. Please see the full list of versions using the links provided in the Notes section.',NULL,NULL),
	 ('23d00830-7b93-48f3-a101-88ff37c988da','2022-11-14 14:04:25.006251','2022-11-14 14:04:25.006251',NULL,'0697b5b6-e856-496e-ac82-eef02f9fc502','https://web.archive.org/web/20211222235448/https://winworldpc.com/product/microsoft-word/6x

