https://www.docfly.com/blog/2020/a-brief-history-of-microsoft-word',NULL,NULL,NULL,1,false,true,false,'6.0','Microsoft Word for MS-DOS Document is a proprietary binary format of Microsoft Word, word processing application, for MS-DOS first released in 1983. The first version was released on IBM PC DOS, developed by Microsoft, which Microsoft then re-branded as MS-DOS. The version was developed by Charles Simonyi and Richard Brodie firstly for Xenix in February 1983 (titled as "Multi-Tool Word") and in October 1983 for MS-DOS operating systems. The application featured graphics video mode, mouse and printer support (printer support was added in version 2) in WYSIWYG (What You See Is What You Get) interface and could run in text mode or graphics mode, with bold, italics, and underline features only available in the text mode. The version 6 of the format was released in 1993, with the release of Word for MS-MOS, which was the last version for MS-DOS and was releases at the same time as Word 6.0 for Word and version 6.0 for Macintosh. The MS-DOS version 6 file format was different from those for Windows and Macintosh and the Word 6.0 for DOS macro language was compatible with the Word 3.x-5.x macro language, whilst Word 6.0 for Windows and Word 6.0 for Macintosh inherited WordBasic from the Word 1.0/2.0 for Windows code base. Please see the full list of versions using the links provided in the Notes section.',NULL,NULL),
