https://www.docfly.com/blog/2020/a-brief-history-of-microsoft-word',NULL,NULL,NULL,1,false,true,false,'Generic','Microsoft Word for MS-DOS Printer Description File is proprietary format of Microsoft Word application used on MS-DOS operating system. The Microsoft Word, word processing application for MS-DOS, was first released in 1983. Microsoft Word for MS-DOS application featured graphics video mode and mouse support in WYSIWYG (What You See Is What You Get) interface. The application could run in text mode or graphics mode with little visual difference between the two modes. There were several versions of Microsoft Word for MS-DOS from version 1 in 1983 to last version released in 1993. Each of these versions included support for printers by using the Printer Description File. These files were to be copied from Word Utilities disk to the Word Program disk which correspond to the printer being used. Additionally, Microsoft Word for MS-DOS included TTY Printer Description File, labelled as TTY.PRD, which supported teletype printing, and teletype printing with backspace files labelled as TTYBS.PRD. The header for each version is  similar to the .doc file format header but with one byte (3) difference. This is a generic entry for this format however, other versions respond to the same byte pattern in different versions as .doc formats for MS-DOS. Please see the full list of versions in PRONOM and using the links provided in the Notes section as well as, the manual for MS-DOS versions 1x which can be downloaded from WinWorld.',NULL,NULL),
