https://www.docfly.com/blog/2020/a-brief-history-of-microsoft-word',NULL,NULL,NULL,1,false,true,false,'Generic','Microsoft Word for MS-DOS Style Sheet is proprietary format of Microsoft Word application used on MS-DOS operating system. The Microsoft Word, word processing application for MS-DOS, was first released in 1983. Microsoft Word for MS-DOS application featured graphics video mode and mouse support in WYSIWYG (What You See Is What You Get) interface. The application could run in text mode or graphics mode with little visual difference between the two modes. There were several versions of Microsoft Word for MS-DOS released, from version 1 in 1983 to last version released in 1993. Each of these versions included support for style sheets (.sty) file format. The header for each version is  similar to the .doc file format header but with one byte (3) difference. This is a generic entry for this format however, other versions respond to the same byte pattern in different versions as .doc formats for MS-DOS. Please see the full list of versions in PRONOM and using the links provided in the Notes section as well as, the manual for MS-DOS versions 1x which can be downloaded from WinWorld.',NULL,NULL),
	 ('d4d4ed0f-f94d-41fd-8db6-50fdb1f356a7','2022-11-14 14:04:27.724991','2022-11-14 14:04:27.724991',NULL,'a97928db-1512-4ed0-a645-7401dbd08875','',NULL,NULL,NULL,1,false,true,false,'2007 onwards','From Microsoft Office 2007 onwards, the core output format of MS Word has been based on the Office Open XML (OOXML) file format. The ISO standard for OOXML is ISO/IEC DIS 29500. An OOXML file format consists of a compressed zip archive that is designated according to which file type it is. Further detail on OOXML can be found within fmt/189 - Microsoft Office Open XML. An alternative extension of .wbk refers to a backup file of a Word document, however there is no material or structural difference between a .wbk file and the .doc file it is a backup of.',NULL,NULL),
	 ('71ad5f3b-c841-418e-8d92-97e03e6b12e0','2022-11-14 14:04:28.359555','2022-11-14 14:04:28.359555',NULL,'70408dc7-0674-4123-83f5-6a4c94a2c329','',NULL,NULL,NULL,1,false,true,false,'1.0','Word Document format is a word processing format developed by Microsoft. Word 1.0 format is the native file format of Microsoft Word 1.0 for Windows. It is proprietary and Microsoft does not make details of its structure public. A Word document file comprises a header section followed by a text section, which contains the document text in ANSI characters, followed by a format section, which contains formatting information about the text.',NULL,NULL),
	 ('3447816c-24f9-460f-aaac-b4934465ff24','2022-11-14 14:04:29.188949','2022-11-14 14:04:29.188949',NULL,'f0d0bdd8-82bb-450e-9bda-a9a1bed3fd37','',NULL,NULL,NULL,1,false,true,false,'2.0','Word Document format is a word processing format developed by Microsoft. Word 2.0 format is the native file format of Microsoft Word 2.0 for Windows. It is proprietary and Microsoft does not make details of its structure public. A Word document file comprises a header section followed by a text section, which contains the document text in ANSI characters, followed by a format section, which contains formatting information about the text.',NULL,NULL),
