	 ('52844891-9d83-4137-b689-674c1c3caed3','2022-11-14 14:05:48.200027','2022-11-14 14:05:48.200027',NULL,'cfd75b6a-997b-4daf-9cbe-a4db39beca35','',NULL,NULL,NULL,1,false,true,false,'','XMF is a family of specifications created and administered by the MIDI Manufacturer''s Association. An XMF file contains one or more existing files such as Standard MIDI Files, Downloadable Sound (DLS) instrument files, WAV files, or other digital audio files to create a collection of all the resources needed to present a musical piece. Mobile XMF was developed specifically for mobile phones, and supports SP-MIDI format SMF files as well as Mobile DLS content.',NULL,NULL),
	 ('2264a2c0-369d-4a69-89bb-c2b269e7e17b','2022-11-14 14:05:49.562194','2022-11-14 14:05:49.562194',NULL,'4c6665b1-8e01-4bf0-901b-d24d2d4678ee','',NULL,NULL,NULL,1,false,true,false,'','The MOD format is an audio sequencing format, originally developed on the Amiga by Karsten Obarski.',NULL,NULL),
