	 ('46cfb975-58fc-4634-a1b4-ff10c6704b0a','2022-11-14 14:05:51.386831','2022-11-14 14:05:51.386831',NULL,'222ce41e-d93c-4624-8d48-c3287c32ad05','',NULL,NULL,NULL,1,false,true,false,'','Mork is a database file format that acts as part of the back-end to several email clients and web browsers produced originally by Netscape, and later the Mozilla Foundation.',NULL,NULL),
	 ('251628bb-2417-43b2-89b0-046795a8c0fd','2022-11-14 14:05:52.563178','2022-11-14 14:05:52.563178',NULL,'64baef70-4578-4435-aebe-edd6bfa484fc','',NULL,NULL,NULL,1,false,true,false,'','MP3 is a digital audio format, formally known as MPEG-1 Audio Layer III or MPEG-2 Audio Layer III. A third variant, known as MPEG 2.5, which supports lower bit rates implemented by the LAME MP3 encoder among others, but is not a recognised standard.',NULL,NULL),
	 ('349f9705-0932-47ce-a79d-003c5ea62f89','2022-11-14 14:05:53.365078','2022-11-14 14:05:53.365078',NULL,'6abd23ac-300f-426b-9a3c-9daa145c4ad3','',NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select Add an Entry.',NULL,NULL),
