	 ('e2d32a12-a52d-4d6c-b78e-fb2d716c1ef0','2022-11-14 14:05:57.278321','2022-11-14 14:05:57.278321',NULL,'a3ccb0e4-b587-4c57-b2b9-c68b3bef6452','https://www.loc.gov/preservation/digital/formats/fdd/fdd000338.shtml

https://en.wikipedia.org/wiki/MPEG-1_Audio_Layer_II

https://www.w3.org/TR/mse-byte-stream-format-mpeg-audio/

http://www.library.snls.org.sz/archive/doc/wikipedia/wikipedia-terodump-0.1/tero-dump/wikipedia/mp/MP3.html',NULL,NULL,NULL,1,false,true,false,'','MPEG Audio Stream Layer II is a lossy audio compression format defined by ISO/IEC 11172-3 standard. The format was initiated by the Digital Audio Broadcast (DAB) project financed by the European Union as a part of the EUREKA research program in the late 1980s. The format first appeared in early 1990s, with its encoding derived from the MUSICAM (Masking pattern adapted Universal Subband Integrated Coding And Multiplexing) audio codec, chosen for its simplicity and error resistance. It is a predecessor to MPEG 1/2 Audio Layer III and often referred to as MP2.',NULL,NULL),
	 ('e5c0d7cd-749b-4913-b97b-172198620cb7','2022-11-14 14:05:59.070482','2022-11-14 14:05:59.070482',NULL,'c29cce15-37c8-4280-8890-ae104bef632a','',NULL,NULL,NULL,1,false,true,false,'','MPEG-1 is a lossy compression standard for video and audio, intended for use in Digital Storage Media (DSM) such as VideoCD and DVD (at the same encoding standard as VCD). It is designed to handle video frame-sizes of 352 x 288px, at a frame-rate of 25 frames per second (PAL) and a data rate of around 1.2Mbits/s; audio: up to 320 kbits/s (MPEG-1 Audio Layer III, *.mp3). MPEG-1 supports random access to stream content on playback. MPEG-1 Video supports only ''progressive'' frame video. MPEG-1 compression can be relatively inefficient by modern standards. An MPG-1 Elementary stream (ES) file (*.m1v) contains either a single video or audio stream (e.g. *.mp3). ES files are generally intended for video editing or other intermediate use, where separate audio content can be ultimately blended (''interleaved'' or muxed) with a video stream to produce an output file containing both audio and video for synchronised playback.',NULL,NULL),
	 ('23306715-c434-4444-96ce-80164f23590a','2022-11-14 14:06:00.364061','2022-11-14 14:06:00.364061',NULL,'9e237ef5-f49c-424d-a0dc-00983f14f761','',NULL,NULL,NULL,1,false,true,false,'','MPEG-1 is a lossy compression standard for video and audio, intended for use in Digital Storage Media (DSM) such as VideoCD and DVD (at the same encoding standard as VCD). It is designed to handle video frame-sizes of 352 x 288px, at a frame-rate of 25 frames per second (PAL) and a data rate of around 1.2Mbits/s; audio: up to 320 kbits/s (MPEG-1 Audio Layer III, *.mp3). MPEG-1 supports random access to stream content on playback. MPEG-1 Video supports only ''progressive'' frame video. MPEG-1 compression can be relatively inefficient by modern standards. An MPG-1 Program stream (PS) file (*.mpg, *.mpeg) generally contain both video and audio streams, generally for synchronised playback, and may carry a variety of other data (e.g. video captions).',NULL,NULL),
	 ('60a4b993-b9ef-49d1-8f9b-9f6128e596d1','2022-11-14 14:06:03.112725','2022-11-14 14:06:03.112725',NULL,'91f90163-2f0d-4490-9001-b80422c55bc0','',NULL,NULL,NULL,1,false,true,false,'','MPEG-2 is a lossy compression standard (an improvement and expansion of the MPEG-1 standard) designed for the generic coding of video and audio and intended to cover a wide scope of application, including: video production, broadcast and editing. Streams are at potentially higher bitrates than MPEG-1 but more efficient compression making it suited to High Definition video. MPEG-2 Video supports both ''progressive'' and ''interlaced'' frame video. An MPG2 Elementary stream (ES) file (*.m2v) contains either a single video or audio stream. ES files are generally intended for video editing or other intermediate use, where separate audio content can be ultimately blended (''interleaved'' or muxed) with a video stream to produce an output file containing both audio and video for synchronised playback.',NULL,NULL),
	 ('328315e0-a8f4-47b7-9ee4-f706a92c6de5','2022-11-14 14:06:04.141346','2022-11-14 14:06:04.141346',NULL,'b78f5c05-4e6c-42f6-bd4d-936b3efd3cec','',NULL,NULL,NULL,1,false,true,false,'','MPEG-2 is a lossy compression standard (an improvement and expansion of the MPEG-1 standard) designed for the generic coding of video and audio and intended to cover a wide scope of application, including: video production, broadcast and editing. Streams are at potentially higher bitrates than MPEG-1 but more efficient compression making it suited to High Definition video. MPEG-2 Video supports both ''progressive'' and ''interlaced'' frame video. An MPG-2 Program stream (PS) file (*.mpg, *.mpeg) generally contain both video and audio streams, generally for synchronised playback, and may carry a variety of other data (e.g. video captions).

Some camcorders store their MPEG-2 Program Stream video data as files with the .mod extension, usually alongside other files containing metadata and management information for the video.',NULL,NULL),
	 ('7886cf7e-e562-489b-bbfe-32b128ba11b0','2022-11-14 14:06:04.923557','2022-11-14 14:06:04.923557',NULL,'920e3ecc-f02f-47a8-b5ef-aeb2d9f10ccd','',NULL,NULL,NULL,1,false,true,false,'','MPEG-2 is a lossy compression standard (an improvement and expansion of the MPEG-1 standard) designed for the generic coding of video and audio and intended to cover a wide scope of application, including: video production, broadcast and editing. Streams are at potentially higher bitrates than MPEG-1 but more efficient compression making it suited to High Definition video. MPEG-2 Video supports both ''progressive'' and ''interlaced'' frame video. An MPEG-2 ''Transport'' stream file (TS) file (*.ts, *.m2ts) is designed for low-latency, real-time transmission and is used in broadcasting. It can contain multiple programmes, not necessarily intended for synchronised playback. TS incorporates features that can allow flexible access to and playback of stream content.',NULL,NULL),
	 ('a7c7b280-2cb8-48d2-ba54-88bb29cb7d67','2022-11-14 14:06:06.131596','2022-11-14 14:06:06.131596',NULL,'ebcec6b6-5b45-4c46-9d72-f584e7c43fe2','',NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select Add an Entry.',NULL,NULL),
	 ('002aec20-2cf8-46d6-9742-05cb5ab60b2d','2022-11-14 14:06:07.213463','2022-11-14 14:06:07.213463',NULL,'e9fc8421-db56-41b7-b6eb-330adb947d9a','',NULL,NULL,NULL,1,false,true,false,'','MrSID is an acronym that stands for Multiresolution Seamless Image Database. It is a wavelet-based file format developed and patented by LizardTech designed to enable portability of massive bit-mapped (raster) images, such as orthophotos. MrSID was originally developed for Geographic Information Systems (GIS). With this format, large raster image files such as aerial photographs or satellite imagery are compressed and can be quickly viewed without having to decompress the entire file. There is no open source implementation of the MrSID format. Some open source GIS systems can read MrSID files, including MapWindow GIS and those based on GDAL. The Decode Software Development Kit (SDK) is made available as a free download from developer.lizardtech.com. This enables the capability to implement MrSID reading capability in any application.',NULL,NULL),
	 ('2be4909a-6d7e-4077-bd3f-67bfc5b26fb2','2022-11-14 14:06:08.1159','2022-11-14 14:06:08.1159',NULL,'78548f95-2650-4f08-b391-c7081bceb954','A DOS compressed file will be named file.**_, so a .exe will look like file.ex_, a DOS compressed .jpg will look like file.jp_ etc.

