http://www4.pair.com/gribnif/downloads/neodesk/',NULL,NULL,NULL,1,false,true,false,'1 and 2','NeoDisk icon file format is associated with the NeoDesk graphical environment, developed by Gribnif Software, for the Atari ST family of computers. Three versions of NeoDesk icon files exist. The first and the second and uncompressed and have no discernible signature. The first verison consists of 9 icons (232 bytes each) for a total file size of 2088 bytes. The second version consists of any number of icons (244 bytes each) with the total file size a multiple of 244. These can currently be identified by extension only using DROID.',NULL,NULL),
