	 ('d1d9ceee-ec98-46e4-9af7-f59af760fbf5','2022-11-14 14:07:05.281416','2022-11-14 14:07:05.281416',NULL,'e558d1f0-83ca-444b-86da-6d70604acebd','',NULL,NULL,NULL,1,false,true,false,'','NUT is a container format for the storage of audio, video, subtitles and other related user defined streams. It provides an exact timestamp for synchronization and seeking.',NULL,NULL),
