	 ('7d503b73-815c-484f-8a35-c7f80b598219','2022-11-14 14:07:07.570795','2022-11-14 14:07:07.570795',NULL,'093b880e-4c31-44bb-9ebd-dcb27ba54944','Specification: https://www.ogc.org/standards/geopackage',NULL,NULL,NULL,1,false,true,false,'1.0-1.31','A Geopackage is designed for transferring geospatial information in a platform-independent, portable, open and standards based way. It is a standard describing a set of conventions for storing vector features, extensions and tile matrix sets of imagery and raster maps at various scales within a SQLite database. It was defined and published by the Open Geospatial Consortium (OGC) in 2014.',NULL,NULL),
	 ('1ba82caf-123c-41da-bf7f-9a2691910619','2022-11-14 14:07:08.486647','2022-11-14 14:07:08.486647',NULL,'0088c670-48a6-4bc9-bf5b-ae74400f3767','',NULL,NULL,NULL,1,false,true,false,'','Ogg is a open container format maintained by the Xiph.Org Foundation. FLAC (Free Lossless Audio Codec) handles archival and high fidelity audio data.',NULL,NULL),
	 ('19178135-43e4-471e-b15a-87b110e15779','2022-11-14 14:07:09.251798','2022-11-14 14:07:09.251798',NULL,'f269140e-62b4-4475-8b4a-60aa38a25ff7','',NULL,NULL,NULL,1,false,true,false,'','Ogg is a free, open container format maintained by the Xiph.Org Foundation. The Ogg container format can multiplex a number of independent streams for audio, video, text, and metadata.

In the Ogg multimedia framework, Theora provides a lossy video layer. The audio layer is commonly provided by the music-oriented Vorbis format. Other audio coding format options include the Opus compression format, the lossless audio compression format FLAC, Speex for low bitrate voice data, and OggPCM for uncompressed PCM audio.

This generic entry applies where available PRONOM signatures for Ogg do not yet apply to the file in question. In this instance you may wish to contact pronom@nationalarchives.gov.uk to help improve PRONOM''s signatures.',NULL,NULL),
	 ('0cb0f5bb-a48f-4718-9267-c0e22b7692c8','2022-11-14 14:07:09.950796','2022-11-14 14:07:09.950796',NULL,'86ecd7dd-cfd3-4763-b5cd-9397335a0301','',NULL,NULL,NULL,1,false,true,false,'','Ogg is a open container format maintained by the Xiph.Org Foundation, while Opus is a lossy audio coding format developed by Xiph and intended to replace the Vorbis codec.',NULL,NULL),
	 ('922c0007-d590-4b4a-ab90-1e78665cc0d5','2022-11-14 14:07:10.646265','2022-11-14 14:07:10.646265',NULL,'464e5642-51f2-4026-a358-17fac19d406b','',NULL,NULL,NULL,1,false,true,false,'','Ogg is a open container format maintained by the Xiph.Org Foundation. The Speex codec is a lossy codec aimed at handling low bitrate audio, particularly speech.',NULL,NULL),
	 ('3052c1e0-7cc9-4a98-8371-a3b0bac34550','2022-11-14 14:07:11.307621','2022-11-14 14:07:11.307621',NULL,'37167ad6-61e6-49c6-8657-10c3675f9763','',NULL,NULL,NULL,1,false,true,false,'','Ogg is a free, open container format maintained by the Xiph.Org Foundation. The Ogg container format can multiplex a number of independent streams for audio, video, text, and metadata.

