	 ('8d14ed52-20c8-4b8d-83e3-5802775e923f','2022-11-14 14:07:11.996111','2022-11-14 14:07:11.996111',NULL,'b135f07a-63f2-4cfc-9890-d770f18c556b','',NULL,NULL,NULL,1,false,true,false,'','Ogg is a open container format maintained by the Xiph.Org Foundation. Vorbis is a free and open-source software project headed by the Xiph.Org Foundation and produces an audio coding format and software reference encoder/decoder (codec) for lossy audio compression.',NULL,NULL),
	 ('9cf9f957-ba83-4499-b40c-c81369416c93','2022-11-14 14:07:12.584435','2022-11-14 14:07:12.584435',NULL,'62ce9a56-f645-4c40-8dc7-440394c75f29','',NULL,NULL,NULL,1,false,true,false,'','The GFS file is used by the OGR Geography Markup Language reader to predefine dataset level information in the absense of an XML Schema definition for the feature classes within the GML file. Its purpose and syntax is described here: http://www.gdal.org/drv_gml.html',NULL,NULL),
	 ('3ca47375-edbc-43ba-a17e-07489ea48bac','2022-11-14 14:07:15.874773','2022-11-14 14:07:15.874773',NULL,'7484b864-6a0f-4b3b-ac00-59665df13f1c','',NULL,NULL,NULL,1,false,true,false,'','Oktalyzer is an audio sequencer developed by Armin Sander for the Amiga in 1989. Note, this is an Amiga filetype, where the ''extension'' is a prefix rather than suffix, hence most Oktalyzer files will follow the okt.filename convention.',NULL,NULL),
	 ('cac634e5-eb4a-440e-8609-ceb303dc64d8','2022-11-14 14:07:19.760867','2022-11-14 14:07:19.760867',NULL,'0b00b4dc-8a7a-48cc-8b91-e7e9c593298e','',NULL,NULL,NULL,1,false,true,false,'','The OLE2 Compound Document Format is a generic document format developed by Microsoft as the underlying native binary format for many of its Office applications. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. A Compound Document acts as a file system in which independent data streams are organised within a hierarchy of containers, called storages. All storages and streams are contained within a parent Root Storage. A Directory Stream indexes every stream and storage in the file. A Compound Document begins with the Compound Document Header, including pointers to the location of the Directory Stream and Master Sector Allocation Table. The remainder of the file is organised into Sectors, the positions of which are defined in the Sector Allocation Table and Master Sector Allocation Table.',NULL,NULL),
