	 ('166a9286-76bd-4034-8ea0-f8ab59cfb7f5','2022-11-14 14:07:56.080012','2022-11-14 14:07:56.080012',NULL,'64bf03a4-d94f-41e2-a626-f15091991cb1','',NULL,NULL,NULL,1,false,true,false,'1.0','All OpenOffice v1.0 documents (Calc, Draw, Impress, Writer) use the extensible Markup Language (XML) for representing the elements and attributes of each structural component of the document. As XML has no native support for binary objects, OpenOffice.org files use a standard Zip file to store the XML content together with its associated binary data. Information about the files contained in the Zip file is stored in an XML file called the manifest file. The manifest file is always stored at the pathname META-INF/manifest.xml. The manifest file contains a list of all the files in the Zip file, the media type of each file, and the information necessary to decrypt any encrypted files included in the Zip file.',NULL,NULL),
	 ('d8ce8d02-aed8-4773-9da1-6cbfcfe2c406','2022-11-14 14:07:33.459809','2022-11-14 14:07:33.459809',NULL,'5b10bdd6-e7d4-469c-9885-708e4a16176b','',NULL,NULL,NULL,1,false,true,false,'1.0','OpenDocument (ODF) format is a generic format for office documents, such as text, spreadsheets, presentations, drawings, and databases. It was developed by OASIS, based on the original OpenOffice document format. The format is an open standard, and is supported by a variety of office software packages. ODF is an XML format, which may comprise a single XML document, or a collection of subdocuments within a package. The package format is the commonly used form, and comprises a standard ZIP package containing the XML content and any associated binary data, together with a manifest which lists the package content. An ODF database document contains a relational database. The content is contained in a ''content'' xml subdocument. Additional subdocuments contain style information, document metadata, and application-specific settings.','2005-05-01 00:00:00',NULL),
