	 ('a1681b1f-07fa-4f03-a83b-92bc396f9968','2022-11-14 14:07:54.089659','2022-11-14 14:07:54.089659',NULL,'1add95db-5be6-45a7-97da-f7aba68522ea','',NULL,NULL,NULL,1,false,true,false,'1.0','All OpenOffice v1.0 documents (Calc, Draw, Impress, Writer) use the extensible Markup Language (XML) for representing the elements and attributes of each structural component of the document. As XML has no native support for binary objects, OpenOffice.org files use a standard Zip file to store the XML content together with its associated binary data. Information about the files contained in the Zip file is stored in an XML file called the manifest file. The manifest file is always stored at the pathname META-INF/manifest.xml. The manifest file contains a list of all the files in the Zip file, the media type of each file, and the information necessary to decrypt any encrypted files included in the Zip file.',NULL,NULL),
