	 ('48aec675-8257-44b5-bf78-a4c816532cdb','2022-11-14 14:08:02.089614','2022-11-14 14:08:02.089614',NULL,'745a31bd-1c35-4fb4-a423-7ec8808dc021','',NULL,NULL,NULL,1,false,true,false,'1.0','PUID deprecated.                                                                                                                                         Please see fmt/115 for information on OS/2 Bitmap 1.0 and Windows Bitmap 2.0.
The only difference between Windows bitmap 2.0 and OS/2 bitmap 1.0 is the data type of the width and height fields of the bitmap header  for Windows 2.0 bitmaps they are signed short integers, for OS/2 1.0 bitmaps they are unsigned shorts. For positive numbers the representation is the same. Consequently, the file formats cannot be distinguished with a file signature test. The PUID for OS/2 Bitmap 1.0 has therefore been deprecated.',NULL,NULL),
