https://en.wikipedia.org/wiki/Atari_Falcon',NULL,NULL,NULL,1,false,true,false,'','True Colour Picture files are part of raster image graphics associated with Spooky Sprites, a graphics editor for Atari Falcon. This particular record identifies True Colour Picture files that were compressed using Packed-Ice, a file compression tool used on Atari computers. Packed-Ice was developed by pseudonym "Axe of Delight", later changed to "Axe of Superior". There are several different versions of this compression tool. The files compressed using Packed-Ice program, start with ASCII "Ice!", or "ICE!", followed by a gap between 4-11 characters and then the magic bytes of the original file format.

The Atari Falcon030 (usually shortened to Atari Falcon), released in 1992, was the final personal computer product from Atari Corporation. A high-end model of the Atari ST line, the machine is based on a Motorola 68030 CPU and a Motorola 56000 digital signal processor, a feature which distinguishes it from most other microcomputers of the era. It included a VIDEL programmable graphics system which greatly improved graphics capabilities.',NULL,NULL),
