	 ('34e8c8b1-f37b-492e-8072-1e77485608c0','2022-11-14 14:08:34.054255','2022-11-14 14:08:34.054255',NULL,'b08e197b-031f-4b63-b5b3-3f1d88577ea5','',NULL,NULL,NULL,1,false,true,false,'3.0','The Paint Shop Pro (PSP) file format is an extremely rich graphics file format that is capable of describing a multi-layered image document in minute detail. The format facilitates the retention of a great deal of information, including layer bitmaps, layer masks, layer grouping information, a sample thumbnail, image dimension, image resolution, creator name, copyright owner, image description, masks, selections, alpha channels, etc. The PSP format supports storing an image document in an uncompressed format or, to reduce the size of the file, in either Run Length Encoding (RLE) or LZ77 compressed format. As each of these is a lossless storage method, the PSP format always maintains the original quality of stored image documents. Finally, the PSP format supports storing image bitmaps at a variety of bit depths, including 24 bit colour (16.7 million colours), 8 bit colour (256 colour), 8 bit greyscale (256 greys), 4 bit colour (16 colours) and 1 bit colour (2 colours).',NULL,NULL),
	 ('8ff3c155-45d7-47d5-857b-30b92d977785','2022-11-14 14:08:34.796013','2022-11-14 14:08:34.796013',NULL,'16708036-0a1b-43bb-828d-f70d6bbd1642','',NULL,NULL,NULL,1,false,true,false,'4.00','The Paint Shop Pro (PSP) file format is an extremely rich graphics file format that is capable of describing a multi-layered image document in minute detail. The format facilitates the retention of a great deal of information, including layer bitmaps, layer masks, layer vector data, layer adjustment data, layer grouping information, multiple sample thumbnails, multiple sample composite images, image dimension, image resolution, creator name, copyright owner, image description, masks, selections, alpha channels, etc. The PSP format supports storing image bitmaps in an uncompressed format or, to reduce the size of the file, in either Run Length Encoding (RLE) or LZ77 compressed format. As each of these is a lossless storage method, the PSP format always maintains the original quality of stored image documents. Finally, the PSP format supports storing image bitmaps at a variety of bit depths, including 24-bit colour (16.7 million colours), 8-bit colour (256 colour), 8-bit greyscale (256 greys), 4-bit colour (16 colours), and 1-bit colour (2 colours).',NULL,NULL),
	 ('671c11b9-26c4-403c-9d7c-afbfd279f949','2022-11-14 14:08:35.442936','2022-11-14 14:08:35.442936',NULL,'92cf8fbc-42b0-4221-a090-86b057701122','',NULL,NULL,NULL,1,false,true,false,'5.0','The Paint Shop Pro (PSP) file format is an extremely rich graphics file format that is capable of describing a multi-layered image document in minute detail. The format facilitates the retention of a great deal of information, including layer bitmaps, layer masks, layer vector data, layer adjustment data, layer grouping information, multiple sample thumbnails, multiple sample composite images, image dimension, image resolution, creator name, copyright owner, image description, masks, selections, alpha channels, etc. The PSP format supports storing image bitmaps in an uncompressed format or, to reduce the size of the file, in either Run Length Encoding (RLE) or LZ77 compressed format. As each of these is a lossless storage method, the PSP format always maintains the original quality of stored image documents. Finally, the PSP format supports storing image bitmaps at a variety of bit depths, including 24-bit colour (16.7 million colours), 8-bit colour (256 colour), 8-bit greyscale (256 greys), 4-bit colour (16 colours), and 1-bit colour (2 colours).',NULL,NULL),
	 ('d118020a-3468-4ccb-bb98-93069857f094','2022-11-14 14:08:36.234931','2022-11-14 14:08:36.234931',NULL,'59adbd1d-c0e9-4d69-9d52-58966efb8997','',NULL,NULL,NULL,1,false,true,false,'6.0','The Paint Shop Pro (PSP) file format is an extremely rich graphics file format that is capable of describing a multi-layered image document in minute detail. The format facilitates the retention of a great deal of information, including layer bitmaps, layer masks, layer vector data, layer adjustment data, layer grouping information, multiple sample thumbnails, multiple sample composite images, image dimension, image resolution, creator name, copyright owner, image description, EXIF information, masks, selections, alpha channels, etc. The PSP format supports storing image bitmaps in an uncompressed format or, to reduce the size of the file, in either Run Length Encoding (RLE) or LZ77 compressed format. As each of these is a lossless storage method, the PSP format always maintains the original quality of stored image documents. Finally, the PSP format supports storing image bitmaps at a variety of bit depths, including 24-bit colour (16.7 million colours), 8-bit colour (256 colour), 8-bit greyscale (256 greys), 4-bit colour (16 colours), and 1-bit colour (2 colours).',NULL,NULL),
