http://fileformats.archiveteam.org/wiki/PCX',NULL,NULL,NULL,1,false,true,false,'2','PCX (Personal Computer eXchange) is a type of lossless bitmap image format first released in 1985 and last updated in 1991. This record describes the second version of the format released in 1987. PCX was a popular format among users of MS-DOS operating system and other IBM PC compatibles. It is native image file format for DOS-based program PC Paintbrush from ZSoft Corporation. PC Paintbrush was licensed to Microsoft and evolved into the Paint/Paintbrush application included with Windows operating system. The versions of Windows 3.0 through Windows 95, support the PCX format. The format has since been succeeded by other lossless image formats, such as GIF, BMP, JPEG, and PNG.',NULL,NULL),
