http://fileformats.archiveteam.org/wiki/PCX',NULL,NULL,NULL,1,false,true,false,'5','PCX (Personal Computer eXchange) is a type of lossless bitmap image format first released in 1985 and last updated in 1991. This record describes the fifth and final version of the format released in 1991. PCX was a popular format among users of MS-DOS operating system and other IBM PC compatibles. It is native image file format for DOS-based program PC Paintbrush from ZSoft Corporation. PC Paintbrush was licensed to Microsoft and evolved into the Paint/Paintbrush application included with Windows operating system. The versions of Windows 3.0 through Windows 95, support the PCX format. The format has since been succeeded by other lossless image formats, such as GIF, BMP, JPEG, and PNG.',NULL,NULL),
	 ('e9e8c0e3-1bae-472a-9e59-608893b11569','2022-11-14 14:08:55.880919','2022-11-14 14:08:55.880919',NULL,'8370d329-9e93-4bc5-a15d-4f2943fcdb4e','',NULL,NULL,NULL,1,false,true,false,'2.0','Portable Document Format is a platform-independent format for representing formatted documents, originally developed by Adobe Systems Incorporated. PDF 2.0 is standardised by ISO 32000-2. A PDF file comprises a Header section, a Body section containing the objects which make up the document, a Cross Reference Table, and a Trailer section. PDF files can contain a wide variety of content, including text, images, video and audio.',NULL,NULL),
	 ('dc6e3d65-203c-46e7-8b8a-04c8328b9a73','2022-11-14 14:08:56.539328','2022-11-14 14:08:56.539328',NULL,'79d6b8a9-c2d8-4e7e-87a2-cb3b58a9999a','',NULL,NULL,NULL,1,false,true,false,'1.7','PDF Portfolio files are PDFs using a feature added to the PDF specification in version 1.7 called "Collections". Collections offer a way to embed file attachments that are related in structure or content, as well as information that a reader application should use to determine how to present these files. A simple metadata schema can also be defined for the collection, allowing metadata to be provided for each item in the collection. Additionally, folder structure can be provided for the collection items, allowing reader applications to present the attachments with a tree-view. This makes the PDF Portfolio a convenient format to export mailboxes as mail folder structure can be preserved, along with standard email metadata such as "To", "From" and "Subject" fields.

PDF Portfolio files can specify a "default view", which is a file in the collection that a reader application should display when opening the Portfolio.',NULL,NULL),
	 ('73f147d6-4614-466f-8c35-25293d4f4ff1','2022-11-14 14:08:57.199441','2022-11-14 14:08:57.199441',NULL,'b6aad4ac-a299-4027-bd5e-58dc04823cd8','',NULL,NULL,NULL,1,false,true,false,'','PEA (an acronym of Pack Encrypt Authenticate) is the native format of PeaZip, an open source file archiver created by Giorgio Tani.',NULL,NULL),
	 ('51529e47-66c3-49e7-acf8-9ad52090ef25','2022-11-14 14:08:57.814693','2022-11-14 14:08:57.814693',NULL,'d7160c23-2d58-4106-8792-4d3ae46dfc65','',NULL,NULL,NULL,1,false,true,false,'','Peak files contain waveform information for audio files (e.g. wav or mp3). They allow some applications to generate a graphical representation of the waveform of the audio content of associated audio files, and can enable such audio files to be accessed more quickly by reducing the time it takes to draw the waveform of the audio content.',NULL,NULL),
	 ('c1bcc64b-971a-46c0-bf44-8867b36183bd','2022-11-14 14:08:58.432119','2022-11-14 14:08:58.432119',NULL,'2b734dc8-5441-421f-8e7c-0106ac952670','http://fileformats.archiveteam.org/wiki/Pentax_PEF

https://www.online-convert.com/file-format/pef

https://www.pentaxforums.com/forums/131-visitors-center/355882-pef-raw.html

https://www.loc.gov/preservation/digital/formats/fdd/fdd000241.shtml',NULL,NULL,NULL,1,false,true,false,'','Pentax PEF Image File (or Pentax RAW) is a RAW image format based on TIFF [fmt/353] file format, provided by Pentax and associated with Pentax Digital SLR cameras. Its use has been deprecated since the release of DNG format. Similarly to RAW camera formats, PEF format contains information of image capture such as colour, lighting or camera sensor. The structure of these informations related to each image differs in each PEF format depending on which camera model was used to capture the image. The format first appeared with Pentax''s digital *its Series and continued until Pentax Q series.',NULL,NULL),
