https://adobe.fandom.com/wiki/Adobe_Persuasion',NULL,NULL,NULL,1,false,true,false,'','Persuasion Presentation Interchange File is part of Aldus Persuasion format family. The format was created in 1995 following the merger of Adulus Corporation with Adobe Systems, re-branding the software to Adobe Persuasion and creating versions for Microsoft Windows. Since the file formats for Macintosh and Windows differ, the intechange format was introduced to allow for transfer between these platforms. Aldus Persuasion is now discontinued presentation program software first developed by Peter Polash in 1988 for the Macintosh.',NULL,NULL),
