	 ('f119f957-2ab2-4bd2-bb5f-43dacd5174f9','2022-11-14 14:09:39.739701','2022-11-14 14:09:39.739701',NULL,'cfdbfd78-545a-40f4-a297-5052c62d0728','',NULL,NULL,NULL,1,false,true,false,'1.0','Portable Network Graphics (PNG) was designed for the lossless, portable, compressed storage of raster images.  PNG provides a patent-free replacement for GIF and can also replace many common uses of TIFF. Indexed-color, grayscale, and truecolor images are supported, plus an optional alpha channel. Sample depths range from 1 to 16 bits. PNG is designed to work in online viewing applications, so it is fully streamable.  It can store gamma and chromaticity.  PNG also detects file corruption.',NULL,NULL),
