	 ('44760eeb-d675-49f8-b557-25aac7b316e9','2022-11-14 14:11:17.125391','2022-11-14 14:11:17.125391',NULL,'fa8107ac-c183-4583-892b-61ce01280c06','The official R website: https://www.r-project.org/',NULL,NULL,NULL,1,false,true,false,'','Programme files for R, a programming language for statistical computing. The official R software is free, open source, and run on command line. Other companies have produced GUI software packages which are commercially available. R files contain code which can be executed within the R environment, including commands for creating objects such as functions and values.',NULL,NULL),
	 ('e659ec12-da32-4d86-a169-a146b27430f2','2022-11-14 14:11:20.165463','2022-11-14 14:11:20.165463',NULL,'41dbedfd-811d-4324-90a0-a65a9a5dedcb','',NULL,NULL,NULL,1,false,true,false,'','Radiance defined an image format for storing HDR images, now described as RGBE image format. RGBE stores pixels as one byte each for RGB (red, green, and blue) values with a one byte shared exponent. Thus it stores four bytes per pixel.',NULL,NULL),
