	 ('432958eb-a8c4-42d3-8c24-55c85c39b937','2022-11-14 14:11:25.962933','2022-11-14 14:11:25.962933',NULL,'afa43f83-447b-4653-872f-4e3ac376d7f2','https://gdal.org/drivers/raster/rmf.html',NULL,NULL,NULL,1,false,true,false,'','Raster Matrix Format (RMF) is a simple tiled raster format used in the Geographical Information System (GIS) Integration and Panorama GIS. There are two varieties of RMF called MTW and RSW and this record describes the RSW type. RSW can store 8-bit data and is a general purpose raster that supports single channel colormapped or three channel RGB images. Simple georeferencing can be provided with this image type.',NULL,NULL),
