	 ('eb82d769-45bb-4ec0-903b-536d64d2aebf','2022-11-14 14:11:28.840374','2022-11-14 14:11:28.840374',NULL,'02417fe5-c7de-4401-9105-778ad34fafcb','https://github.com/picosonic/bbc-fdc/blob/master/tools/rfi.h',NULL,NULL,NULL,1,false,true,false,'','The format is used to dump floppy disk images with the bbc-fdc controller. The bbc-fdc controller is a project which allows the direct connection of floppy disk drives with 34 pin ribbon cables to the Raspberry Pi for the purpose of reading floppy disks. The data stream within the file represents the magnetic flux of a disk drive reading a floppy.',NULL,NULL),
	 ('b672296e-1f9b-4c3a-9f0b-d1571620e292','2022-11-14 14:11:29.687819','2022-11-14 14:11:29.687819',NULL,'9df4bcbf-633e-4acb-bfa6-9d308aab5442','https://www.loc.gov/preservation/digital/formats/fdd/fdd000017.shtml#:~:text=The%20Library%20of%20Congress%20Recommended,specify%20a%20version%20of%20JPEG.

https://web.archive.org/web/20220624201809/https://www.adobe.com/creativecloud/file-types/image/raster/jpeg-file.html

https://web.archive.org/web/20221015163305/https://en.wikipedia.org/wiki/JPEG',NULL,NULL,NULL,1,false,true,false,'','Raw JPEG Stream represents JPEG bitstream sequence of digital objects. JPEG stands for Joint Photographic Experts Group, an international organization that standardized the concept of lossy compression during the late 1980s and early 1990s. It uses DCT (Discrete Cosine Transform) compression technique used for images and audio. The standard of lossy compression is able to remove some visual data invisible to human eye which averages out colour variation and reduces the file size. JPEG image consists of a sequence of segments, each beginning with a two-byte "marker", each of which begins with a 0xFF byte, followed by a byte indicating what kind of marker it is. The signature for this entry represents the first two bytes of every JPEG stream, which are the Start Of Image (SOI) marker with values of 0xFF and 0xD8 (indicating that the baseline is DCT-based) and the End of Image (EOI) marker with valued of 0xFF and 0xD9. The second signatures represents the "colour transform" field of the APP14 which is an "Adobe" segment, representing graphic files which may have been edited in Adobe applications such as Adobe Photoshop.',NULL,NULL),
	 ('fba90bb5-44bc-40ae-a011-cbc4377b72c1','2022-11-14 14:11:30.375564','2022-11-14 14:11:30.375564',NULL,'a75cf14b-8c35-4003-a94a-0cfcc0df990f','',NULL,NULL,NULL,1,false,true,false,'ASCII','The RData format is created by the R development environment for statistical computing. The format serialises the entire workspace and can include data frames and other objects that can later be loaded back in to the R environment. By default the RData format is compressed within a GZip container.',NULL,NULL),
