https://docs.red.com/955-0184_v7.3/RED_RANGER_MONSTRO_Operation_Guide_v7_3.pdf',NULL,NULL,NULL,1,false,true,false,'','RED Digital Cinema is an American company manufacturing professional digital cinematography cameras and accessories, established in 2005. RED Thumbnail files are created by some models of RED digital cameras while shooting in an R3D + Apple ProRes, R3D + DNxHD/HR and in Avid DNxHD/HR only modes. These files bear the same root filename as the R3D file clip they are associated with and contain a randomly selected frame image to represent the clip in software.',NULL,NULL),
	 ('5c405ed6-eaaa-4d9e-816b-a6e4b8aee387','2022-11-14 14:15:00.426496','2022-11-14 14:15:00.426496',NULL,'4b453562-fd16-4778-9492-90eb05176f64','',NULL,NULL,NULL,1,false,true,false,'9.3','SAS (Statistical Analysis System) is a statistical analysis software suite developed by SAS Institute. A SAS data file is a type of SAS data set that contains data values and descriptor information.',NULL,NULL),
	 ('ca48b452-23bd-4215-a0ff-b18e33188d69','2022-11-14 14:11:41.722151','2022-11-14 14:11:41.722151',NULL,'721372a2-4d52-4b49-bc5a-60c06881366d','',NULL,NULL,NULL,1,false,true,false,'','The Redcode Metadata File stores post-production edits of the raw media files. The original files remain untouched as the RMD file records, among other adjustments, changes to colour, white-balance, and dynamic range of the original image.',NULL,NULL),
	 ('36903076-37de-4269-b45e-f175935338e0','2022-11-14 14:11:42.340368','2022-11-14 14:11:42.340368',NULL,'36ae2b64-e2d7-4cbd-94d4-e60bf461dcbb','',NULL,NULL,NULL,1,false,true,false,'1','REDCODE RAW (R3D) is a proprietary multimedia audio/video file format owned by the Red Digital Cinema Camera Company and featuring lossy compression for video contents and lossless for audio contents. It is used as native recording format of Red digital cameras and recorded on proprietary Hard Disk Drives, CompactFlash cards or SSD drives, but can be extracted from there and be trivially handled in any file-based audio/video, IT or home environments.',NULL,NULL),
