https://docutils.sourceforge.io/rst.html',NULL,NULL,NULL,1,false,true,false,'','reStructuredText files are in effect plain text documents, formatted with a lightweight markup language, to produce more easily readable documents such as pdf. Rst files are used primarily by members of the Python programming community to create technical documentation for Python libraries. They are generated by running Docutils (https://docutils.sourceforge.io/), an open source text processing system which can turn plain text files, into useful formats, within Python.',NULL,NULL),
	 ('2ea5e062-26a0-4d01-a7d6-c882437b68f8','2022-11-14 14:11:44.193606','2022-11-14 14:11:44.193606',NULL,'b24c6956-586e-4974-a51a-787f1ab717c2','',NULL,NULL,NULL,1,false,true,false,'','The Document Content Architecture, (DCA for short) is a standard developed by IBM for text documents in the early 1980s. DCA was used on mainframe and iSeries systems, and formed the basis of DisplayWrite''s file format. DCA was later extended as MO:DCA (Mixed Object Document Content Architecture), which added embedded data files, like graphics.',NULL,NULL),
