	 ('b6bb53ba-ffc4-4c85-a5a3-8a5ddefda802','2022-11-14 14:11:48.317178','2022-11-14 14:11:48.317178',NULL,'f190390b-2d45-484f-9097-90677e899d08','',NULL,NULL,NULL,1,false,true,false,'','RF64 is a Broadcast Wave compatible multichannel file format enabling file sizes to exceed 4 GB. The file format is based on the Microsoft RIFF/WAVE format and Wave Format Extensible for multichannel parameters. Additions are made to the basic specification to allow for more than 4 GB file sizes when needed (the new maximum filesize is now approximately 16 exabytes).',NULL,NULL),
	 ('65db434e-ffb7-45db-8801-29d81306ce8e','2022-11-14 14:11:48.851881','2022-11-14 14:11:48.851881',NULL,'adce3e67-04c7-4516-809e-d97d3586a4d2','',NULL,NULL,NULL,1,false,true,false,'','RF64 is a Broadcast Wave compatible multichannel file format enabling file sizes to exceed 4 GB. The file format is based on the Microsoft RIFF/WAVE format and Wave Format Extensible for multichannel parameters. Additions are made to the basic specification to allow for more than 4 GB file sizes when needed (the new maximum filesize is now approximately 16 exabytes).

