http://fileformats.archiveteam.org/wiki/JWL',NULL,NULL,NULL,1,false,true,false,'6-7','Roxio Label Creator Project File is format used for storing project files produced by Roxio''s Label Creator software, a software used for creating designs intended for jewel cases and disc labels. There are several known versions of this format with earlier versions being stored as OLE2 container format, such as the one this record describes.',NULL,NULL),
	 ('f1c370e0-c270-44d4-97bf-3342d3eb03d8','2022-11-14 14:12:04.495622','2022-11-14 14:12:04.495622',NULL,'6fff1cc6-247c-4ae5-971a-b08bee0a1621','http://fileformats.archiveteam.org/wiki/ROX',NULL,NULL,NULL,1,false,true,false,'11','Roxio Audio Project File with extension ROX is a part of Roxio disc project formats. ROX files are formed Roxio Creator software (previously named as Roxio Easy Media Creator, Easy CD Creator and Roxio Easy CD Creator), originally published by Adaptec in 1996, this version replaces the ROXIO format (fmt/1668) was published around 2011. This format is a binary file just as its predecessors however, unlike other versions, the format is XML file with its structure distinguishing between Data and Audio files. Previously the ROXIO file contained all saved project, that stores information about audio, video or data disk compilation intended to be burned to disc. Roxio Creator software allows the user to create data or audio CD layout, it allows for files to be saved for later use with references to files that will be included on the disc as well as other settings, but this format did not include the files themselves, only the information regarding these files. All versions up to version 10 and Roxio Creator 2009-2010 of layout format on Roxio Easy Media Creator software, saved their ''layout'' files in ROXIO format, but this format only saves audio type files, see separate entry for data files (fmt/1669).',NULL,NULL),
	 ('0cbc0844-e8a7-4f01-a4e7-51472150ca05','2022-11-14 14:12:05.147767','2022-11-14 14:12:05.147767',NULL,'f933645a-0a55-4878-873b-b6d07e3af0a5','http://fileformats.archiveteam.org/wiki/ROX',NULL,NULL,NULL,1,false,true,false,'11','Roxio Data Project File with extension ROX is a part of Roxio disc project formats. ROXIO files are formed Roxio Creator software (previously named as Roxio Easy Media Creator, Easy CD Creator and Roxio Easy CD Creator), originally published by Adaptec in 1996, this version replaces the ROXIO format (fmt/1668) was published around 2011. This format is a binary file just as its predecessors however, unlike other versions, the format is XML type of file with its structure distinguishing between Data and Audio files. Previously the ROXIO file contained all saved project, that stores information about audio, video or data disk compilation intended to be burned to disc. Roxio Creator software allows the user to create data or audio CD layout, it allows for files to be saved for later use with references to files that will be included on the disc as well as other settings, but this format did not include the files themselves, only the information regarding these files. All versions up to version 10 and Roxio Creator 2009-2010 of layout format on Roxio Easy Media Creator software, saved their ''layout'' files in ROXIO format, but this format only saves data type files, see separate entry for audio (fmt/1670).',NULL,NULL),
	 ('653d1293-0f27-4010-a220-cd48d5ab169e','2022-11-14 14:12:05.81385','2022-11-14 14:12:05.81385',NULL,'fae75d5a-7055-4bd6-ae8c-b4ca9b9b20c6','http://fileformats.archiveteam.org/wiki/RCL',NULL,NULL,NULL,1,false,true,false,'8-10','Roxio Easy Media Creator Layout version 8 with extension RCL is a part of Roxio disc project formats. RCL files version 8 are formed using Creator Classic feature on Roxio Easy Media Creator software (previously named as Easy CD Creator and Roxio Easy CD Creator), originally published by Adaptec in 1996, this version follows the rebranding of the software to Roxio and was published around 2006. This format is a proprietary binary file and is similar to its predecessor version 7 with same extension RCL. It follows the header value 0xFFFE2300 followed later by the plain text "[RoxioINF80] [ProjectSettings] RCLVer=80" however, in contrast to its predecessor RLC version 7, which referres to ''layout'' files on Roxio Easy Media Creator, RLC version 8 files are formed using the Creator Classic feature on Easy Media Creator. All following versions up to version 10 and Roxio Creator 2009-2010 of layout format on Roxio Easy Media Creator software, saved their ''layout'' files in subsequent version with extension ROXIO, and their files created on Creator Classic feature as this format -  RLC version 8. Roxio Easy Media Creator software allowed the user to create data or audio CD layout by adding files or music in order to burn a disc. The layout only referenced the file location and not the files themselves. It allowed for files to be saved for later use with references to files that will be included on the disc as well as other settings.',NULL,NULL),
	 ('658f2d4f-1bb7-4e72-aab9-c9bdaaa3c33e','2022-11-14 14:12:06.39184','2022-11-14 14:12:06.39184',NULL,'5044b7d8-b4ba-4479-a916-58771bb33139','http://fileformats.archiveteam.org/wiki/RCL

https://archive.org/details/roxio-emc7-content/1-CDFront.jpg',NULL,NULL,NULL,1,false,true,false,'7','Roxio Easy Media Creator Layout version 7 with extension RCL is a part of Roxio disc project formats. RCL files are formed using Roxio Easy Media Creator software (previously named as Easy CD Creator and Roxio Easy CD Creator), originally published by Adaptec in 1996, this version follows the rebranding of the software to Roxio and was published around 2003. The format is different in hex structure to its predecessor version 6 (fmt/1665), with its hex sequence referencing the format version. Roxio Easy Media Creator software allowed the user to create data or audio CD layout by adding files or music in order to burn a disc. The layout only referenced the file location and not the files themselves. It allowed for files to be saved for later use with references to files that will be included on the disc as well as other settings.',NULL,NULL),
	 ('2ab932e8-2bc6-4fd5-86c9-5a12aaeee9da','2022-11-14 14:12:07.052542','2022-11-14 14:12:07.052542',NULL,'71729538-b074-4f68-9239-e053f2666ddd','http://fileformats.archiveteam.org/wiki/ROXIO

https://www.file-extensions.org/roxio-file-extension',NULL,NULL,NULL,1,false,true,false,'8-10','Roxio Easy Media Creator Layout version 8 with extension ROXIO is a part of Roxio disc project formats. ROXIO files are formed Roxio Easy Media Creator software (previously named as Easy CD Creator and Roxio Easy CD Creator), originally published by Adaptec in 1996, this version follows the rebranding of the software to Roxio and was published around 2006. This format is a proprietary binary file just as its predecessor version 7 with extension RCL. The ROXIO file contains saved project, that stores information about audio, video or data disk compilation intended to be burned to disc. Roxio Easy Media Creator software allowed the user to create data or audio CD layout, it allowed for files to be saved for later use with references to files that will be included on the disc as well as other settings, but this format did not include the files themselves, only the information regarding these files. All versions up to version 10 and Roxio Creator 2009-2010 of layout format on Roxio Easy Media Creator software, saved their ''layout'' files in ROXIO format. Corel then bought the Roxio products in 2012.',NULL,NULL),
