http://fileformats.archiveteam.org/wiki/JWL',NULL,NULL,NULL,1,false,true,false,'8-11','Roxio Label Creator Project File is format used for storing project files produced by Roxio''s Label Creator software, a software used for creating designs intended for jewel cases and disc labels. There are several known versions of this format with earlier versions being stored as OLE2 container format. This record describes the later versions of this format which has a binary signature.',NULL,NULL),
	 ('920dd6b2-df8f-4e65-ac45-e911efc496ff','2022-11-14 14:12:09.480234','2022-11-14 14:12:09.480234',NULL,'6389a251-5524-4f0b-afb3-2312b8b5963e','',NULL,NULL,NULL,1,false,true,false,'1','RPM Package Manager file (RPM) was previously known as a Red Hat Package Manager File. It is a file used by RPM Package Manager which is a package management system. RPM files currently appear in two defined types, the first is binary package files containing the compiled version of certain software. The second is source package files containing the source code used to produce a package. These have an appropriate tag in the file header that distinguishes them from Binary RPMs, causing them to be extracted to /usr/src on installation. Source package files customarily carry the file extension .src.rpm".',NULL,NULL),
