	 ('c44cd3e6-676e-498d-8ca2-645aac5eb526','2022-11-14 14:12:19.944517','2022-11-14 14:12:19.944517',NULL,'388a702f-000e-49ba-9bce-808ae145e4bf','',NULL,NULL,NULL,1,false,true,false,'1.0','SVG is a language for describing two-dimensional graphics in XML. SVG allows for three types of graphic objects: vector graphic shapes (e.g., paths consisting of straight lines and curves), images and text. Graphical objects can be grouped, styled, transformed and composited into previously rendered objects. The feature set includes nested transformations, clipping paths, alpha masks, filter effects and template objects. SVG drawings can be interactive and dynamic. Animations can be defined and triggered either declaratively (i.e., by embedding SVG animation elements in SVG content) or via scripting.',NULL,NULL),
	 ('8394ae07-e374-4e0b-bffe-2d408785c1ee','2022-11-14 14:12:20.628419','2022-11-14 14:12:20.628419',NULL,'001d2342-0852-4ff6-b8bf-ed9d445d1b5a','',NULL,NULL,NULL,1,false,true,false,'1.1','SVG is a language for describing two-dimensional graphics in XML. SVG allows for three types of graphic objects: vector graphic shapes (e.g., paths consisting of straight lines and curves), images and text. Graphical objects can be grouped, styled, transformed and composited into previously rendered objects. The feature set includes nested transformations, clipping paths, alpha masks, filter effects and template objects. SVG drawings can be interactive and dynamic. Animations can be defined and triggered either declaratively (i.e., by embedding SVG animation elements in SVG content) or via scripting.',NULL,NULL),
