	 ('0e74ec0b-ee0e-4db3-b743-c0ea7063de1d','2022-11-14 14:12:21.978019','2022-11-14 14:12:21.978019',NULL,'296d312e-7ff6-4666-a81b-e1444d0d5215','',NULL,NULL,NULL,1,false,true,false,'1.2','SVG is a language for describing two-dimensional graphics in XML. SVG allows for three types of graphic objects: vector graphic shapes (e.g., paths consisting of straight lines and curves), multimedia (such as raster images, video, and audio), and text. Graphical objects can be grouped, styled, transformed and composited into previously rendered objects.  Scalable Vector Graphics Tiny (SVGT), Version 1.2, is a language for describing two-dimensional vector graphics in XML, combined with raster graphics and multimedia. Its goal is to provide the ability to create a whole range of graphical content, from static images to animations to interactive Web applications. SVG 1.2 Tiny is a profile of SVG intended for implementation on mobile devices, such as cellular phones and PDAs; it also works on laptop and desktop computers.',NULL,NULL),
