https://www.w3.org/TR/REC-html40/sgml/intro.html',NULL,NULL,NULL,1,false,true,false,'','SGML/XML entity files are plain text files, often found alongside, and referenced by, xml and sgml files. Ent files list the parameters and entity declarations for a specific set of tags defined in a Document Type Definition.',NULL,NULL),
	 ('90b0ccc6-d987-40f0-82fb-328a9b0a9de0','2022-11-14 14:13:00.498958','2022-11-14 14:13:00.498958',NULL,'65360a05-5efe-44ca-923e-d339b19ca795','',NULL,NULL,NULL,1,false,true,false,'','SHA-1 (Secure Hash Algorithm 1) is a cryptographic hash function designed by the United States National Security Agency and is a U.S. Federal Information Processing Standard published by the United States NIST. SHA-1 produces a 160-bit (20-byte) hash value. It can be used as a checksum to verify data integrity. The SHA1 file is a text document which contains single or multiple SHA1 values.',NULL,NULL),
	 ('815b70a5-ce6a-4cc5-9908-419e50b6ef87','2022-11-14 14:13:01.023229','2022-11-14 14:13:01.023229',NULL,'f08b839e-6867-439b-bccf-57f23dfec9c4','',NULL,NULL,NULL,1,false,true,false,'','SHA256 is part of the family of SHA-2 (Secure Hash Algorithm 2) hash functions which are designed by the United States National Security Agency. SHA256 prodcues a 256-but (32-byte) hash value. It can be used as a checksum to verify data integrity. The SHA256 file is a text document which contains single or multiple SHA1 values.',NULL,NULL),
	 ('7fd2c84f-b8e0-4659-8186-d63523c84121','2022-11-14 14:13:01.55003','2022-11-14 14:13:01.55003',NULL,'c1c8338e-7ec1-4714-96e7-83d47e41aed0','',NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select Add an Entry.',NULL,NULL),
	 ('100110ac-6787-47a0-9bd8-f0c313c34e40','2022-11-14 14:13:02.088427','2022-11-14 14:13:02.088427',NULL,'12236884-7d48-4e40-8446-1a8282d5812a','',NULL,NULL,NULL,1,false,true,false,'1.0','Software-Independent Archiving of Relational Databases is a format for storing content of relational databases in files for long-term preservation e.g. in archives. The format was developed by the Swiss Federal Archives. It is an open standard and is supported by the SIARD software of the Swiss Federal Archives. SIARD format is a ZIP file (based on the 64 bit extension of the  ZIP format introduced by PkWare Inc. with version 4.5 of the ZIP format definition in order to avoid size limitations which are unrealistic for databases). The ZIP file contains an XML file describing the database structure (database metadata) as well as a collection of XML files describing the table content (database primary data) as well as - optionally - some text files and some binary files representing database large objects (BLOBs and CLOBs). SIARD format is used for archiving databases adhering to the SQL (ideally SQL:1999 core) standard.',NULL,NULL),
	 ('5cfefc7f-8456-409c-bb5f-201dd5c46d3b','2022-11-14 14:13:02.579042','2022-11-14 14:13:02.579042',NULL,'cfb2c547-bd02-4b29-a15e-8ad296ea30cd','',NULL,NULL,NULL,1,false,true,false,'2.0','Software-Independent Archiving of Relational Databases is a format for storing content of relational databases in files for long-term preservation e.g. in archives. The format was developed by the Swiss Federal Archives. It is an open standard and is supported by the SIARD software of the Swiss Federal Archives. SIARD format is a ZIP file (based on the 64 bit extension of the  ZIP format introduced by PkWare Inc. with version 4.5 of the ZIP format definition in order to avoid size limitations which are unrealistic for databases). The ZIP file contains an XML file describing the database structure and metadata as well as a collection of XML files describing the table content (database primary data) as well as, optionally, some text files and some binary files representing database large objects (BLOBs and CLOBs).',NULL,NULL),
	 ('c7e4e9ec-4cb8-4c00-b275-df26c2c57e3b','2022-11-14 14:13:03.664662','2022-11-14 14:13:03.664662',NULL,'3a526066-65ff-4f2a-add0-b0ac6feb0b4f','',NULL,NULL,NULL,1,false,true,false,'2.1','Software-Independent Archiving of Relational Databases is a format for storing content of relational databases in files for long-term preservation e.g. in archives. The format was developed by the Swiss Federal Archives. It is an open standard and is supported by the SIARD software of the Swiss Federal Archives. SIARD format is a ZIP file (based on the 64 bit extension of the  ZIP format introduced by PkWare Inc. with version 4.5 of the ZIP format definition in order to avoid size limitations which are unrealistic for databases). The ZIP file contains an XML file describing the database structure and metadata as well as a collection of XML files describing the table content (database primary data) as well as, optionally, some text files and some binary files representing database large objects (BLOBs and CLOBs).',NULL,NULL),
	 ('7391a65e-8da9-4c5a-aead-37b9dd5550f4','2022-11-14 14:13:05.385325','2022-11-14 14:13:05.385325',NULL,'20da8b07-b27f-4157-ad72-e29bd0f5d913','Specification: https://siard.dilcis.eu/SIARD%202.2/SIARD%202.2.pdf',NULL,NULL,NULL,1,false,true,false,'2.2','Software-Independent Archiving of Relational Databases is a format for storing content of relational databases in files for long-term preservation e.g. in archives. The format was developed by the Swiss Federal Archives. It is an open standard and is supported by the SIARD software of the Swiss Federal Archives. SIARD format is a ZIP file (based on the 64 bit extension of the ZIP format introduced by PkWare Inc. with version 4.5 of the ZIP format definition in order to avoid size limitations which are unrealistic for databases). The ZIP file contains an XML file describing the database structure and metadata as well as a collection of XML files describing the table content (database primary data) as well as, optionally, some text files and some binary files representing database large objects (BLOBs and CLOBs).',NULL,NULL),
	 ('ed46aca0-876e-4540-b244-37dd711889ff','2022-11-14 14:13:06.306621','2022-11-14 14:13:06.306621',NULL,'e0659ad9-ab5c-4909-8324-8abae29245cc','',NULL,NULL,NULL,1,false,true,false,'','Sibelius is a WYSIWYG scorewriter program, created by Sibelius Software (now part of Avid Technology) for Microsoft Windows, Mac OS X, and historically RISC OS. It is used by composers, arrangers, performers, music publishers, teachers and students, particularly for writing classical, jazz, band, vocal, film and television music.',NULL,NULL),
	 ('d4d1c0df-253d-416a-b38f-56a3a3a0cb1e','2022-11-14 14:13:07.157597','2022-11-14 14:13:07.157597',NULL,'7de5da17-1288-4344-bab8-4b6044f7cfac','',NULL,NULL,NULL,1,false,true,false,'','A text-based file used by Sibelius music composition software to list the file system locations of sound files in use within a composition.',NULL,NULL),
