https://us.community.sony.com/s/question/0D50B00004YTYOGSA5/slv-extension',NULL,NULL,NULL,1,false,true,false,'','A Sony SLV file is automatically generated by some models of Sony cameras when an error occurs during filming, such as a power cut or a media issue or when the camera fails to close properly during an improper shutdown. Although no official documentation has been found, various forum posts claim that SLV stands for salvage and that these files are created to assist the camera in salvaging lost data, by creating an XML file and then auto-deleting after this process is complete.',NULL,NULL),
	 ('1c841c92-7562-42c2-aa8f-643841943ec5','2022-11-14 14:15:12.97562','2022-11-14 14:15:12.97562',NULL,'52117566-1bf0-45c0-a779-34c3ef9e6386','',NULL,NULL,NULL,1,false,true,false,'','Student Writing Center is an educational word processor developed by The Learning Company.',NULL,NULL),
	 ('aa0f9b8d-1775-447d-a2d2-21d385eee8d3','2022-11-14 14:13:50.407825','2022-11-14 14:13:50.407825',NULL,'abf64917-2d91-45c7-9581-f4fed8a2076c','https://www.sounddevices.com/sounddev-folder-in-7-series-storage-volumes/',NULL,NULL,NULL,1,false,true,false,'','Sony SML files store housekeeping information used by 7-series cameras, including user-defined settings and lists. They are found in the SOUNDDEV folder in storage volumes formatted by 7-series recorders. More specifically, these files contain the following information:

PROJECTFOLDERS.SML - contains any entry and setting that has been made under the Top-Level Folder selection of the File: Folder Options Setup Menu option.

ROLLFOLDERS.SML - contains any entry and setting that has been made under the Mid-Level Folder selection of the File: Folder Options Setup Menu option.

SCENEFOLDERS.SML - contains any entry and setting that has been made under the Bottom-Level Folder selection of the File: Folder Options Setup Menu option.

SCENENAMES.SML - contains any entry and setting that has been made under the Setup Menu option Rec: Scene Name/Number.

TRKANAME.SML - contains any entry and setting that has been made under the Track A selection of the Rec: Track Names Setup Menu option.

TRKBNAME.SML - contains any entry and setting that has been made under the Track B selection of the Rec: Track Names Setup Menu option.',NULL,NULL),
