	 ('c1236e51-1d64-42e6-b16f-da88f3318251','2022-11-14 14:13:58.100784','2022-11-14 14:13:58.100784',NULL,'47d06db0-e39d-45fb-b448-ee36e46e5c72','https://doudoroff.com/atari/spectrum.html

