http://fileformats.archiveteam.org/wiki/Spectrum_512_formats',NULL,NULL,NULL,1,false,true,false,'','Spectrum 512 was a computer paint program by Boris Tsikanovsky that enabled the creation of images with more than 16 simultaneous colors. It uses the Atari ST''s rapid palette switching ability to expand the maximum number of colors to be displayed on-screen at once to 512 (up to 46 in each scan line). Spectrum 512 is a predecessor of Unispec.

This specific file format record details Spectrum 512 compressed formats. There are two varieties of compression in Spectrum 512 formats, first is Spectrum 512 Compressed and second Spectrum 512 Smooshed. Both of these formats have an identical file format signiture (magic bytes) and the only way to distinguish between these formats is by their extension. The Spectrum 512 Compressed format uses .spc and the Spectrum 512 Smooshed format uses .sps extension. Compression is via a modified run length encoding (RLE) scheme in both of these formats however, the files differ in in a compression methods depending on format type.',NULL,NULL),
	 ('5c3c48ac-e0b6-4dce-b06c-eb77ccb647d6','2022-11-14 14:14:07.98659','2022-11-14 14:14:07.98659',NULL,'daabbb52-daad-40dd-9faf-cd4db5a20dce','https://ist.uwaterloo.ca/~schepers/formats/SPYNE.TXT

https://cbm8bit.com/articles/user-contributions/archival_formats',NULL,NULL,NULL,1,false,true,false,'','SPYne containers were created by John Lannetta c1995 and are found in Compuserve''s CBM applications forum and in COMP.BINARIES.CBM newsgroup. The format is self-extracting and does not employ any compression. The word "SPYNE" does not represent any acronym, but is meant to represent a "spine", with files linked together like a human spine.',NULL,NULL),
