http://fileformats.archiveteam.org/wiki/Spectrum_512_formats',NULL,NULL,NULL,1,false,true,false,'1','Spectrum 512 was a computer paint program by Boris Tsikanovsky that enabled the creation of images with more than 16 simultaneous colors. It uses the Atari ST''s rapid palette switching ability to expand the maximum number of colors to be displayed on-screen at once to 512 (up to 46 in each scan line). Spectrum 512 is a predecessor of Unispec.

Spectrum 512 Extended (spx) files are extended Spectrum files with more than 200 lines in the picture, designed by Gizmo of Electronic Images. With a SPX creator like SPXCRT14.PRG multiple spectrum pictures can be attached to become one big .SPX file. There are two known versions of the format. This record details Version 1, both versions support larger pictures in Spectrum 512.',NULL,NULL),
