It uses the Atari ST''s rapid palette switching ability to expand the maximum number of colors to be displayed on-screen at once to 512 (up to 46 in each scan line). Spectrum 512 is a predecessor of Unispec.

Spectrum 512 Extended (spx) files are extended Spectrum files with more than 200 lines in the picture, designed by Gizmo of Electronic Images. With a SPX creator like SPXCRT14.PRG multiple spectrum pictures can be attached to become one big .SPX file. There are two known versions of the format. This record details Version 2, files of this format (as compared to Version 1) can be packed as a whole, including the header, with either Ice 2.10 or Atomik 3.5. Both versions support larger pictures in Spectrum 512.',NULL,NULL),
