http://fileformats.archiveteam.org/wiki/Spectrum_512_formats',NULL,NULL,NULL,1,false,true,false,'','Spectrum 512 was a computer paint program by Boris Tsikanovsky that enabled the creation of images with more than 16 simultaneous colors. It uses the Atari ST''s rapid palette switching ability to expand the maximum number of colors to be displayed on-screen at once to 512 (up to 46 in each scan line). Spectrum 512 is a predecessor of Unispec.

This specific file format record details Spectrum 512 uncompressed formats. There are two varieties of uncompression in Spectrum 512 formats, first is Spectrum 512 Uncompressed and second Spectrum 512 Uncompressed Enhanced. Both of these formats have an unidentifiable file format signiture (magic bytes) and have the same extension. In the uncompressed files, the first 160 bytes are usually set to zero (except in the "Enhanced" variant). Following that are 31840 bytes of image data (160 for each row). Following that are 19104 bytes of palette data. The total file size is 51104 bytes. The Spectrum 512 Uncompressed Enhanced format extends the palette further, to 5 bits per color channel.',NULL,NULL),
