https://dustlayer.com/c64-coding-tutorials/2013/5/24/episode-3-2-creating-the-shapes-hello-spritepad',NULL,NULL,NULL,1,false,true,false,'','SpritePad is a free cross-development tool for designing sprite images and animations for the Commodore 64 computer. It allows the user to freehand painting or import and convert any existing bitmap image into a C64 compatible sprite or tile set using various tile sizes from 1 x 1 up to 8x8 sprites (64 different sizes). SpritePad has began development in 2003.',NULL,NULL),
	 ('aba0865c-9b17-475a-b2c6-61dfb421bb14','2022-11-14 14:14:05.927788','2022-11-14 14:14:05.927788',NULL,'fde46763-840f-408f-b4ee-c676d32c3747','',NULL,NULL,NULL,1,false,true,false,'','SPSS (Statistical Package for the Social Sciences) is a software package used for statistical analysis in the social sciences. The first version of SPSS was developed by SPSS Inc. in 1968. In 2009 SPSS Inc. was acquired by IBM.',NULL,NULL),
	 ('c2618439-6ff7-4422-9402-84af0ca11ddb','2022-11-14 14:14:06.866574','2022-11-14 14:14:06.866574',NULL,'4f25d797-268c-4a15-a9e0-3324c8241212','',NULL,NULL,NULL,1,false,true,false,'','SPSS (Statistical Package for the Social Sciences) is a software package used for statistical analysis in the social sciences. The first version of SPSS was developed by SPSS Inc. in 1968 and has since had eighteen stable version releases.  In 2009 SPSS Inc. was acquired by IBM.  As of version 17.0.1 SPSS software has been known as Predictive Analytics Software. SPSS is used widely by both academics and other social researchers.
SPSS creates an SPSS Output File which represents data in a two dimensional format where the rows are used to represent case values such as a place or personal name and the columns are used to represent measurements such as age or GDP. SPSS Output File is a proprietary file format. From SPSS version 16 and onwards the SPSS Output File has an .spv suffix. There is no backward compatibility for files generated by previous versions of SPSS.',NULL,NULL),
	 ('a66271f6-cd77-48e4-9e08-c31565753a17','2022-11-14 14:14:07.421298','2022-11-14 14:14:07.421298',NULL,'6061f5d4-48af-4624-aaf2-43e1c1ed3a7a','',NULL,NULL,NULL,1,false,true,false,'','SPSS (Statistical Package for the Social Sciences) is a software package used for statistical analysis in the social sciences. The portable data format is designed for data transfer between differing operating systems and versions of SPSS.',NULL,NULL),
