https://telparia.com/fileFormatSamples/image/stadPAC/',NULL,NULL,NULL,1,false,true,false,'','STAD PAC is a raster graphics format developed by Peter Melzer and associated with the STAD (ST Aided Design) graphics application for Atari ST computers. File headers begin with either of two four character sequences (pM85 and pM86) dependent on whether the image data in the file is horizontally or vertically packed.',NULL,NULL),
	 ('a2d995f5-4ce8-422f-8294-0bcf49f320b3','2022-11-14 14:14:10.352977','2022-11-14 14:14:10.352977',NULL,'706a837a-bf53-4e9c-be8d-f43542079ae9','',NULL,NULL,NULL,1,false,true,false,'','Standard Data Format (SDF) files are commonly used to transfer data between different programs. SDF files are formatted ASCII text files, in which fields are delimited with a particular character (usually a space), and each record ends with a carriage return and/or line feed.',NULL,NULL),
	 ('e4eaa33c-6c42-4449-ac5c-0aa8de235793','2022-11-14 14:14:10.966906','2022-11-14 14:14:10.966906',NULL,'6f0736fa-e42c-49c9-974e-59ca05d1fb32','',NULL,NULL,NULL,1,false,true,false,'','Standard flowgram format (SFF) is a binary file format used to encode results of pyrosequencing from the 454 Life Sciences platform for high-throughput sequencing.',NULL,NULL),
