	 ('21fefefc-afb1-4a2c-951f-8a51834e09fa','2022-11-14 14:14:12.784756','2022-11-14 14:14:12.784756',NULL,'5160a949-56f2-44de-8802-4e8aa83bf086','https://arxiv.org/pdf/1410.7513.pdf

