	 ('737103f3-c61b-4465-8934-876a2ebb0595','2022-11-14 14:15:07.367909','2022-11-14 14:15:07.367909',NULL,'5e984845-573e-4eb5-9816-6143bc9897d5','',NULL,NULL,NULL,1,false,true,false,'','STL is a 3D modelling file format created by 3D Systems. An STL file is a triangular representation of a 3-dimensional surface geometry. The surface is tessellated or broken down logically into a series of small triangles (facets). Each facet is described by a perpendicular direction and three points representing the vertices (corners) of the triangle. These data are used by a slicing algorithm to determine the cross sections of the 3-dimensional shape to be built by the fabricator.',NULL,NULL),
	 ('ea73ae90-1bac-41e3-aba4-f7285db6595f','2022-11-14 14:15:07.989735','2022-11-14 14:15:07.989735',NULL,'b1f2527e-4e3e-4341-8de4-263599cb1f26','',NULL,NULL,NULL,1,false,true,false,'','STL is a 3D modelling file format created by 3D Systems. An STL file is a triangular representation of a 3-dimensional surface geometry. The surface is tessellated or broken down logically into a series of small triangles (facets). Each facet is described by a perpendicular direction and three points representing the vertices (corners) of the triangle. These data are used by a slicing algorithm to determine the cross sections of the 3-dimensional shape to be built by the fabricator.

The structure of STL Binary, though well defined, makes it impossible to create an identification signature under the current PRONOM signature model.

The format consists of an 80 byte ASCII header with no formalized structure, followed by a four byte integer value representing the number of facets within the file, followed by 48 bytes of floating point values representing the ''normal'' and ''vertex'' coordinates within 3 dimensional space for each triangle, followed by a two byte, typically (but not exclusively) unused ''attribute byte count''.

A technical specification may be found here: http://www.fabbers.com/tech/STL_Format',NULL,NULL),
	 ('ed2f34b4-b8b4-44bb-90ea-4ffd0be1311a','2022-11-14 14:15:08.641004','2022-11-14 14:15:08.641004',NULL,'e1ba9aa1-f18d-4add-8d15-b0c9f9187154','',NULL,NULL,NULL,1,false,true,false,'','STOS Memory Bank files are associated with the STOS: The Game Creator, a toolkit for creating games on an Atari ST computer in the STOS BASIC programming language. Files store various data such as graphics and music.',NULL,NULL),
	 ('c547a444-0c60-4ba4-a472-1e7a7a646c64','2022-11-14 14:15:09.258417','2022-11-14 14:15:09.258417',NULL,'9ecc0224-8417-462c-9349-7557c462d111','',NULL,NULL,NULL,1,false,true,false,'','Strata StudioPro was a 3D modeling application developed by Strata3D for the Macintosh operating system. The vis format contains models and textures of a 3D scene. Formats of this type may lack an extension.',NULL,NULL),
