https://www.theguardian.com/games/2021/sep/17/clive-sinclair-zx-spectrum-offbeat-brilliance',NULL,NULL,NULL,1,false,true,false,'','SXG is a graphics format for the ZX Spectrum. SXG stands for "Speccy eXtended Graphic". Speccy is another name Spectrum is commonly known by its fan following. The ZX Spectrum is an 8-bit personal home computer developed by Sinclair Research, pioneered by Clive Sinclair. It was first released in the United Kingdom on 23 April 1982 and went on to become Britain''s best-selling microcomputer. Games comprised the majority of commercial ZX Spectrum software. The SXG format was mostly used for graphics in early computer games on ZX Spectrum microcomputers.',NULL,NULL),
	 ('5de4c1ea-559b-429e-bbdb-182b67523f2e','2022-11-14 14:15:29.343069','2022-11-14 14:15:29.343069',NULL,'03e73645-f15e-49fe-8ba6-c588b01c12f4','https://en.wikipedia.org/wiki/Synchronized_Multimedia_Integration_Language

https://www.w3.org/TR/SMIL3/

http://www.telestream.net/pdfs/app-notes/app_Camera_Ingest.pdf',NULL,NULL,NULL,1,false,true,false,'','Synchronized Multimedia Integration Language is a World Wide Web Consortium recommended Extensible Markup Language (XML) markup language to describe multimedia presentations. It defines markup for timing, layout, animations, visual transitions, media embedding and others. SMIL allows presenting media items such as text, images, video, audio, links to other SMIL presentations, and files from multiple web servers. SMIL markup is written in XML, and has similarities to HTML. This is the generic entry for this file format which most commonly is denoted with the .smil extension. It is likely that the truncated .smi extension refers specifically to the metadata files accompanying the corresponding images taken by Sony digital cameras.',NULL,NULL),
