	 ('f74a9565-b6d5-41c5-820e-54739c7f70d4','2022-11-14 14:15:31.318759','2022-11-14 14:15:31.318759',NULL,'f121211b-2691-46a0-9e8d-dd0a982ba673','',NULL,NULL,NULL,1,false,true,false,'','A tab-separated values file is a simple text format for storing data in a tabular structure (e.g. database or spreadsheet data). Each record in the table is one line of the text file. Each field value of a record is separated from the next by a tab stop character  it is a form of the more general delimiter-separated values format.',NULL,NULL),
	 ('e072874b-269d-48cf-a06d-2c608bf5c429','2022-11-14 14:15:32.122437','2022-11-14 14:15:32.122437',NULL,'934f36fd-7c7e-4402-a279-4964606fd27f','PUID created for the TIFF format in response to the difficulties we have been having with multiple identification of the format and a consensus on a new interpretation of the standard from within The National Archives and outside with external stakeholders.

Documentation:

https://www.itu.int/itudoc/itu-t/com16/tiff-fx/docs/tiff6.pdf

http://www.alternatiff.com/resources/TIFFPM6.pdf

http://www.alternatiff.com/resources/TIFFphotoshop.pd',NULL,NULL,NULL,1,false,true,false,'','The Tagged Image File Format (TIFF) is a raster image format originally developed by the Aldus Corporation, primarily for use in scanning and desktop publishing. When Adobe Systems Incorporated purchased Aldus in 1994, they acquired the rights to the TIFF format and have maintained it since then. TIFF files comprise three sections: an Image File Header (IFH), an Image File Directory (IFD), and the image data. TIFF files can contain multiple images (multi-page TIFF), and each image has a separate IFD. The IFH always appears at the beginning of the file, and is immediately followed by a pointer to the first IFD. The IFD contains metadata which describes the associated image, stored as a series of tags. The IFD also contains a pointer to the actual image data. TIFF supports colour depths from 1 bit to 24 bit (e.g. monochrome to true colour), and a wide range of compression types (RLE, LZW, CCITT Group 3 and Group 4, and JPEG), as well as uncompressed data.','1986-08-01 00:00:00',NULL),
