	 ('45a8d3ad-b2d3-45e0-b188-ecb82fa68260','2022-11-14 14:15:44.071025','2022-11-14 14:15:44.071025',NULL,'aedcd424-043b-47f4-83a1-c0138ca8016f','',NULL,NULL,NULL,1,false,true,false,'','The Device Independent File Format (DVI) is the output file format of the TeX typesetting program. DVI files comprise binary data describing the visual layout of a document in a device-independent manner. A DVI file consists of a preamble, a sequence of commands defining one or more pages of text, and a postamble. Each command comprises an eight-bit opcode, followed by zero or more bytes of parameters. DVI driver software is required to render or print DVI files, or to convert them to other formats, such as PostScript or PDF.','1979-01-01 00:00:00',NULL),
