	 ('ff5e2628-dae9-47bf-be42-1d5fbe4ec351','2022-11-14 14:15:51.255065','2022-11-14 14:15:51.255065',NULL,'efde92bb-f86d-4191-99ab-4baeafdbb8fe','https://minerals.nt.gov.au/__data/assets/pdf_file/0003/259293/HyLogger-3-How-it-Works.pdf',NULL,NULL,NULL,1,false,true,false,'7','File generated by The Spectral Geologist (TSG), processing software designed for the analysis of field or laboratory spectrometer data. TSG stores the spectral and associated data (geochemistry, coordinate data etc) in two files, regardless of the number of spectra in the dataset. These files have the extensions .bip and .tsg. The .bip file stores all of the spectral and associated data; it is usually far larger than the .TSG file. The .tsg file stores a description of the data contained in the associated .BIP file. Both files are essential for TSG to be able to access the dataset and must be together in the same directory.',NULL,NULL),
	 ('de8a44ce-48ef-4da3-8d82-6a98619379e9','2022-11-14 14:15:52.953912','2022-11-14 14:15:52.953912',NULL,'4f9bd294-c08a-4c73-a54a-e193b43bbbe1','https://minerals.nt.gov.au/__data/assets/pdf_file/0003/259293/HyLogger-3-How-it-Works.pdf',NULL,NULL,NULL,1,false,true,false,'7.15','File generated by The Spectral Geologist (TSG), processing software designed for the analysis of field or laboratory spectrometer data. TSG stores the spectral and associated data (geochemistry, coordinate data etc) in two files, regardless of the number of spectra in the dataset. These files have the extensions .bip and .tsg. The .bip file stores all of the spectral and associated data; it is usually far larger than the .TSG file. The .tsg file stores a description of the data contained in the associated .BIP file. Both files are essential for TSG to be able to access the dataset and must be together in the same directory.',NULL,NULL),
	 ('2f545777-aa85-4775-bfc6-a739fc5e3e5c','2022-11-14 14:15:53.743043','2022-11-14 14:15:53.743043',NULL,'6cf6252c-be6a-407d-90ca-cdf0fe425081','http://fileformats.archiveteam.org/wiki/TheDraw_Save_File

https://en.wikipedia.org/wiki/TheDraw',NULL,NULL,NULL,1,false,true,false,'','TheDraw Save File (also known as TheDraw format, TheDraw Data File, or TheDraw Setup Save) is a layered character graphics format native to TheDraw, a character graphics editor for MS-DOS.

TheDraw is a text editor for MS-DOS to create ANSI and animations as well as ASCII art. The editor creates or modifies files in ANSI format and text documents, which use the graphical characters of the IBM ASCII code pages, as they are no longer supported by Microsoft Windows. The first version of the editor was developed in 1986 by Ian E. Davis of TheSoft Programming Services. The last public version of the editor was version 4.63, which was released in October 1993.',NULL,NULL),
	 ('853c5c11-8f05-4bcd-88b2-140b654e23aa','2022-11-14 14:15:55.080328','2022-11-14 14:15:55.080328',NULL,'677c2b9d-fa66-491b-b022-f7f0f40a908c','',NULL,NULL,NULL,1,false,true,false,'XP','A thumbs.db file is generated automatically within Microsoft Windows environments (although the automatic creation behaviour can be turned off). It is generally a hidden system file and its purpose is to hold thumbnail images of any images stored within a given folder. This format is based on the OLE2 Compound Document Format and can be identified in DROID 6 and later via a container signature. Structurally it holds a Catalog file that indexes the thumbnails, and a file per image that contains the image data in a JPEG format with additional data preceeding the image data. At this time the signature is the result of reverse engineering work conducted by Ross Spencer, Richard Lehane and others. The Catalog file consists of a 4 byte opening sequence that appears to act as an identifier and database version number, followed by two bytes indicating the number of images within the thumbs.db file, followed by information relating to the resolution of the images. This signature is likely to be improved with further research and a better understanding of the format structure. This particular format is known to be produced in Windows XP environments, but may also apply to other Windows operating systems. Later thumbs.db files hold a different structure which cannot yet be suitably represented within a DROID container signature.',NULL,NULL),
	 ('d13725ca-cc98-4ac5-9835-f890c47f88d7','2022-11-14 14:15:57.026197','2022-11-14 14:15:57.026197',NULL,'f5bccd22-f55f-4049-82c5-a914e43677f6','https://www.iana.org/assignments/media-types/application/vnd.etsi.timestamp-token
Specification: https://www.etsi.org/deliver/etsi_ts/102900_102999/102918/01.03.01_60/ts_102918v010301p.pdf',NULL,NULL,NULL,1,false,true,false,'','Time Stamp Tokens contain a hash of data which is being time stamped, electronically signed by a Timestamping Authority. For example, tst files might be generated to prove a digital signature was created before a given time. The hash refers to data objects carried in ASiC containers.',NULL,NULL),
