	 ('97ec215d-617d-48c0-8a52-5ef0164953ee','2022-11-14 14:16:00.593208','2022-11-14 14:16:00.593208',NULL,'418871a3-8095-428b-907d-b0c98e1f272e','',NULL,NULL,NULL,1,false,true,false,'','TransXChange is a UK national data standard for the exchange of bus route and timetable information. The standard is sponsored by the UK Department for Transport and is mandated by the Vehicle Operating Services Agency (VOSA) for the electronic registration of UK bus services with Traffic Area Offices (TAO) and Local Authorities. It is a subset of XML.',NULL,NULL),
