	 ('5f8a21c2-4690-45d0-84eb-7f37e9c1f447','2022-11-14 14:16:24.450289','2022-11-14 14:16:24.450289',NULL,'729a7179-a3de-465f-8c71-85972d50e1c3','',NULL,NULL,NULL,1,false,true,false,'','The VAMAS Surface Chemical Analysis Standard Data Transfer Format is designed to facilitate interchange of chemical analysis data. The format is standaradised within ISO14976. Please contact the PRONOM team if you are able to provide a more detailed description.',NULL,NULL),
	 ('dcdd7cf9-9650-4aff-93b8-0ee4bba9af88','2022-11-14 14:16:25.084336','2022-11-14 14:16:25.084336',NULL,'e5a72938-180b-4508-9cbc-971e19152afd','',NULL,NULL,NULL,1,false,true,false,'1.x','The Variant Call Format (VCF) specifies the format of a text file used in bioinformatics for storing gene sequence variations.',NULL,NULL),
	 ('167770a1-ccb8-4ddc-96b4-d4d0f312b93d','2022-11-14 14:16:08.057066','2022-11-14 14:16:08.057066',NULL,'1fa12fcc-12ff-43fd-80e7-474567459139','',NULL,NULL,NULL,1,false,true,false,'','Created by Apple, TrueType Font files are a sequence of concatenated tables (a table is a sequence of words; each table must be long aligned and padded with zeroes if necessary). The first of the tables is the font directory, a special table that facilitates access to the other tables in the font. The directory is followed by a sequence of tables containing the font data. These tables can appear in any order. Certain tables are required for all fonts. Others are optional depending upon the functionality expected of a particular font. The tables have names known as tags. Tags have the type uint32. Currently defined tag names consist of four characters. Tag names with less than four characters have trailing spaces. When tag names are shown in text they are enclosed in straight quotes. Tables that are required must appear in any valid TrueType font file. Also notable is that Apple makes a distinction between a "TrueType font" (which refers to a particular font outline definition technology) and an "sfnt-housed font," which refers to any font which uses the same packaging format as a TrueType font: that is, it uses the same directory structure and the same table format and meaning for any tables present.','2003-12-18 00:00:00',NULL),
	 ('99a87790-c192-4ec2-870b-59d9b86fe4c4','2022-11-14 14:16:09.030077','2022-11-14 14:16:09.030077',NULL,'69036f14-15c2-410f-8cee-e9f863f37026','',NULL,NULL,NULL,1,false,true,false,'1.0','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select Add an Entry.',NULL,NULL),
	 ('fe5d2888-31c8-413e-b144-fb7fd5c0e594','2022-11-14 14:16:09.849314','2022-11-14 14:16:09.849314',NULL,'b1989d57-7938-47df-a1e1-53608500520a','',NULL,NULL,NULL,1,false,true,false,'2.0','The Truevision TGA File Format comprises 5 areas, each of which contains one or more fields of fixed or variable length. The 5 file areas are: (1) TGA File Header, (2) Image/Color Map Data, (3) Developer Area, (4) Extension Area and (5) TGA File Footer.
The last 3 areas, the Developer Area, the Extension Area and the TGA File Footer are new to the file specification as of September, 1989. For this reason, images created with software written before September, 1989 will probably not contain these three fields.',NULL,NULL),
