	 ('8d241a1e-26b4-449b-a75a-3ee11480cd63','2022-11-14 14:16:13.349333','2022-11-14 14:16:13.349333',NULL,'b8f06a77-10bc-420b-b4ba-6380092afd86','',NULL,NULL,NULL,1,false,true,false,'','Tweet JSON represents the serialization of the JSON response payload of the Twitter API when requesting a single Tweet by id. Each Tweet has an author, a message, a unique ID, a timestamp of when it was posted, and sometimes geo metadata shared by the user.
Each Tweet also has "entity" objects, which are arrays of common Tweet contents such as hashtags, mentions, media, and links. If there are links, the JSON payload can also provide metadata such as the fully unwound URL and the webpages title and description.
In addition to the text content itself, a Tweet can have over 150 attributes associated with it.',NULL,NULL),
	 ('6b99ed9c-687c-49cc-b0cb-be97159f15a3','2022-11-14 14:16:13.954983','2022-11-14 14:16:13.954983',NULL,'0695b483-d111-48c5-addc-2af9fd00e0d0','https://docs.microsoft.com/en-us/windows/win32/midl/com-dcom-and-type-libraries

