https://filext.com/file-extension/TLB

https://flylib.com/books/en/3.264.1.146/1/',NULL,NULL,NULL,1,false,true,false,'Type 1','This record describes Type Library Type 1 file format, files which mostly belong to Borland Type Library by Borland Software Corporation. A type library (.tlb) is a binary file that stores information about a COM or DCOM object''s properties and methods in a form that is accessible to other applications at runtime. Type libraries provide a language-neutral mechanism for defining types such as interfaces, methods, classes, and other COM elements that are defined and used by a server and called on by a client. Type libraries are saved as binary files with a .tlb extension or can be contained within the binary file representing the server ( *.dll , *.ocx , *.exe , *.olb ).

Using a type library, an application or browser can determine which interfaces an object supports, and invoke an object''s interface methods. This can occur even if the object and client applications were written in different programming languages. The COM/DCOM run-time environment can also use a type library to provide automatic cross-apartment, cross-process, and cross-machine marshaling for interfaces described in type libraries.',NULL,NULL),
