https://en.wikipedia.org/wiki/Optical_disc_image

https://docs.microsoft.com/en-us/windows/win32/imapi/disc-formats',NULL,NULL,NULL,1,false,true,false,'','UDF Disc Image is a format that stores contents and structure of an optical disc which can be transferred on the other media. It uses Universal Disk Format (UDF) file system developed for optical media by the Optical Storage Technology Association (OSTA). It is a portable format that is recognized by several operating systems, and considered to be a successor of ISO 9660 capable to manage read/write media in better capacity. UDF is used for computer data storage for a broad range of media, including DVDs and Blu-Ray disks. A disk image is a uncompressed copy of the contents of a disk or a folder, it can facilitate certain types of backup and recovery strategies. Please see ID: fdd000348 from Library of Congress and other links attached to this entry for further information.',NULL,NULL),
	 ('cf1fddca-cb40-48e2-a795-a396fa875a84','2022-11-14 14:16:17.537815','2022-11-14 14:16:17.537815',NULL,'1c1d76a9-729a-4450-a04e-0498369670e3','http://fileformats.archiveteam.org/wiki/Universal_Disk_Format

http://fileformats.archiveteam.org/wiki/ISO_9660

https://www.loc.gov/preservation/digital/formats/fdd/fdd000348.shtml

https://en.wikipedia.org/wiki/Optical_disc_image

https://docs.microsoft.com/en-us/windows/win32/imapi/disc-formats',NULL,NULL,NULL,1,false,true,false,'','UDF-ISO 9660 Bridge Disc is a format that stores contents and structure of an optical disc which can be transferred on the other media. It uses Universal Disk Format (UDF) file system developed for optical media by the Optical Storage Technology Association (OSTA), as well as ISO 9660 International Organization for Standardization (ISO). This format acts as a support for discs where ISO 9660 and UDF formats all reside on the same optical disc. It can be used in video applications, such as DVD-Video, DVD+VR, and DVD-VR. A disk image is a uncompressed copy of the contents of a disk or a folder, it can facilitate certain types of backup and recovery strategies. Please see ID: fdd000348 from Library of Congress and other links attached to this entry for further information.',NULL,NULL),
