Viacom New Media was a publisher of video games and other electronic entertainment software. It was formed in 1994 as a subdivision of Viacom Interactive Media.',NULL,NULL),
	 ('76d86990-d7c5-47ac-878e-c9d68cbedaf9','2022-11-14 14:16:48.544579','2022-11-14 14:16:48.544579',NULL,'50191197-b48c-4f5a-ab5e-064e99fac8c3','',NULL,NULL,NULL,1,false,true,false,'','The VICAR  image file format is used primarily for storing planetary image data collected by both interplanetary spacecraft and Earth-based stations. Many astronomical and astrophysical organizations use and support the VICAR format.
