https://en.wikipedia.org/wiki/Vim_(text_editor)',NULL,NULL,NULL,1,false,true,false,'','Vim SWAP file is a temporary file created by the open source Vim text editor, when editing a file. The file''s name typically begins with ".", and ends with ".swp". The file is normally deleted when editing is complete, but may be left behind in the event of a crash or other abnormal termination. Its main purpose is to periodically record unsaved changes made to the file. It also serves as a lock file. The file format is undocumented, and not necessarily portable.

Vim is free and open-source, screen-based text editor program for Unix, released to the public in 1991. Vim was designed for use both from a command-line interface and as a standalone application in a graphical user interface.',NULL,NULL),
	 ('0740fb22-36de-4611-a259-d196ef42c37c','2022-11-14 14:16:52.346747','2022-11-14 14:16:52.346747',NULL,'c23ca4de-f3db-4697-8a3e-9b211360dc53','',NULL,NULL,NULL,1,false,true,false,'','This is a group of formats created by the Virtools software application. Originally released in 1993, Virtools offered a development environment to create interactive 3D applications.

Virtools includes four format types, Composition files, Object files, Player files and Scripts files.

Virtools Composition files have an extension of .cmo, these contain an arrangement of one or more elements or associated behaviours which are assembled within Virtools.
Virtools Object files have an extension of .nmo and contain one or more elements or scripts.
Virtools Player files have an extension of .vmo and contain a composition that has been exported from Virtools and are read only files.
Virtools Script files have an extension of .nms and contain a script or a behaviour graph.

Currently PRONOM is unable to distinguish between these four different formats, if you are able to provide any information around this format please contact pronom@nationalarchives.gov.uk.',NULL,NULL),
	 ('99586f67-0e5e-4c46-8196-78ffd8f6de1c','2022-11-14 14:16:52.945103','2022-11-14 14:16:52.945103',NULL,'f545cbea-c18f-4c46-a0ae-ad48098e87ac','',NULL,NULL,NULL,1,false,true,false,'','VDI (Virtual Disk Image) is the native format used for storage by VirtualBox virtual machines.',NULL,NULL);
https://timcera.bitbucket.io/posts/vrts_are_amazing.html',NULL,NULL,NULL,1,false,true,false,'','VRT is developed by the GDAL/OGR group and is an XML file that is used to transform source GIS datasets by the GDAL/OGR programs. It can operate on either raster or vector data sources, though the two different datasets cannot be mixed in the same VRT file. VRT driver is a raster format driver that allows a virtual GDAL dtaset to be composed from other GDAL datasets with repositioning and algorithms potentially applied as well as various kinds of metadata altered or added. VRT descriptions of datasets can be saved in an XML format normally given the extension .vrt.',NULL,NULL),
	 ('6d555e40-9300-4e6c-b4a1-6909b8a0460b','2022-11-14 14:16:54.197709','2022-11-14 14:16:54.197709',NULL,'b07307cb-b90c-43f1-b54a-eb35d6910fd0','https://gdal.org/drivers/vector/vrt.html
https://timcera.bitbucket.io/posts/vrts_are_amazing.html',NULL,NULL,NULL,1,false,true,false,'','VRT is developed by the GDAL/OGR group and is an XML file that is used to transform source GIS datasets by the GDAL/OGR programs. It can operate on either raster or vector data sources, though the two different datasets cannot be mixed in the same VRT file. Virtual Format is a driver that transforms features read from other drivers based on criteria specified in an XML control file. It is primarily used to derive spatial layers from flat tables with spatial information in attribute columns. It can also be used to associate coordinate system information with a datasource, merge layers from different datasources into a single data source, or even just to provide an anchor file for access to non-file oriented datasources.',NULL,NULL),
	 ('e979433a-36c4-42ed-93af-a3a6ff80c231','2022-11-14 14:16:54.9002','2022-11-14 14:16:54.9002',NULL,'a1f7c710-651d-4f46-8f0c-1613022e0278','',NULL,NULL,NULL,1,false,true,false,'1.0','The Virtual Reality Modeling Language (VRML) is a language for describing multi-participant interactive simulations - virtual worlds networked via the global Internet and hyper-linked with the World Wide Web. All aspects of virtual world display, interaction and internetworking can be specified using VRML. It was created with the goal of becoming the standard language for interactive simulation within the World Wide Web. The first version of VRML allows for the creation of virtual worlds with limited interactive behaviour. These worlds can contain objects which have hyper-links to other worlds, HTML documents or other valid MIME types. Nodes are arranged in hierarchical structures called scene graphs, which also define an ordering of the nodes.',NULL,NULL),
	 ('a0b4d1a4-9965-48f9-bc27-bfe278aa2802','2022-11-14 14:16:55.425992','2022-11-14 14:16:55.425992',NULL,'9ef42647-3b3b-4f6a-b2fc-a26c4ead4438','',NULL,NULL,NULL,1,false,true,false,'2.0','The Virtual Reality Modeling Language (VRML) is a file format for describing 3D interactive worlds and objects. It may be used in conjunction with the World Wide Web. It may be used to create three-dimensional representations of complex scenes such as illustrations, product definition and virtual reality presentations.  VRML is capable of representing static and animated objects and it can have hyperlinks to other media such as sound, movies, and image. Interpreters (browsers) for VRML are widely available for many different platforms as well as authoring tools for the creation VRML files. VRML supports an extensibility model that allows new objects to be defined and a registration process to allow application communities to develop interoperable extensions to the base standard. There is a mapping between VRML elements and commonly used 3D application programmer interface (API) features.',NULL,NULL),
	 ('26d30cec-908c-4b5a-b7bf-550b7289b062','2022-11-14 14:16:56.020379','2022-11-14 14:16:56.020379',NULL,'6503b382-0e30-4781-a408-6fede28ea152','',NULL,NULL,NULL,1,false,true,false,'','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select Add an Entry.',NULL,NULL),
