	 ('8328958e-e7ba-45ee-9ecf-043645358eb6','2022-11-14 14:16:58.589173','2022-11-14 14:16:58.589173',NULL,'2b08c217-f05d-4256-8e4c-059d58547a58','',NULL,NULL,NULL,1,false,true,false,'3 or earlier','The .frm file format was created by early versions of Visual Basic to distinguish between different item types. First released in 1991, Visual Basic was declared legacy in 2008. It provided a GUI which allowed users to modify code by dragging and dropping objects and defining their behaviour and appearance.',NULL,NULL),
	 ('66342d1e-0e70-471c-b66b-c107fc165856','2022-11-14 14:16:59.278766','2022-11-14 14:16:59.278766',NULL,'1ca24e2a-3294-403e-9bb8-da8568a528f6','',NULL,NULL,NULL,1,false,true,false,'4 onwards','The .frm file format was created by early versions of Visual Basic to distinguish between different item types. First released in 1991, Visual Basic was declared legacy in 2008. It provided a GUI which allowed users to modify code by dragging and dropping objects and defining their behaviour and appearance.',NULL,NULL),
