	 ('fa5e3d24-cb11-4d48-af8a-19a1bd20f522','2022-11-14 14:17:00.44828','2022-11-14 14:17:00.44828',NULL,'b7e52f32-7e00-43bc-ae32-2bd60c3f735b','',NULL,NULL,NULL,1,false,true,false,'1-6','These are project files created by Visual Basic, a software development tool for Windows, which stored project information in a plain text format. The vbp files refer to other resources in the project, including forms (.FRM files) souce code files (.BAS files) and class module files (.CLS extension). Visual Basic software was replaced with Visual Basic.NET, which doesnt generate .vbp files.',NULL,NULL),
	 ('76253b77-8bc7-4a57-ae61-fc871be2e157','2022-11-14 14:17:01.051176','2022-11-14 14:17:01.051176',NULL,'9ab3a7f6-c962-4403-9c1e-011a4c1a553d','',NULL,NULL,NULL,1,false,true,false,'1-6','These are files created by Visual Basic, a software development tool for Windows. The files hold coordinate positions for each window in the visual programming environment, and are used to reload elements into their previous positions after a close/reopen. Visual Basic software has been replaced with Visual Basic.NET., which doesnt generate .vbw files.',NULL,NULL),
