	 ('f74aea8e-c27f-4a38-a6c5-3e17d9103f30','2022-11-14 14:17:04.508085','2022-11-14 14:17:04.508085',NULL,'574a1820-83eb-41c6-bfbe-22cfbdcb64ef','',NULL,NULL,NULL,1,false,true,false,'','VivoActive is an audio/video format created by Vivo Software, acquired by RealNetworks in 1997. It uses H.263 video and G.723 ADPCM audio. VivoActive uses inter-frame coding, but does not insert any key frames, except at the beginning of the clip, which effectively disables the possibility of seeking to specific locations in the stream. The VivoActive technology was integrated to the RealMedia, the .viv format was replaced by .rm (RealMedia).',NULL,NULL),
	 ('c5606535-17ad-4aff-bef5-efa9636eaafc','2022-11-14 14:17:05.129048','2022-11-14 14:17:05.129048',NULL,'1d10cd21-4747-482f-8cbc-9a7f255fb30c','',NULL,NULL,NULL,1,false,true,false,'','VLW is a font file created by the Processing Development Environment. At this stage no identification signature exists, but this may be possible with further research.',NULL,NULL),
	 ('fe57f3ee-c934-45da-ad4f-39727f40735a','2022-11-14 14:17:06.326211','2022-11-14 14:17:06.326211',NULL,'f3038b66-b6e0-495d-b0ee-a933efc2ada4','',NULL,NULL,NULL,1,false,true,false,'XML','V-Ray Material files define material properties for use within 3D rendering applications. This entry identifies the XML version of the format in use in versions later than 1.49. Please contact the PRONOM team if you can assist with identification of the earlier binary versions of the format.',NULL,NULL),
	 ('326dcb3d-030b-4e87-8103-3ec8d5534164','2022-11-14 14:17:08.207806','2022-11-14 14:17:08.207806',NULL,'7c7cc45d-13e2-4992-abd9-5dab831720b3','',NULL,NULL,NULL,1,false,true,false,'','The WARC (Web ARChive) file format offers a convention for concatenating multiple resource records (data objects), each consisting of a set of simple text headers and an arbitrary data block into one long file. The WARC format is an extension of the ARC file format (ARC) that has traditionally been used to store "web crawls" as sequences of content blocks harvested from the World Wide Web ()
Besides the primary content recorded in ARCs, the extended WARC format accommodates related secondary content, such as assigned metadata, abbreviated duplicate detection events, later-date transformations, and segmentation of large resources.
WARC format has been written by the members of the IIPC (http://www.netpreserve.org/) grouped within the ISO/TC46/SC4/WG12.','2009-05-15 00:00:00',NULL),
	 ('ab14c8d2-317a-47b8-ba2d-7ffb2322f5bf','2022-11-14 14:17:10.262963','2022-11-14 14:17:10.262963',NULL,'0e723267-ce1f-4bb9-a228-a13b31610d2c','',NULL,NULL,NULL,1,false,true,false,'1.0','The WARC (Web ARChive) file format offers a convention for concatenating multiple resource records (data objects), each consisting of a set of simple text headers and an arbitrary data block into one long file. The WARC format is an extension of the ARC file format (ARC) that has traditionally been used to store "web crawls" as sequences of content blocks harvested from the World Wide Web ()
Besides the primary content recorded in ARCs, the extended WARC format accommodates related secondary content, such as assigned metadata, abbreviated duplicate detection events, later-date transformations, and segmentation of large resources. The WARC format defines no internal compression, however the standard recommends the GZIP format with "deflate" where compression is desirable.
WARC format has been written by the members of the IIPC (http://www.netpreserve.org/) grouped within the ISO/TC46/SC4/WG12.',NULL,NULL),
	 ('cb05f5f5-e653-4277-867a-ed21bd5fc726','2022-11-14 14:17:13.533681','2022-11-14 14:17:13.533681',NULL,'562f9174-ceb5-4fbd-ac57-6af7b8e8c52d','',NULL,NULL,NULL,1,false,true,false,'1.1','The WARC (Web ARChive) file format offers a convention for concatenating multiple resource records (data objects), each consisting of a set of simple text headers and an arbitrary data block into one long file. The WARC format is an extension of the ARC file format (ARC) that has traditionally been used to store "web crawls" as sequences of content blocks harvested from the World Wide Web () Besides the primary content recorded in ARCs, the extended WARC format accommodates related secondary content, such as assigned metadata, abbreviated duplicate detection events, later-date transformations, and segmentation of large resources. WARC format has been written by the members of the IIPC (http://www.netpreserve.org/) grouped within the ISO/TC46/SC4/WG12.',NULL,NULL),
	 ('3bce33b5-f03a-40ea-882f-475de22bf3d2','2022-11-14 14:17:16.215467','2022-11-14 14:17:16.215467',NULL,'2312e87b-8bc9-4502-964e-6c35070a8c85','',NULL,NULL,NULL,1,false,true,false,'','Waveform Audio (WAVE) is a chunk-based audio format developed by Microsoft, based on the generic Resource Interchange File Format (RIFF) specification developed by Microsoft and IBM. Structurally, a WAVE file is composed of a number of chunks, each comprising a four character code chunk identifier, the chunk size, and the chunk data. It  comprises a RIFF header with a WAVE data type identifier, followed by a series of chunks. Every file must include a Format chunk, which describes the format of the audio data, and a Data chunk, containing the audio data itself. Other optional chunks are also allowed. The format supports a wide variety of compressed and uncompressed audio encodings.',NULL,NULL),
	 ('544c31fc-3118-46e2-b6ad-e85a3d139757','2022-11-14 14:17:17.092941','2022-11-14 14:17:17.092941',NULL,'0a6c2126-10ac-4aac-9e24-a34c547b5ca7','',NULL,NULL,NULL,1,false,true,false,'','Waveform Audio (PCMWAVEFORMAT) is the standard Waveform Audio file format, developed by Microsoft. It has now been superseded by Waveform Audio (WAVEFORMATEX), an extended version.',NULL,NULL),
	 ('e222f548-9b14-4769-bafa-326fc20e42b5','2022-11-14 14:17:17.809391','2022-11-14 14:17:17.809391',NULL,'7ee30d6c-dd45-4c7b-9175-a47944b2bd5f','',NULL,NULL,NULL,1,false,true,false,'','Waveform Audio (WAVEFORMATEX) is an extended version of the Waveform Audio file format, and was developed by Microsoft. It has superseded the Waveform Audio (PCMWAVEFORMAT).',NULL,NULL),
	 ('17ab1e83-d4fa-4c45-9c92-04cdf8c43818','2022-11-14 14:17:18.589905','2022-11-14 14:17:18.589905',NULL,'695066a3-a130-46b3-ac00-365949cdfb58','',NULL,NULL,NULL,1,false,true,false,'','Waveform Audio (WAVEFORMATEXTENSION) is an extended version of the Waveform Audio file format, and was developed by Microsoft. It is related to the Waveform Audio (WAVEFORMATEX) format, but is an even more extended version.',NULL,NULL),
	 ('de41770b-fa00-4922-8e6c-8141f36781ad','2022-11-14 14:17:19.259442','2022-11-14 14:17:19.259442',NULL,'84d99235-bc46-456b-87b0-37fed266745b','',NULL,NULL,NULL,1,false,true,false,'','MTL is a companion file for the Wavefront OBJ file. The MTL file describes surface shading properties for use by one or more OBJ.',NULL,NULL),
	 ('aa976e93-8ab5-4f5d-a25e-f26eb47543d9','2022-11-14 14:17:19.855658','2022-11-14 14:17:19.855658',NULL,'699a7c90-294e-46c3-b7f3-d13948f1e995','',NULL,NULL,NULL,1,false,true,false,'','OBJ is an ASCII format for representing 3D geometry. The OBJ format supports both polygonal objects and free-form objects. Polygonal geometry uses points, lines, and faces to define objects while free-form geometry uses curves and surfaces.',NULL,NULL),
	 ('c0e3b6f5-6973-47bd-9b05-b2d6cc3b7fe9','2022-11-14 14:17:20.551106','2022-11-14 14:17:20.551106',NULL,'03944d8a-e2e3-4fa3-9648-68d2a68c4a5c','',NULL,NULL,NULL,1,false,true,false,'1.0','Web Open Font Format (WOFF) is a font format designed primarily for use on the Web, and can also be used as a container format or "wrapper" for font data in already-existing formats.',NULL,NULL),
	 ('98d2943a-5332-4fcd-8b94-fdd0caaed2fb','2022-11-14 14:17:24.542747','2022-11-14 14:17:24.542747',NULL,'7bbebe41-2543-419f-8165-556355616727','',NULL,NULL,NULL,1,false,true,false,'2.0','Web Open Font Format (WOFF) is a font format designed primarily for use on the Web, and can also be used as a container format or "wrapper" for font data in already-existing formats. WOFF 2 was developed to provide improved compression over WOFF 1.',NULL,NULL),
	 ('18907b20-0a73-4b14-a224-5b0f5114e918','2022-11-14 14:17:25.250954','2022-11-14 14:17:25.250954',NULL,'87640dba-f319-40a9-a1cf-7563cbeb563e','https://www.w3.org/TR/webvtt1/',NULL,NULL,NULL,1,false,true,false,'','WebVTT files are used for captioning or subtitling video content. It is a standard created by the World Wide Web Consortium (W3C) for displaying timed text, and is linked to the HTML5 <track> element.',NULL,NULL),
	 ('bfa626ec-b3a2-47b5-b4c7-9e021c4561e6','2022-11-14 14:17:26.009767','2022-11-14 14:17:26.009767',NULL,'373db70f-99da-4e00-bcc6-3cad6c8b1bfe','',NULL,NULL,NULL,1,false,true,false,'','WebM is a media file format, developed by Google based on the Extensible Binary Meta Language.',NULL,NULL),
	 ('d63d671b-094f-405a-82cb-73613691324d','2022-11-14 14:17:26.573495','2022-11-14 14:17:26.573495',NULL,'4d6b6420-8c50-457b-921e-3ee761dca88c','',NULL,NULL,NULL,1,false,true,false,'Extended','WebP is a raster image format developed by Google that uses the Resource Interchange File Format as a container. The extended version of the format allows for alternative colour profiles and animation.',NULL,NULL),
	 ('9f98e5f5-023f-45d2-9d79-7140b9ea9572','2022-11-14 14:17:28.177583','2022-11-14 14:17:28.177583',NULL,'7a8d3382-94d4-45bb-8d6c-460e19dd39b2','',NULL,NULL,NULL,1,false,true,false,'Lossless','WebP is a raster image format developed by Google that uses the Resource Interchange File Format as a container. WebPs lossless compression uses advanced techniques such as dedicated entropy codes for different color channels, exploiting 2D locality of backward reference distances and a color cache of recently used colors. This complements basic techniques such as dictionary coding, Huffman coding and color indexing transform.',NULL,NULL),
	 ('fda3ab65-3dbb-4a6f-9b8a-a78b0791fa73','2022-11-14 14:17:28.896789','2022-11-14 14:17:28.896789',NULL,'fc6f29c6-04ed-4ebf-ba79-335651d4517b','',NULL,NULL,NULL,1,false,true,false,'Lossy','WebP is a raster image format developed by Google that uses the Resource Interchange File Format as a container. WebP''s lossy compression algorithm is based on the intra-frame coding of the VP8 video format.',NULL,NULL),
	 ('a4b0a247-644d-4a77-934a-932a4b848a9a','2022-11-14 14:17:30.447677','2022-11-14 14:17:30.447677',NULL,'b3065258-79d2-492c-9a47-6aa29cef4456','https://docs.microsoft.com/en-us/previous-versions/windows/desktop/wab/-wab-overview',NULL,NULL,NULL,1,false,true,false,'','Windows Address Book was a component of Microsoft Windows, allowing users to keep a list of contacts to share across multiple programs. It is most commonly associated with Outlook Express.',NULL,NULL),
