	 ('dff5d906-c84a-4abd-8a1e-052e07d70cff','2022-11-14 14:17:41.530523','2022-11-14 14:17:41.530523',NULL,'d8511f64-5a14-41ba-a87e-69216b613819','',NULL,NULL,NULL,1,false,true,false,'','JNT is the native format of Windows Journal, a notetaking application created by Microsoft for Windows operating systems starting with Windows XP. Due to security concerns Microsoft advise against using the format and have supplied a patch for removal of the application (https://support.microsoft.com/en-gb/help/3161102/update-for-windows-journal-component-removal). Microsoft also provide an update that re-installs a version of Windows Journal that highlights the security concerns (https://support.microsoft.com/en-us/help/3162655/windows-journal-application-for-windows). A JTP is a Windows Journal Template file, however this appears to be structurally identical to a JNT file.',NULL,NULL),
	 ('db98b1eb-56d3-43c1-b602-dd3976c04062','2022-11-14 14:17:43.430751','2022-11-14 14:17:43.430751',NULL,'b455edeb-af63-4e03-a611-27f6e53b1d1f','',NULL,NULL,NULL,1,false,true,false,'','Windows Media Audio Format is a subtype of the Advanced Systems Format, developed by Microsoft for storing audio data streams. It comprises a Header Object, which describes the properties of the data streams, a Data Object, which contains the actual data streams stored in Data Packets and, optionally, one or more Index Objects. Audio data is stored using the Windows Media Audio codec, and the format supports streaming across networks.','2004-12-01 00:00:00',NULL),
	 ('1b3181d2-db3c-4968-b5d0-e93d9a20e541','2022-11-14 14:17:45.90433','2022-11-14 14:17:45.90433',NULL,'ab0fd242-e07e-4d6b-b99e-dc4c7fddf007','',NULL,NULL,NULL,1,false,true,false,'','A media metafile is a file that contains information about other files. A metafile can be used to list a group of media content files that are to be played in order. The .wax metafile references Windows Media files with .asf, .wma, or .wax file name extensions. The .wvx metafile references Windows Media files with .wma, .wmv, .wvx, or .wax file name extensions. The asx metafile references Windows Media files with .wma, .wax, .wmv, .wvx, .asf, or .asx file name extensions.',NULL,NULL),
	 ('032a5a6f-76ec-45a2-8391-b58522308b6c','2022-11-14 14:17:47.303379','2022-11-14 14:17:47.303379',NULL,'13ed9ed1-4e0a-4556-8566-00674ae04b55','',NULL,NULL,NULL,1,false,true,false,'','Windows Media Player Playlist is a file format that stores multimedia playlists. It is a proprietary file format used in Microsoft Windows Media Player versions 9-12.',NULL,NULL),
	 ('5dc63cff-1cca-4516-8580-5af9a8eadf8b','2022-11-14 14:17:48.188348','2022-11-14 14:17:48.188348',NULL,'d42181c4-397f-4d8b-a879-a8ec63fa1d2b','',NULL,NULL,NULL,1,false,true,false,'','Windows Media Video Format is a subtype of the Advanced Systems Format, developed by Microsoft for storing video data streams. It comprises a Header Object, which describes the properties of the data streams, a Data Object, which contains the actual data streams stored in Data Packets and, optionally, one or more Index Objects. Video data is stored using the Windows Media Video codec, and the format supports streaming across networks.','2004-12-01 00:00:00',NULL),
