	 ('0b2899a8-ea24-45ee-9782-837fbb9475ac','2022-11-14 14:17:50.171569','2022-11-14 14:17:50.171569',NULL,'308ba482-ac5b-4723-b729-b8371bea2050','',NULL,NULL,NULL,1,false,true,false,'','The New Executable (abbreviated NE or NewEXE) is a 16-bit .exe file format, a successor to the DOS MZ executable format. It is used by 16-bit Microsoft Windows, and by some versions of OS/2 and MS-DOS.',NULL,NULL),
