	 ('8afebb26-575c-428b-9bce-863c9d72c6ad','2022-11-14 14:17:53.94581','2022-11-14 14:17:53.94581',NULL,'9e8fe070-34fe-4bc3-b1cd-9350c4e53568','',NULL,NULL,NULL,1,false,true,false,'','The Wireless Application Protocol Bitmap format, or Wireless Bitmap, is a monochrome image format optimised for use on the mobile web.',NULL,NULL),
	 ('dbd65397-97ad-4560-abcf-3ff900dbb10f','2022-11-14 14:17:54.689572','2022-11-14 14:17:54.689572',NULL,'abe7a0ff-18cd-4b93-b3dc-5430a822044f','',NULL,NULL,NULL,1,false,true,false,'','Files from Wordcraft word processing software from the 1980s, which was made for IBM XT and Commodore 64. Documents created with this software contained at least 2 files, an ''index'' file with extension .doc and chapter file(s) with extension .001.',NULL,NULL),
	 ('571a5778-a66a-4c3a-8830-5b57f93be012','2022-11-14 14:17:55.307289','2022-11-14 14:17:55.307289',NULL,'23c80672-ff68-49f0-a88c-dff3144cf1e9','',NULL,NULL,NULL,1,false,true,false,'4.0/4.1/4.2','WordPerfect is a Word Processing application currently owned by Corel Corporation. The original version of WordPerfect 4.0 was released in 1984. 4.1 followed in 1985 and 4.2
in 1986, with versions released on various platforms up to 1988 when version 5.0 was originally released for DOS.

Only the technical specification for version 4.2 is currently known to have been made public, originally via the PC Developer''s Toolkit diskette, and this can be found
preserved here: http://www.columbia.edu/~em36/wpdos/wp42ff.txt.

The file format for the WP4.2 version contains only the document body with special function codes, and the format lacks a header or mandatory elements that can be used by
PRONOM for automatic identification. Each function code represents a text function, such as bold or underline, so with reference to the specification it should be possible to
parse the file to understand the intended layout. It may be the case that the file format for 4.0 and 4.1 is functionally identical or very similar to version 4.2.

A free C++ library called libwpd is available: http://libwpd.sourceforge.net/ and it includes the ability to parse WP4.2 files. This library is known to have been implemented
in LibreOffice, Koffice, and AbiWord among others, so these applications can be used to open and render WordPerfect 4.2 files, and potentially WP4.0 and WP4.1.

Due to the age of the format, WP4.x files may lack a format extension, however .wp4 and .wpd are known to be associated with the format.',NULL,NULL),
	 ('a2d127d3-efbd-426f-89f3-a59e32a63a12','2022-11-14 14:17:55.947817','2022-11-14 14:17:55.947817',NULL,'69d581ee-66b3-4566-a8d7-40edc1389493','',NULL,NULL,NULL,1,false,true,false,'4.2','WordPerfect is a Word Processing application currently owned by Corel Corporation. Documents could be encrypted in WordPerfect 4.2 using the ''locking'' feature.',NULL,NULL),
	 ('b967f945-8243-4ce2-9475-0b2b36dfd5e3','2022-11-14 14:17:56.637711','2022-11-14 14:17:56.637711',NULL,'fa556eff-585e-4002-96b6-bc3f1df99661','',NULL,NULL,NULL,1,false,true,false,'2.x','WordPerfect is a word processor application currently owned by Corel. Applications implementing the libwpd library should be able to render older WordPerfect documents. WordPerfect documents created within a Macintosh environment are likely to lack a format extension.',NULL,NULL),
