	 ('29d6abc2-7446-46f0-936e-fe27eefb2518','2022-11-14 14:18:10.905176','2022-11-14 14:18:10.905176',NULL,'82b598cc-fb34-4330-aaa1-aa3c23086b76','http://justsolve.archiveteam.org/wiki/WordStar
https://www.loc.gov/preservation/digital/formats/fdd/fdd000552',NULL,NULL,NULL,1,false,true,false,'3.0','The WordStar format is the default proprietary plain text format for the word processing application of the same name. It was created in 1978 by MicroPro, originally for the CP/M operating system but later was used on other operating systems such as PC/MS-DOS. It was the first word processor to render the doument on screen as it would appear when printed. WordStar files often have the extension ws or ws follwed by their version number but it is also common for them to have no extension.',NULL,NULL),
	 ('c4e8b7fc-136b-4b04-b5c2-cec400acc584','2022-11-14 14:18:11.693933','2022-11-14 14:18:11.693933',NULL,'e724fb04-994c-451a-a1de-f92166b0c4cf','http://justsolve.archiveteam.org/wiki/WordStar
https://www.loc.gov/preservation/digital/formats/fdd/fdd000552',NULL,NULL,NULL,1,false,true,false,'4.0','The WordStar format is the default proprietary plain text format for the word processing application of the same name. It was created in 1978 by MicroPro, originally for the CP/M operating system but later was used on other operating systems such as PC/MS-DOS. It was the first word processor to render the doument on screen as it would appear when printed. WordStar files often have the extension ws or ws follwed by their version number but it is also common for them to have no extension.

WS4 files currently cannot by identified though a PRONOM identification signature.

On the surface it''s a plain text file, however the format ''shifts'' the last byte of each word. Effectively it is ''flipping'' the first bit of the ASCII character from 0 to 1. so a lower case ''r'' (hex value 0x72) becomes '''' (hex value 0xF2); lower case ''d'' (hex 0x64) becomes '''' (hex 0xE4) and so on.

It should be possible to write a simple decoder application for WS4 files, however note that the conjecture above is based on observation of a limited pool of files, and there may be additional subtleties yet to be encountered and understood. Please contact the PRONOM team if you have any further information about this format.',NULL,NULL),
