http://www.zimmers.net/anonftp/pub/cbm/c64/archivers/Wraptor-3.0.readme',NULL,NULL,NULL,1,false,true,false,'1; 2; 3','WRAptor Compressed File is a format which was written by Bill Lucier, copyrighted in 1995, distributed by Loadstar and updated  by Doreen Horne. This format is an uncommon compression format, capable of handling PRG, SEQ, USR and GEOS files (Sequential and VLIR), but not REL files. It utilizes a variant of the LZ (Lempel-Ziv) compression algorithm, starting at 9 bits per code. The 4-byte signature of this format is "FF 42 4C FF", with bytes 42 and 4C representing the authors initials in ASCII - "BL".

There are three versions of this format, all beginning with same magic bytes. The versions differentiate in their file extension with the v1 and v2 using .wra and the final v3 using .wr3. This entry records all versions of this file format. The complete manual of how to handle the software and this format is included with the reference links.',NULL,NULL),
	 ('e692650d-a025-4b95-8cec-a09daab260c9','2022-11-14 14:18:21.720139','2022-11-14 14:18:21.720139',NULL,'8aad94aa-aeb9-44bf-82ab-d5f95183b99f','',NULL,NULL,NULL,1,false,true,false,'3.0','Microsoft Write is a basic word processor included with Windows 1.0 and later, until Windows NT 3.5. Throughout its lifespan it was minimally updated, and is comparable to early versions of MacWrite. Early versions of Write only work with Write (.wri) files, but after Windows 3.0, Write became capable of reading and composing early Word (.doc) documents. With Windows 3.1, Write became OLE capable. In Windows 95, Write was replaced with WordPad.',NULL,NULL),
