https://archive.org/stream/mac_Graphics_File_Formats_Second_Edition_1996/Graphics_File_Formats_Second_Edition_1996_djvu.txt',NULL,NULL,NULL,1,false,true,false,'','The XIMG  (Extended GEM Bit Image) image format is more developed version of GEM raster Image [x-fmt/159] which allows for standardised verison of storing colour palettes. It originated due to the specification of GEM format being ambiguous as to the format of color images.

The GEM raster format (also known as GEM VDI Bit Image; GEM Bit Image; GEM Image; GEM Bitmap; or IMG) is an image format native to the Graphical Environment Manager (GEM) operating system and developed at Digital Research. The format was used by GEM Paint and Ventura Publisher, and by a variety of Atari ST software.',NULL,NULL),
	 ('f8d5d32c-3d68-4778-b687-37464d6e421b','2022-11-14 14:18:47.619749','2022-11-14 14:18:47.619749',NULL,'6645c791-44cc-4c8d-af3c-483270864ef0','http://fileformats.archiveteam.org/wiki/XLD4',NULL,NULL,NULL,1,false,true,false,'','XLD4 is a raster graphics format, sometimes known as Q4 file, associated with PC-98 a lineup of 16 and 32 bit computers manufactured by NEC in Japan. Each image consists of two separate files, one with a q4 extension and another with a q4d extension. The q4 file contains the bitmap image and the q4d the text description. In PRONOM these have been given two separate PUIDs.',NULL,NULL),
