https://en.wikipedia.org/wiki/Atari_8-bit_family',NULL,NULL,NULL,1,false,true,false,'','XL-Paint is a graphic format used for storing images created by XL-Paint program, a program used for the Atari 8-bit family of computers, introduced in 1979. It uses .raw file extension, files begin with ASCII "XLPB" and are either 792 or 15372 bytes long.

