	 ('7faeaeed-987a-4022-8301-97be965ca55f','2022-11-14 14:19:15.600672','2022-11-14 14:19:15.600672',NULL,'416a4413-6418-4e42-b52d-bb3d8e4b39d5','',NULL,NULL,NULL,1,false,true,false,'4.0','Microsoft Write is a basic word processor included with Windows 1.0 and later, until Windows NT 3.5. Throughout its lifespan it was minimally updated, and is comparable to early versions of MacWrite. Early versions of Write only work with Write (.wri) files, but after Windows 3.0, Write became capable of reading and composing early Word (.doc) documents. With Windows 3.1, Write became OLE capable. In Windows 95, Write was replaced with WordPad.',NULL,NULL),
