	 ('8b218583-c7ef-4435-8ccf-ed464b241b2d','2022-11-14 14:19:17.581775','2022-11-14 14:19:17.581775',NULL,'a4ff5bf9-7fa3-4882-9776-f8843765841d','http://www.youngmonkey.ca/nose/audio_tech/synth/Yamaha-TX16W.html

https://en.wikipedia.org/wiki/Yamaha_TX16W

https://www.file-extensions.org/w%3F%3F-file-extension

https://dompselaar.org/Yamaha/TX16W/MP/',NULL,NULL,NULL,1,false,true,false,'','The Yamaha TX Wave Audio format is 12-bit audio wave file created by the Yamaha TX16W sampler. The Yamaha TX16W is a rack-mount sampler sound module with up to 50 kHz mono and 33 kHz stereo sampling. The format is proprietary created by Yamaha, similar to a .WAV file and supports 16, 33, and 50 kHz samples. The file consists of a 32 byte header followed by the actual waveform. This file fomat has multiple extensions, some of which have yet not been identified. The Yamaha SY Series Wave files also can use the same file extension and a simililar BOF sequence of 0x4C4D38393533. Please use links provided to view the full format specification.',NULL,NULL),
	 ('a6877128-f299-44af-a7df-61979b708db1','2022-11-14 14:19:18.445928','2022-11-14 14:19:18.445928',NULL,'bd79046d-323a-4064-ac3b-8cc30a0847ce','',NULL,NULL,NULL,1,false,true,false,'Generic','Yamaha Wave Audio signature describes formats relevant to Yamaha Wave files, these formats are proprietary and created by Yamaha. There are several versions of these file formats with a numerous examples of extensions. This entry describes generic Yamaha wave format, and PRONOM holds a separate entry on Yamaha TX Wave Audio. Please contact the PRONOM team if you have more information regarding Yamaha Wave formats.',NULL,NULL),
	 ('b0c657e3-83fa-446b-bb17-df4e19385182','2022-11-14 14:19:19.13012','2022-11-14 14:19:19.13012',NULL,'104d3215-c0ce-4a42-9e87-bfc268c8b7cd','',NULL,NULL,NULL,1,false,true,false,'','YAML is data serialisation format which uses a text file organised in a human-readable form. YAML can be used with several platforms of programming languages such as C, Perl, PHP, Python, Ruby, Javascript and others.',NULL,NULL),
	 ('aa330e0f-2018-4bab-b3c7-aa8ec92bd869','2022-11-14 14:19:19.820599','2022-11-14 14:19:19.820599',NULL,'a490b8e1-7fa6-4592-b3ac-245259562b17','http://fileformats.archiveteam.org/wiki/SGI_YAODL

http://paulbourke.net/dataformats/yaodl/',NULL,NULL,NULL,1,false,true,false,'','SGI YAODL (Yet Another Object Description Language) is a description language used for storing 3D object data to disk files. YAODL is an obsolete format created specifically for the Silicon Graphics Powerflip demo program, but it is not widely supported by SGI. The format is an example of a basic vector-object description language and is stored in plain text (ASCII) format.',NULL,NULL),
	 ('5f392683-986f-4915-bb8c-64f3c0cccff2','2022-11-14 14:19:20.533193','2022-11-14 14:19:20.533193',NULL,'cd64ccdf-41b9-4b3e-9f3f-7ad1cd37ae5e','',NULL,NULL,NULL,1,false,true,false,'','yEnc is a binary-to-text encoding mechanism initially developed by Jrgen Helbing for transferring binary files in messages, such as via Usenet or email.',NULL,NULL),
	 ('f261a1c2-8c01-4629-95fd-1a1851029801','2022-11-14 14:19:21.236087','2022-11-14 14:19:21.236087',NULL,'ec697d50-6a93-484f-bec6-90222f1b7da0','https://en.wikipedia.org/wiki/Compress

https://docs.fileformat.com/compression/z/

http://fileformats.archiveteam.org/wiki/Compress_(Unix)',NULL,NULL,NULL,1,false,true,false,'','Z Compressed Data are files that have been compressed by Unix''s shell compression program, compress. The compress software was developed by Spences Thomas in 1984 and uses LZW algorithm. The format has lossless data, it can be compressed and decompressed using the Unix and Linux operating systems.',NULL,NULL),
	 ('8871fe06-bae1-4912-8903-aa22534a6dab','2022-11-14 14:19:21.882617','2022-11-14 14:19:21.882617',NULL,'67c8b3f8-b2c3-4689-b122-b4f97f68f6a1','',NULL,NULL,NULL,1,false,true,false,'','Files used by Z Print or 3D Print that run 3D CJP Printers or former Z Corp Printers. They were used by Z corp 310s, 510s, 810s, 400s, 150s, 250s, 350s, 450s, 650s, 850s or 3D Systems 160s, 260s, 360s, 460s, 660s, 860s, or 4500s.',NULL,NULL),
	 ('b667dee5-04f2-47b7-96f3-06f565183c95','2022-11-14 14:19:22.444775','2022-11-14 14:19:22.444775',NULL,'d7ced1a0-3140-4f1c-a955-95466108c6da','http://docs.pixologic.com/user-guide/materials-lights-rendering/materials/

https://docs.unity3d.com/Packages/com.unity.render-pipelines.high-definition@7.1/manual/MatCap.html#:~:text=MatCap%20mode%20uses%20an%20image,setting%20up%20the%20Scene%20lighting.

http://fileformats.archiveteam.org/wiki/Zbrush_MatCap',NULL,NULL,NULL,1,false,true,false,'','ZBrush Material format is used with 3-D materials by the ZBrush software. It is used with the MatCap (Material Capture) tool that uses calibration markers to capture information from photographs and other images. Each of these markers samples a single point on the image and defines the colour, texture and lightining of the surface to build up a material map that simulates the lighting and material properties from the photograph. The HDRP replaces all of the materials and lighting in the scene with what is in the MatCap.',NULL,NULL),
	 ('70ac76b5-7471-4a38-8b5d-9c0421a99546','2022-11-14 14:19:23.156591','2022-11-14 14:19:23.156591',NULL,'30de58e4-d49e-47c2-8e2f-278a9adc979a','http://www.iana.org/assignments/media-types/application/vnd.software602.filler.form-xml-zip',NULL,NULL,NULL,1,false,true,false,'','ZFO file is a ZIP archive file containing the FO electronic form. The FO electronic form is a XML data file containing an electronic form intended for usage in the 602XML applications. The form is a composure of the layout structure using XSL-FO, data instance and data model using generic XML elements defined in the 602XML framework. The whole electronic form structure is always embedded into a digital signature represented by XML elements of the XML Signature standard. ZFO file can be password protected.',NULL,NULL),
	 ('a2e82019-3c45-4de8-9a6d-7f1d77ae6b1c','2022-11-14 14:19:23.832037','2022-11-14 14:19:23.832037',NULL,'f6798c1a-81cf-454f-b21a-58b61fdfd613','http://isds.czechpoint.cz/v20/message',NULL,NULL,NULL,1,false,true,false,'','This variant of ZFO file is container for delivered data mailbox messages provided by esk pota, s.p. ZFO file is a ZIP archive file (PKCS #7 Cryptographic Message File) composing of the layout structure using XML elements (envelope) and data instance encoded as Base64 (message content).
The message may contain one or more attachments in the file format specified in Annex 3 to Decree No. 194/2009 Col.  The whole structure is always embedded into a digital signature represented by XML elements of the XML Signature standard.',NULL,NULL),
	 ('07721821-7d80-4916-9f0f-30b6c046fce4','2022-11-14 14:19:24.440991','2022-11-14 14:19:24.440991',NULL,'e8923df4-26c2-4253-bea4-0ffad8bbe9bb','http://isds.czechpoint.cz/v20/delivery',NULL,NULL,NULL,1,false,true,false,'','This variant of ZFO file is container for proof of delivery of data mailbox messages provided by esk pota, s.p. in three versions: 1. proof of delivery; 2. confirmation of delivery; 3. delivery failure. ZFO file is a ZIP archive file  (PKCS #7 Cryptographic Message File) composing of the layout structure using XML elements. The whole structure is always embedded into a digital signature represented by XML elements of the XML Signature standard.',NULL,NULL),
