	 ('32f649b7-ee47-4b27-bb1f-bf99df57ee8b','2022-11-14 13:48:33.389694','2022-11-14 13:48:33.389694',NULL,'ad18edf3-0148-41c7-898a-aa84e10c3b10','',NULL,NULL,NULL,1,false,true,false,'13','Template for iWork 13, Apple''s office productivity suite, compatible with macOS and iOS operating systems. It is also available cross-platform through the iCloud website. iWork13 template files use a standard Zip file to store XML content together with other associated data, including index, Metadata and preview files.',NULL,NULL),
	 ('b72bf4f8-9b33-41c8-ba6a-513b46f8e800','2022-11-14 13:48:34.056155','2022-11-14 13:48:34.056155',NULL,'2e2b3bc7-4a34-4fcb-815f-de41c0e72e50','',NULL,NULL,NULL,1,false,true,false,'','Apple Lossless, also known as Apple Lossless Audio Codec (ALAC), or Apple Lossless Encoder (ALE), is an audio codec developed by Apple Inc. for lossless data compression of digital music. Apple Lossless data is stored within an MP4 container with the filename extension .m4a.',NULL,NULL),
