	 ('9996021a-ff60-43e4-90f1-67cb4c9a0b3f','2022-11-14 13:50:07.066786','2022-11-14 13:50:07.066786',NULL,'d4057b4a-2ca2-411e-b21a-dae231e78434','',NULL,NULL,NULL,1,false,true,false,'','AutoCAD slide files are screen images. A slide file consists of a header portion and one or more data records of variable length. Data records follow the header. Each data record begins with a field whose high-order byte is the record type. If a slide contains any vectors at all, a New colour record will be the first data record. The order of the vectors in a slide, and the order of the endpoints of those vectors, may vary.
