	 ('c5182bc9-23bf-4806-a4ad-16a988628c2a','2022-11-14 13:51:35.780358','2022-11-14 13:51:35.780358',NULL,'25a57708-db03-49b5-822d-1a4f5e748ef6','',NULL,NULL,NULL,1,false,true,false,'ASCII','TrueSpace was a commercial 3D computer graphics and animation software originally developed by Caligari Corporation before being acquired by Microsoft. The .scn extension indicates a scene, the .cob extension indicates an object.',NULL,NULL),
	 ('3f154c13-51d8-4711-9d8d-764ef4cc760f','2022-11-14 13:51:36.845695','2022-11-14 13:51:36.845695',NULL,'55c2a724-1f80-490b-8d0f-b04dddd33b39','',NULL,NULL,NULL,1,false,true,false,'Binary','TrueSpace was a commercial 3D computer graphics and animation software originally developed by Caligari Corporation before being acquired by Microsoft. The .scn extension indicates a scene, the .cob extension indicates an object.',NULL,NULL),
	 ('e1588fb3-9203-4e72-b098-fd94e7140e4b','2022-11-14 13:51:39.483352','2022-11-14 13:51:39.483352',NULL,'83b910ca-bef4-4f2d-8935-dabcb62afc8b','',NULL,NULL,NULL,1,false,true,false,'','CAL is an image file format used by CALS. CAL files are compressed bitmap formatted files used for storing monochrome images. CAL files were developed in the 1980s to standardize graphics data interchange for electronic publishing for the federal government.',NULL,NULL),
	 ('708ce78a-2148-480f-8993-2201788e52b4','2022-11-14 13:51:41.178448','2022-11-14 13:51:41.178448',NULL,'8c09b0da-8045-40c6-95d7-c8deb50007c8','http://www.premierepro.org/2016/10/canon-xf-c300-xf305-folder-structure-and-file-naming-explained/',NULL,NULL,NULL,1,false,true,false,'','A Canon CIF file is present in the Canon XF folder structure that is used by media cards associated with cameras such as XF205 and C300. It contains information identifying the clip and the camera used, including type, serial number and version. Additionally, it stores some information which can be seen and edited in the Canon XF Utility, such as the Clip Status (OK/Check/None). It is found within each CANON XF/CLIPS 001/AAxxxx directory, where xxxx is an automatically generated number beginning with 0001. A full copy of the file exists within the INDEX.MIF file (fmt/1749) found within the CANONXF/CLIPS001 directory. Although little official documentation exists, CIF likely stands for Clip Information File.',NULL,NULL),
	 ('8146b9d2-bb52-4175-9b08-c38a31283659','2022-11-14 13:51:44.433225','2022-11-14 13:51:44.433225',NULL,'d9ac8d55-9885-4363-b81f-74adbe1246c5','',NULL,NULL,NULL,1,false,true,false,'1.0','The .CRW file format (Canon RAW version 1) is a digital photography RAW format created by Canon.',NULL,NULL),
	 ('d3009635-f652-4438-b5fe-f35ab35a19c1','2022-11-14 13:51:47.40432','2022-11-14 13:51:47.40432',NULL,'968aeba0-ffd1-45c4-9072-ebc454496083','http://www.premierepro.org/2016/10/canon-xf-c300-xf305-folder-structure-and-file-naming-explained/',NULL,NULL,NULL,1,false,true,false,'','A Canon SIF file is present in the Canon XF folder structure that is used by media cards associated with cameras such as XF205 and C300. It is created whenever a video file is shot and exceeds the 2GB file size limit imposed by the FAT32 filesystem. In this case, an SIF file is created for each corresponding MXF file. It is found within the CANON XF/CLIPS 001/AAxxxx directory, where xxxx is an automatically generated number beginning with 0001. Although little official documentation exists, SIF likely stands for Shot/Segment/Span Information File. The precise contents of the file format have not yet been established, but its existence is necessary in order to import spanned clips into Canon media apps.',NULL,NULL),
	 ('4c396a52-7f4f-463e-879d-7d472f352117','2022-11-14 13:51:48.098585','2022-11-14 13:51:48.098585',NULL,'17fa03e4-fade-4776-8ba1-714f87e62613','https://support.captureone.com/hc/en-us/categories/360000279017-User-Guide',NULL,NULL,NULL,1,false,true,false,'','File created by created by Capture One software which performs photo editing, raw image file processing of many different raw file types, and image cataloguing. Capture One does not make changes to the original RAW file, instead storing them as adjustments within these component files: Cos files contain the adjustments made to images.',NULL,NULL),
