	 ('e999d201-bf8d-435d-9d84-fcbab9c89281','2022-11-14 14:01:40.826856','2022-11-14 14:01:40.826856',NULL,'212f8db3-0203-4f5a-80a4-ae8be5cfcaff','',NULL,NULL,NULL,1,false,true,false,'','A Microsoft Access Workgroup Information File stores the usernames and passwords for users and groups that require access to a Microsoft Access database. Compatible with MDB formats (Access 97-2003) rather than the later ACCDB format (Access 2007-2010).',NULL,NULL),
	 ('fb2ba73e-05f6-43cd-8e7b-a1316b802e5f','2022-11-14 14:02:04.166763','2022-11-14 14:02:04.166763',NULL,'f62e7122-8604-4580-82bd-59e0f4704eb5','',NULL,NULL,NULL,1,false,true,false,'4.0','This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select Add an Entry.',NULL,NULL),
	 ('1c6c43af-4da8-413f-878f-817da33fee88','2022-11-14 14:01:41.663392','2022-11-14 14:01:41.663392',NULL,'63d1595c-cbd4-4b18-8685-1582436d30b9','',NULL,NULL,NULL,1,false,true,false,'','Animated Cursor Format (ANI), also known as Windows NT Animated Cursor, is a chunk-based bitmap format developed by Microsoft, based on the generic Resource Interchange File Format (RIFF) specification developed by Microsoft and IBM. Structurally, an ANI file is composed of a number of chunks, each comprising a four character code chunk identifier, the chunk size, and the chunk data. It comprises a RIFF header with an ANI data type identifier, followed by a series of chunks which contain two or more bitmaps stored in an ANI file. Each bitmap is typically either a Windows cursor or icon data, but may also be raw, uncompressed bitmaps. Additional information stored in the ANI file controls the rate and the sequence in which each frame is displayed.
