	 ('971a6859-733d-4ce7-bcdf-c96af667fc22','2022-11-14 14:11:12.012697','2022-11-14 14:11:12.012697',NULL,'a8f5bada-44f1-4afe-ae3e-bba29d09ea49','',NULL,NULL,NULL,1,false,true,false,'','QBB file format used by QuickBooks for their backup files. It is used to manage inventory, payroll, sales and other needs of a business. QuickBooks includes many features such as marketing tools, product and suppliers, merchant services and training solutions. QBB files are the backups files QuickBooks QBW files containing all financial records, logos, images, letters, and templates.',NULL,NULL),
	 ('faa1170d-6283-41e1-954b-fc845117319d','2022-11-14 14:11:12.469752','2022-11-14 14:11:12.469752',NULL,'6ff5e95a-0948-4955-bb87-037e352efa22','',NULL,NULL,NULL,1,false,true,false,'','3DMF is the interchange format for the QuickDraw 3D software package originally created in 1995 for the Apple Macintosh. It is a three-dimensional image format which may be a representation of an individual object or a complete three-dimensional scene, which can be viewed from different angles with supporting 3D programs.',NULL,NULL),
