	 ('49372333-91ab-43c7-bd13-7271092ba8ff','2022-11-14 14:11:15.722528','2022-11-14 14:11:15.722528',NULL,'b1ce63c7-1e97-422f-843f-a89e55a0b930','',NULL,NULL,NULL,1,false,true,false,'','The Quicken Interchange Format (QIF) is a specially formatted ASCII file used in financial transactions. This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select Add an Entry.',NULL,NULL),
	 ('247ff8fd-5034-47c3-b799-04066a59f557','2022-11-14 14:11:16.518037','2022-11-14 14:11:16.518037',NULL,'76777283-1429-446d-8618-2f71ac99377e','https://support.apple.com/kb/DL837?locale=en_US',NULL,NULL,NULL,1,false,true,false,'','The QuickTime file format is a format for storing multimedia content, principally video, developed by Apple. The basic data unit in a QuickTime file is the atom. Each atom contains size and type information along with its data. The size field indicates the number of bytes in the atom, including the size and type fields. The type field specifies the type of data stored in the atom and, by implication, the format of that data. Atoms are hierarchical in nature. That is, one atom can contain one or more other atoms of varying types. For example, a movie atom contains one track atom for each track in the movie. The track atoms, in turn, contain one or more media atoms each, along with other atoms that define other track and movie characteristics. This hierarchical structure of atoms is referred to as a containment hierarchy. A QuickTime file is simply a collection of atoms. QuickTime does not impose any rules about the order of these atoms.
